	(53, '\'Akcesorium do krojenia ciasta Koziol ELLI pastelowy błękit KZ-3657414\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3657414\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Akcesorium do porcjowania ciasta niemieckiej marki Koziol jest bardzo przydatne w kuchni podczas wielu uroczystości rodzinnych. Przy jego użyciu krojenie tortu, tarty i innych okrągłych ciast na równe kawałki staje się łatwe, proste i przyjemne. Do tego wygląda bardzo efektownie, dzięki uchwytowi w kształcie sympatycznej sowy Elli. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Elli</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7,7 cm<br class="def">\ndługość - 7,7 cm<br class="def">\nszerokość - 7,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">niebieski</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Akcesorium-do-krojenia-ciasta-Koziol-ELLI-pastelowy-blekit-KZ-3657414-p4139\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Narzędzia kuchenne/Inne narzędzie kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Akcesorium-do-krojenia-ciasta-Koziol-ELLI-pastelowy-blekit-KZ-3657414_[10135]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Akcesorium-do-krojenia-ciasta-Koziol-ELLI-pastelowy-blekit-KZ-3657414_[10136]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Akcesorium-do-krojenia-ciasta-Koziol-ELLI-pastelowy-blekit-KZ-3657414_[10137]_1200.jpg"}\''),
