	(66, '\'Blender 1400W Tefal Premium srebrny BL850D38\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'BL850D38\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Blender 1400W uznanej marki TEFAL z serii Premium. Wyróżnia go nie tylko doskonała jakość wykonania, ale także ciekawy, światowy design! \nBlenderowi Tefal Premium żaden składnik się nie oprze. Dzięki 3 inteligentnym programom (smoothie, kruszenie lodu, automatyczne czyszczenie), podświetlanemu regulatorowi prędkości, mocy 1400W i potrójnym ostrzą ze stali nierdzewnej zawsze uzyskasz doskonały koktajl, który można zabrać do pracy bądź szkoły. Urządzenie jest wyposażone w dzbanek kielichowy ze szkła odpornego na nagłe zmiany temperatury do 80&deg;C. Posiada wysokiej jakości korpus ze stali nierdzewnej. Jest łatwy do czyszczenia. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Premium</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">pojemność - 1,75L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">szkło, tworzywo sztuczne</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Moc: 1400W\nzmiany temperatury: do 80°C\nilość programów: 3 (smoothie, kruszenie lodu, automatyczne czyszczenie)\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Blender-1400W-Tefal-Premium-srebrny-BL850D38-p5658\',', '\'409\',', '\'332.52\',', '\'332.52\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18121]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18126]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18127]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18128]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18129]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18130]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18131]_1200.jpg","7":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18132]_1200.jpg","8":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Blender-Premium-1400W-Tefal-srebrny-BL850D38_[18133]_1200.jpg"}\''),
	(67, '\'Ceramiczny młynek do przypraw 16 cm Aida Denmark Great guys A20112\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'A20112\',', 0, '\'Aida Denmark\',', NULL, 0, NULL, NULL, '\'.\',', '\'Młynek ceramiczny do soli i pieprzu duńskiej marki Aida z kolekcji Poul Pava Great guys. \nUnikalna kolekcja marki Aida stworzona we współpracy z duńskim artystą. Poul Pava specjalizuje się w rysunkach malowanych jakby kredką przez dziecko. Wyjątkowa ekspresja, odważne kolory, niespotykane postacie - przenoszą w beztroski świat wyobraźni i swobody. Owoce współpracy Aida z Poul Pava zyskały swoich wielbicieli dzięki połączeniu odważnych projektów z doskonałą jakością duńskiej marki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Great guys</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 16 cm</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Ceramiczny-mlynek-do-przypraw-16-cm-Aida-Denmark-Great-guys-A20112-p2025\',', '\'139\',', '\'113.01\',', '\'113.01\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Młynki do przypraw\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Ceramiczny-mlynek-do-przypraw-16-cm-Great-guys-A20112_[4088]_1200.jpg"}\''),
	(68, '\'Cooler z nadrukiem do butelek Koziol PURE HAPPY NEW YEAR biały KZ-3667525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3667525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Cooler z nadrukiem HAPPY NEW YEAR niemieckiej marki Koziol., choć został wykonany z wysokiej jakości tworzywa sztucznego, to i tak prezentuje się elegancko i pięknie na stole. Z sukcesem może konkurować z coolerem szklanym, porcelanowym, stalowym. Stożkowy kształt sprawia, że produkt ma prostą formę, a zarazem niezwykłą, dlatego dopasuje się do każdego wnętrza. Z pewnością sprawdzi się podczas wystawnych przyjęć chłodząc wino oraz&nbsp; szampan, a także w upalne, letnie dni schładzając coca cole, sok oraz wodę. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">PURE HAPPY NEW YEAR</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 25,5 cm<br class="def">\ndługość - 18,3 cm<br class="def">\nszerokość - 25,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Cooler-z-nadrukiem-do-butelek-Koziol-PURE-HAPPY-NEW-YEAR-bialy-KZ-3667525-p4151\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Coolery i pojemniki na lód\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Cooler-z-nadrukiem-do-butelek-Koziol-PURE-HAPPY-NEW-YEAR-bialy-KZ-3667525_[10184]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Cooler-z-nadrukiem-do-butelek-Koziol-PURE-HAPPY-NEW-YEAR-bialy-KZ-3667525_[10185]_1200.jpg"}\''),
