	(81, '\'Deska do krojenia Koziol SNAP 2.0 biała KZ-3264525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3264525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Składana deska do krojenia Koziol Snap to świetne rozwiązanie podczas gotowania. Pokrojone warzywa, owoce, zioła czy inne produkty można wrzucić do naczynia składając deskę w pół. Dzięki temu wszystko precyzyjnie trafi w odpowiednie miejsce, bez obaw rozrzucenia na blacie czy na podłogę. Dodatkowo wzdłuż wszystkich brzegów umieszczono niewielkie wgłębienie pozwalające na zbieranie soków z krojonego produktu. \n Deska dostępna w dwóch kształtach prostokątnym o zaokrąglonych rogach lub prostokątnym z charakterystycznym jednym bokiem wydłużonym. \n &nbsp; \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Snap 2.0</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 0,08 cm<br class="def">\ndługość - 49,2 cm<br class="def">\nszerokość - 27,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Deska-do-krojenia-Koziol-SNAP-2-0-biala-KZ-3264525-p4715\',', '\'76\',', '\'61.79\',', '\'61.79\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Deski do krojenia\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Deska-do-krojenia-Koziol-SNAP-2-0-biala-KZ-3264525_[12158]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Deska-do-krojenia-Koziol-SNAP-2-0-biala-KZ-3264525_[12159]_1200.jpg"}\''),
