	(100, '\'Dozownik do mydła 250 ml Koziol FLOW kobaltowy KZ-5879484\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5879484\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Dozownik do mydła to niezbędne akcesorium w każdej łazience. Przedstawiony tu produkt posiada prostą, opływową formę pozwalającą na dopasowanie się do każdego wystroju łazienki. Gładka powierzchnia produktu sprzyja utrzymaniu go w perfekcyjnej czystości. Niepodważalną zaletą dozownika Flow jest możliwość napełniania nie przez wąską dziurkę jak w tradycyjnych dozownikach, a przez otwór całej szerokości. Dzięki wyjmowanemu nie tylko dozownikowi, a całej górnej części.&nbsp;&nbsp; \n Wykonany z wysokiej jakości tworzywa sztucznego czyniącego dozownik odpornym na większość prób uszkodzeń. Półprzezroczysty, dzięki czemu na bieżąco można kontrolować dostępny poziom mydła. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Flow</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 17,7 cm<br class="def">\nśrednica - 8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Dozownik-do-mydla-250-ml-Koziol-FLOW-kobaltowy-KZ-5879484-p5646\',', '\'55\',', '\'44.72\',', '\'44.72\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Dozowniki do mydła i mydelniczki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/16000-17000\\/Dozownik-do-mydla-250-ml-Koziol-FLOW-kobaltowy-KZ-5879484_[16732]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Dozownik-do-mydla-250-ml-Koziol-FLOW-kobaltowy-KZ-5879484_[18234]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Dozownik-do-mydla-