	(104, '\'Drzewko na biżuterię 43,5 cm Koziol PI:P L pastelowy róż KZ-5262392\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5262392\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Biżuteria może nie rośnie na drzewach, ale świetnie się prezentuje umieszczona na drzewku na błyskotki z serii PI:P. Eleganckie, niekonwencjonalne... drzewko z tacką na biżuterię PI:P to gadżet dla kobiet lubiących błyskotki. Pomaga uporządkować kolekcję biżuterii i trzymać drobiazgi zawsze w odpowiednim miejscu. Głęboka tacka może służyć do gromadzenia kolczyków, pierścionków, zegarków i innych drobnych akcesoriów, natomiast gałęzie drzewka&nbsp; to doskonale miejsce na bransoletki i naszyjniki.&nbsp; Drzewko Pi:P&nbsp; swoim swobodnym wyjątkowym wyglądem na pewno wzbogaci niejedno wnętrze. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">PI:P</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 43,5 cm<br class="def">\ndługość - 27,6 cm<br class="def">\nszerokość - 12,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Drzewko-na-bizuterie-43-5-cm-Koziol-PI-P-L-pastelowy-roz-KZ-5262392-p4166\',', '\'114\',', '\'92.68\',', '\'92.68\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Stojaki na biżuterię\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Drzewko-na-bizuterie-Koziol-43-5-cm-PI-P-L-pastelowy-roz-KZ-5262392_[10215]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Drzewko-na-bizuterie-Koziol-43-5-cm-PI-P-L-pastelowy-roz-KZ-5262392_[10216]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Drzewko-na-bizuterie-Koziol