	(118, '\'Durszlak Forme Casa biały FC-27805011\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-27805011\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Durszlak od włoskiej marki Forme Casa charakteryzuje się prostotą formą wykonania, ciekawym kolorem oraz funkcjonalnością.&nbsp; Przedstawiona forma doskonale sprawdzi się w każdej kuchni, gdzie najważniejsza jest użyteczność przedmiotu. Wykonany z wysokiej jakości tworzywa sztucznego powoduje, że jest odporny na uszkodzenia. Durszlak dostępny jest w całej gamie kolorów i doskonale pasuje do innych produktów tej marki. Łatwy w utrzymaniu czystości.&nbsp; Sprawdzi się także jako ciekawa dekoracja kuchennego blatu. Na spodzie znajduje się wysoki rant pozwalający na stawianie durszlaka na płaskich powierzchniach. \n Marka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczne dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 13,3 cm<br class="def">\nszerokość - 27,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Durszlak-Forme-Casa-bialy-FC-27805011-p4092\',', '\'32\',', '\'26.02\',', '\'26.02\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Durszlaki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Durszlak-Forme-Casa-bialy-FC-27805011_[9950]_1200.jpg"}\''),
	(119, '\'Dywanik łazienkowy 60x100 cm Kleine Wolke Relax orzechowy KW-5405264360\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KW-5405264360\',', 0, '\'Kleine Wolke\',', NULL, 0, NULL, NULL, '\'.\',', '\'Wysokiej jakości, gruby, gęsty dywanik łazienkowy niemieckiej marki&nbsp;Kleine Wolke. Wykonany w 100% z poliakrylu, czyli antyalergicznego materiału odpornego na zanieczyszczenia i bakterie. Przyjemny w dotyku, posiada miękkie i gładkie włókna (bardzo podobny do wełny). Dywanik posiada wysokie runo, które bardzo długo zachowuje swoje właściwości (nie udepuje się). Odpowiedni także przy ogrzewaniu podłogowym. \nZalecenie pielęgnacji: Pranie w pralce w termeratrze max. 40 st. C, nie wybielać, suszyć bębnowo przy zredukowanych obrotach, nie prasować. \nKleine Wolke to marka istniejąca od 1793, z siedzibą w Bergen (Niemcy). Nieprzerwanie lider na rynkiu ekskluzywnych dywanów łazienkowych. Główne punkty filozofii marki to ponadprzeciętna jakość oraz trwałość wyrobów. Produkty są całkowicie bezpieczne dla ekologii człowieka o co dba się poprzez ścisłe kontrole jakości na każdym etapie. Firma charakteryzuje się szybką reakcją na najnowsze trendy oraz elastycznością i wykorzystaniem najlepszych technologii produkcyjnych. Kleine Wolke to zawsze dobry wybór dla ceniących komfort, piękno i klasę. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 3 cm<br class="def">\ndługość - 100 cm<br class="def">\nszerokość - 60 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">100% Poliakryl</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Dywanik-lazienkowy-60x100-cm-Kleine-Wolke-Relax-orzechowy-KW-5405264360-p4003\',', '\'289\',', '\'234.96\',', '\'234.96\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Dywaniki Łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Dywanik-lazienkowy-60x100-cm-Kleine-Wolke-Relax-orzechowy-KW-5405264360_[8390]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Dywanik-lazienkowy-60x100-cm-Kleine-Wolke-Relax-orzechowy-KW-5405264360_[8391]_1200.jpg"}\''),
