	(171, '\'Grill elektryczny Tefal Optigrill + Initial GC706D34\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'GC706D34\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Majowe wielkie GRILLOWANIE od teraz tylko z grillem Optigril Tefal. Doskonały produkt pod każdym względem. Grill elektryczny to dobra alternatywa dla tradycyjnych grillów węglowych, do tego jego użycie jest całkowicie odporne na pogodę. Zawsze możesz użyć grilla Optigrill w swoim domowym zaciszu, zwłaszcza gdy pogoda za oknem nie zachęca do wyjścia. \nW grillu Tefal przygotujesz: kiełbaski, steki, ryby, warzywa, hamburgery, grzyby, tosty i wiele, wiele innych. Pomoże w przygotowywaniu posiłków w każdej porze dnia. Przygotowywane potrawy w grillu elektrycznym są zdrowsze, bogatsze w składniki odżywcze i smaki, pozbawione dużej ilości tłuszczu. \nGrill jest w pełni zautomatyzowany. Wystarczy włożyć produkt do przetworzenia do środka, wybrać odpowiedni program&nbsp; (do warzyw, do steków, do ryb ...) a grill sam dobierze odpowiedni czas i temperaturę obróbki. Wystarczy nacisnąć jeden przycisk, aby wyczarować pyszne, zdrowę i robiące duże wrażenie danie! \n &nbsp; \n 6 programów działania: \n \n hamburger \n \n kurczak \n \n panini \n \n kiełbasa \n \n czerwone mięso \n \n ryby \n \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Optigrill + Initial</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def"><strong class="def">wymiary płyty grillującej::</strong><br class="def">\ndługość - 28 cm<br class="def">\nszerokość - 20 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Moc:: 2000W\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Grill-elektryczny-Tefal-Optigrill-Initial-GC706D34-p5669\',', '\'625\',', '\'508.13\',', '\'508.13\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Grill-elektryczny-Tefal-Optigrill-Initial-GC706D34_[18184]_1200.jpg"}\''),
	(172, '\'Karmnik dla ptaków Koziol PI:P musztardowo-czarny KZ-2018450\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2018450\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Musztardowo-czarny karmnik dla ptaków niemieckiej marki Koziol z serii Pi:p to niezwykła propozycja dla naszych małych przyjaciół. Wiele ptaków nie odlatuje na zimę, dlatego warto zadbać o nie w te najmroźniejsze dni. Karmnik Pi:p zachwyca swoją formą, kształtem, a także kolorystyką; przybrał on formę statku kosmicznego o niecodziennym zabarwieniu. Karmnik został wyposażony w specjalny dozownik pokarmu, który porcjuje wymaganą na dany moment ilość ziarna. Ptaki siadają na krawędzi karmnika, dzięki czemu nie dostają się do pokarmu i zmniejszone są szanse na zakażenie lub zabrudzenie karmy. Dzięki specjalnej konstrukcji karmnika ziarno wewnątrz nie wilgotnieje, ponieważ jest ono zabezpieczone przed deszczem i wiatrem. Karmnik jest łatwy do napełnienia - wystarczy podnieść górną pokrywę, a następnie nasypać do wewnętrznego pojemnika karmę.&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">PI:P</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 11 cm<br class="def">\nśrednica - 26 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Karmnik-dla-ptakow-Koziol-PI-P-musztardowo-czarny-KZ-2018450-p4177\',', '\'169\',', '\'137.4\',', '\'137.4\',', NULL, '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Karmnik-dla-ptakow-Koziol-PI-P-musztardowo-czarny-KZ-2018450_[10258]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Karmnik-dla-ptakow-Koziol-PI-P-musztardowo-czarny-KZ-2018450_[10259]_1200.jpg"}\''),
