	(175, '\'Kieliszek do szampana 100 ml Koziol CHEERS CHAMPAGNE antracytowy KZ-3408540\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3408540\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Czy marzyłeś kiedyś o kieliszku, który się nigdy nie stłucze? Jeżeli tak to mamy dobrą wiadomość. Marka Koziol spełniła Twoje marzenie i stworzyła unikatową kolekcją nietłukących się szklanek, kieliszków do wina, kieliszków do szampana wydanej pod nazwą Koziol SUPERGLAS. Co prawda są stworzone z tworzywa sztucznego, ale tak jak prawdziwe szkło odbijają i załamują światło w podobny sposób. Z pewnością nie dostrzeżesz różnicy, a wiele zyskasz. Naczynia są dostępne w kilku kolorach z ciekawymi nadrukami. Dzięki czemu można zakupić zestaw różnorodnych kieliszków i nigdy więcej nie spotkać z problemem &ldquo;który to jest mój kieliszek?&rdquo;.&nbsp; \n Przedstawiony tu produkt to kieliszek do szampana w kolorze antracytowym. \n Naczynia z serii Koziol Superglas sprawdzą się świetnie podczas rodzinnych spotkań,&nbsp; większych imprez oraz w plenerze.&nbsp; \n&nbsp; \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">CHEERS CHAMPAGNE</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 14,5 cm<br class="def">\nśrednica - 6,5 cm<br class="def">\npojemność - 100 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kieliszek-do-szampana-100-ml-Koziol-CHEERS-CHAMPAGNE-antracytowy-KZ-3408540-p5018\',', '\'33\',', '\'26.83\',', '\'26.83\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Kieliszki i pucharki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Kieliszek-do-szampana-100-ml-Kozio