	(233, '\'Komplet kamieni ozdobnych do biokominków Biała Perła EF-002\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'EF-002\',', 0, '\'EcoFire\',', NULL, NULL, NULL, NULL, '\'.\',', '\'Komplet kamieni do dekorowania biokominków. Kamienie pełnią funkcję ozdobną. Ustawione obok palnika w biokominku są ciekawą dekoracją, prezentując się świetnie zarówno podczas występowania płomienia jak i przy zgaszonym biokominku. Komplet wystarcza do udekorowania biokominka o szerokości 90 cm. Kamienie są naturalne (nie są malowane). \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Stone</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Komplet: 5 szt.\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Komplet-kamieni-ozdobnych-do-biokominkow-Biala-Perla-EF-002-p2202\',', '\'14.9\',', '\'12.11\',', '\'12.11\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Kamienie do biokominków\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Komplet-kamieni-ozdobnych-do-biokominkow-Biala-Perla-EF-002_[4494]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Komplet-kamieni-ozdobnych-do-biokominkow-Biala-Perla-EF-002_[4495]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Komplet-kamieni-ozdobnych-do-biokominkow-Biala-Perla-EF-002_[4496]_1200.jpg"}\''),
