	(245, '\'Kosz 3,25L Koziol JIM biały KZ-5772525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5772525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Kosz na śmieci wykonany z odpornego na uszkodzenia, lekkiego tworzywa sztucznego. Zamykany jest pokrywą z obrotową klapką, która nie pozwoli na wydostawanie się nieprzyjemnych zapachów na zewnątrz i ułatwi użytkowanie. Kosz wyróżnia się doskonałym połączeniem prostej i klasycznej formy z intensywnym, żywym kolorem. Wybierz pasujący do Twojego wnętrza kolor wśród szerokiej gamy kolorystycznej. Kosz wydaje się malutki, ale jest bardzo pojemny (3,25L) \n Estetyczny kosz wyróżni się w domu i wprowadzi do Twojego domu porządek. Sprawdza się w łazience oraz kuchni. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 31,5 cm<br class="def">\ndługość - 19,1 cm<br class="def">\nszerokość - 17,5 cm<br class="def">\npojemność - 3,25L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kosz-3-25L-Koziol-JIM-bialy-KZ-5772525-p4073\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Kosze łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Kosz-3-25L-JIM-bialy-KZ-5772525_[9846]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Kosz-3-25L-JIM-bialy-KZ-5772525_[9847]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Kosz-3-25L-JIM-bialy-KZ-5772525_[9848]_1200.jpg"}\''),
