	(250, '\'Kosz 3,25L Koziol JIM szary KZ-5772632\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5772632\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Kosz na śmieci wykonany z odpornego na uszkodzenia, lekkiego tworzywa sztucznego. Zamykany jest pokrywą z obrotową klapką, która nie pozwoli na wydostawanie się nieprzyjemnych zapachów na zewnątrz i ułatwi użytkowanie. Kosz wyróżnia się doskonałym połączeniem prostej i klasycznej formy z intensywnym, żywym kolorem. Wybierz pasujący do Twojego wnętrza kolor wśród szerokiej gamy kolorystycznej. Kosz wydaje się malutki, ale jest bardzo pojemny (3,25L) \nEstetyczny kosz wyróżni się w domu i wprowadzi do Twojego domu porządek. Sprawdza się w łazience oraz kuchni. \nPoglądy marki Koziol najlepiej oddaje slogan Art At Work. Wszystkie produkty tej marki to małe dzieła sztuki projektowane tak aby spełniały swoją funkcję użytkową, a zarazem wprowadzały odrobinę humoru i ciekawego designu do wnętrza. Dzięki marce Koziol zwykłe przedmioty kuchenne i łazienkowe codziennego użytku stają się niezwykłe. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Jim</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">pojemność - 3,25L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kosz-3-25L-Koziol-JIM-szary-KZ-5772632-p4022\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Kosze łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Kosz-3-25L-JIM-szary-KZ-5772632_[9644]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Kosz-3-25L-JIM-szary-KZ-5772632_[9645]_1200.jpg","2":"http