	(255, '\'Kosz na odpady organiczne Koziol BIBO biały KZ-5605525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5605525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kosz na odpady organiczny BIBO to wyjątkowy produkt posiadający same zalety. Ciekawy, niespotykany kształt, z wyczuciem połączone kolory zaokrąglony, wygodny uchwyt to wielkie atuty kosza BIBO. Do tego jest łatwy w otrzymaniu czystości i posiada higieniczne zamykanie nie pozwalające na gromadzenie się muszek i przenoszenie się zapachu. Wybierz pasujący do Twojego wnętrza kolor wśród kilku kolorystyk do wyboru i zadbaj o czystość i porządek w swoim domu. Estetyczny kosz na pewno będzie dobrą ozdobą Twojego domu. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Bibo</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 31,8 cm<br class="def">\ndługość - 40,7 cm<br class="def">\nszerokość - 6,9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kosz-na-odpady-organiczne-Koziol-BIBO-bialy-KZ-5605525-p4910\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Kosz na odpady organiczne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Kosz-na-odpady-organiczne-Koziol-BIBO-bialy-KZ-5605525_[13248]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Kosz-na-odpady-organiczne-Koziol-BIBO-bialy-KZ-5605525_[13249]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Kosz-na-odpady-organiczne-Koziol-BIBO-bialy-KZ-5605525_[13250]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Kosz-na-odpady-organiczne-Koziol-BIBO-