	(260, '\'Kosz na śmieci 0,9L Koziol DEL XXS kobaltowy KZ-5779585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5779585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kosz na śmieci wykonany z odpornego na uszkodzenia, lekkiego tworzywa sztucznego. Zamykany jest pokrywą z obrotową klapką, która nie pozwoli na wydostawanie się nieprzyjemnych zapachów na zewnątrz i ułatwi użytkowanie. Kosz wyróżnia się doskonałym połączeniem prostej i klasycznej formy z intensywnym, żywym kolorem. Wybierz pasujący do Twojego wnętrza kolor wśród szerokiej gamy kolorystycznej oraz z pięciu rozmiarów: \n- XXS pojemność 0,9L \n- XS pojemność 2L \n- S pojemność 5L \n- M pojemność 12L \n- XL pojemność 30L \nEstetyczny kosz wyróżni się w domu i wprowadzi do Twojego domu porządek. Sprawdza się w łazience oraz kuchni. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Del</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 18,7 cm<br class="def">\nśrednica - 12,7 cm<br class="def">\npojemność - 0,9 l </strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kosz-na-smieci-0-9L-Koziol-DEL-XXS-kobaltowy-KZ-5779585-p4777\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Kosze łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Kosz-na-smieci-0-9L-Koziol-DEL-XXS-kobaltowy-KZ-5779585_[12245]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Kosz-na-smieci-0-9L-Koziol-DEL-XXS-kobaltowy-KZ-5779585_[12408]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Kosz-na-smieci-0-9L-Koziol-DEL-XXS-kobaltowy-K