	(272, '\'Krajacz do jabłek Koziol TYLER malinowy KZ-3217583\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3217583\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Tyler to nowoczesny krajacz do jabłek, który sprawia, że krojenie jabłka na części staje się szybkie i proste, wszystkie części są równe, a ogryzek jest w pełni oddzielony. Wszystko to dzięki jednemu narzędzi i jednemu płynnemu ruchowi.&nbsp; Tyler z pewnością sprawi, że więcej zdrowych jabłek zagości na stole. Dzięki niemu dzieci chętnie będą sięgać po zdrowe przekąski. Dostępny w dwóch wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tyler</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 3,5 cm<br class="def">\ndługość - 8,4 cm<br class="def">\nszerokość - 13,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czerwony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Krajacz-do-jablek-Koziol-TYLER-malinowy-KZ-3217583-p4219\',', '\'38\',', '\'30.89\',', '\'30.89\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Inne akcesoria kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Krajacz-do-jablek-Koziol-TYLER-malinowy-KZ-3217583_[10389]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Krajacz-do-jablek-Koziol-TYLER-malinowy-KZ-3217583_[10390]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Krajacz-do-jablek-Koziol-TYLER-malinowy-KZ-3217583_[10391]_1200.jpg"}\''),
