	(274, '\'Krajalnica do warzyw, jajek i sera w kostkę Jolko ręczna JO-2805015\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'JO-2805015\',', 0, '\'Jolko\',', NULL, 0, NULL, NULL, NULL, '\'Ręczna krajalnica do warzyw polskiej marki&nbsp;Jolko. Precyzyjnie kroi w plastry lub w równą kostkę (8x8 mm). \n Świetnie sprawdzi się jako krajalnica do jajek, sera mozarella czy pomidorów w plasterki idealne na kanapki. \nUłatwi także krojenie serów miękkich (jak mozarella czy feta) w plastry lub kostkę idealną do sałatki. \nSzczególnie polecana by w łatwy sposób przygotować gotowane warzywa do zupy. \nJest to tez sprawdzona krajalnica do owoców. Szybko pokroisz miękkie owoce w plastry i zapakujesz np. do lunchboxa. \nUżytkowanie krajanicy do warzyw Jolko jest bardzo proste. Wystarczy położyć warzywo na podstawce i zamknąć urządzenie. \nJuż wtedy uzyskujemy idealne plastry. Aby kroić warzywa w kostke wystarczy dodatkowo przesunąć nakładkę i tym samym przecisąć warzywo przez krojące sitko. \nProstaw w uzytkowaniu oraz w utrzymaniu w czystości krajalnica sprawdzi się w każdym domu. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 10 cm<br class="def">\ndługość - 18,5 cm<br class="def">\nszerokość - 11 cm<br class="def">\nśrednica - 6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Krajalnica-do-warzyw-jajek-i-sera-w-kostke-Jolko-reczna-JO-2805015-p5656\',', '\'39.9\',', '\'32.44\',', '\'32.44\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Inne akcesoria kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Krajalnica-do-warzyw-jajek-i-sera-w-kostke-Jolko-reczna-JO-2805015_[18076]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Krajalnica-do-warzyw-jajek-i-sera-w-kostke-Jolko-reczna-JO-2805015_[180