	(275, '\'Kubek 400ml Koziol AROMA czarny KZ-3564526\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3564526\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Porcelanowy kubek do caffe latte niemieckiej marki Koziol. Gumowa opaska na kubku pozwala na stabilne trzymanie go w ręce i chroni przed poparzeniami. Połączenie ceramiki i tworzywa sztucznego daje nowoczesny i elegancki efekt. Duża pojemność pozwala cieszyć się ulubioną kawą przez bardzo długi czas. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Aroma</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 13,2 cm<br class="def">\nśrednica - 8,8 cm<br class="def">\npojemność - 400 ml</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kubek-400ml-Koziol-AROMA-czarny-KZ-3564526-p5675\',', '\'81\',', '\'65.85\',', '\'65.85\',', '\'_Import WETRO/Koziol\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Kubek-Koziol-Aroma-400ml-czarny-KZ-3564526_[18199]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Kubek-Koziol-Aroma-400ml-czarny-KZ-3564526_[18198]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Kubek-Koziol-Aroma-400ml-czarny-KZ-3564526_[18200]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Kubek-Koziol-Aroma-400ml-czarny-KZ-3564526_[18201]_1200.jpg"}\''),
