	(298, '\'Kuchenna ściereczka z mikrofibry Ladelle biała LD-30430\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-30430\',', 0, '\'Ladelle\',', NULL, 0, NULL, NULL, '\'.\',', '\'Kochasz gotować, ale sprzątanie w kuchni nie sprawia Ci żadnej przyjemności.&nbsp; \n Kuchenna ściereczka wprowadzi do Twojej kuchni modne kolory, ciekawe wzory i czystość. Pozwoli odświeżyć kuchnię i nadać jej niezwykłęgo szyku. Wykonane z mikrofibry staną się nie tylko piękną dekoracją. ale i pomogą w codziennych obowiązkach domowych \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 70 cm<br class="def">\nszerokość - 50 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">mikrofibra</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kuchenna-sciereczka-z-mikrofibry-Ladelle-biala-LD-30430-p3645\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'KUCHNIA &amp; JADALNIA/Tekstylia kuchenne/Ściereczki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/7000-8000\\/Kuchenna-sciereczka-z-mikrofibry-Ladelle-biala-LD-30430_[7890]_1200.jpg"}\''),
