	(300, '\'Kula śnieżka Koziol MINI KZ-6221100\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-6221100\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kolekcja kul śnieżnych marki Koziol to dekoracje, które wprowadzają spokojny, nastrojowy klimat w pomieszczeniu w którym się znajdują. Pięknie się prezentują i nie dają&nbsp; zapomnieć o czasach gdy w zimę za oknem można było zobaczyć cudownie prószący śnieżek.&nbsp; Idealne na prezent dla bliskich z każdej możliwej okazji. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Mini</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7,6 cm<br class="def">\nśrednica - 9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kula-sniezka-Koziol-MINI-KZ-6221100-p4231\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'DEKORACJE &amp; AKCESORIA/Dekoracje tematyczne/Dekoracje świąteczne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezka-Koziol-MINI-KZ-6221100_[10468]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezka-Koziol-MINI-KZ-6221100_[10469]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezka-Koziol-MINI-KZ-6221100_[10470]_1200.jpg"}\''),
	(301, '\'Kula śnieżna ze światłem Led Koziol LED KZ-6259535\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-6259535\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kolekcja kul śnieżnych marki Koziol to dekoracje, które wprowadzają spokojny, nastrojowy klimat w pomieszczeniu w którym się znajdują. Pięknie się prezentują i nie dają&nbsp; zapomnieć o czasach gdy w zimę za oknem można było zobaczyć cudownie prószący śnieżek.&nbsp;Dodatkowo przedstawiona kula została wyposażona w Światło LED umożliwiające wybranie jednego z 16 kolorów i zmienianie go w dowolnym momencie. Idealna na prezent dla bliskich z każdej możliwej okazji. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Led</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 17,5 cm<br class="def">\nśrednica - 22,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Kula-sniezna-ze-swiatlem-Led-Koziol-LED-KZ-6259535-p4232\',', '\'212\',', '\'172.36\',', '\'172.36\',', '\'DEKORACJE &amp; AKCESORIA/Dekoracje tematyczne/Dekoracje świąteczne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezna-ze-swiatlem-Led-Koziol-LED-KZ-6259535_[10471]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezna-ze-swiatlem-Led-Koziol-LED-KZ-6259535_[10472]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezna-ze-swiatlem-Led-Koziol-LED-KZ-6259535_[10473]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Kula-sniezna-ze-swiatlem-Led-Koziol-LED-KZ-6259535_[10474]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/