	(302, '\'Lampa podłogowa 30,5 cm Koziol ORION szmaragdowa zieleń KZ-1912379\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-1912379\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Relaksujące światło płynące z kulistej lampy Orion wprowadza do pomieszczenia specyficzny nastrój. Minimalistyczna, nowoczesna forma dopasowuje się do pomieszczeń w różnych stylach. Dobierając odpowiedni kolor można stworzyć wyjątkowa&nbsp;atmosferę. Stłumione światło pozwala się uspokoić i odprężyć. Wyjątkowa kula Orion to bardzo charakterystyczny dla marki Koziol projekt, który zdobył sobie już uznanie u wielu zadowolonych użytkowników. Ceni się ją za perfekcyjną niemiecką produkcję oraz wyjątkowy design.&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Orion</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 30,5 cm<br class="def">\nśrednica - 31,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lampa-podlogowa-30-5-cm-Koziol-ORION-szmaragdowa-zielen-KZ-1912379-p4917\',', '\'297\',', '\'241.46\',', '\'241.46\',', '\'LAMPY &amp; MEBLE/Lampy/Lampy stołowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Lampa-podlogowa-30-5-cm-Koziol-ORION-szmaragdowa-zielen-KZ-1912379_[13284]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Lampa-podlogowa-30-5-cm-Koziol-ORION-szmaragdowa-zielen-KZ-1912379_[13285]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Lampa-podlogowa-30-5-cm-Koziol-ORION-szmaragdowa-zielen-KZ-1912379_[13286]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Lampa-podlogowa-30-5-cm-Koziol-ORIO