	(309, '\'Lampa stołowa Koziol MOOD biała KZ-1935525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-1935525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Lampa Mood marki Koziol, przypominająca swoim egzotyczny wulkan, który po włączeniu wygląda jakby zaraz miała nastąpić erupcja. Ale spokojnie lampa nie jest niebezpieczna, wręcz przeciwnie trochę&nbsp; przypomina mile spędzony czas sylwestrowy i wybuchające fajerwerki. Pomimo, że inspiracją do jej stworzenia była natura w czystej postaci, to lampa prezentuje się bardzo wytwornie i elegancko. Swoją obecności zwłaszcza po zmroku wprowadza ciepły, relaksacyjny klimat zachęcający do chwili zapomnienia i odpoczynku. Polecana jest szczególnie jako lampka nocna, ale również sprawdzi się w przedpokoju, salonie oraz sypialni. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Mood</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 27,8 cm<br class="def">\ndługość - 19,7 cm<br class="def">\nszerokość - 19,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lampa-stolowa-Koziol-MOOD-biala-KZ-1935525-p4239\',', '\'186\',', '\'151.22\',', '\'151.22\',', '\'LAMPY &amp; MEBLE/Lampy/Lampy stołowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lampa-stolowa-Koziol-MOOD-biala-KZ-1935525_[10500]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lampa-stolowa-Koziol-MOOD-biala-KZ-1935525_[10501]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lampa-stolowa-Koziol-MOOD-biala-KZ-1935525_[10502]_1200.jpg"}\''),
