	(316, '\'Lunchbox 12,2x16,8x6,6 cm Koziol BASIC biały KZ-3081525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3081525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Co dziś zjesz na lunch? Domowe kanapki, tosty a może owoce?&nbsp; Zdrowe, domowe kanapki i smakowite owoce na lunch to duet idealny, który zawsze możesz&nbsp;mieć ze sobą niezależnie od sytuacji. Wystarczy mały, ale wbrew pozorom bardzo pojemny lunchbox.&nbsp; Pomieści on wszystkie jedzenie, które chcesz zabrać ze sobą do szkoły, do pracy czy wycieczkę. Pudełku&nbsp;na kanapki wykonane zostało z tworzywa sztucznego bezpiecznego dla użytkowników. Ma prosty kształt o zaokrąglonych rogach i charakterystyczne zapięcie. Z takim pudełkiem Twój lunch zawsze będzie bezpieczny, zdrowy i różnorodny. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Basic</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,6 cm<br class="def">\ndługość - 16,8 cm<br class="def">\nszerokość - 12,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">twtworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lunchbox-12-2x16-8x6-6-cm-Koziol-BASIC-bialy-KZ-3081525-p4288\',', '\'29\',', '\'23.58\',', '\'23.58\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki na lunch\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lunchbox-12-2x16-8x6-6-cm-Koziol-BASIC-bialy-KZ-3081525_[10731]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lunchbox-12-2x16-8x6-6-cm-Koziol-BASIC-bialy-KZ-3081525_[10732]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lunchbox-12-2x16-8x6-6-cm-Koziol-BASIC-bialy-KZ-3081525_[10733]_1200.jpg","3":"http:\\/\\/wetro.pl