	(341, '\'Lunchbox z nadrukiem 12,2x16,8x6,6 cm Koziol BASIC BELLA biały KZ-3149525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3149525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Co dziś zje na lunch Twoja pociecha? Domowe kanapki, tosty a może owoce?&nbsp; Zdrowe, domowe kanapki i smakowite owoce na lunch to duet idealny, który zawsze może towarzyszyć Twojemu dziecku w szkole czy na wyciecze. Wystarczy mały, ale wbrew pozorom bardzo pojemny lunchbox z nadrukiem jednorożca. Pomieści on wszystkie jedzenie, które chcesz dać swojemu dziecku. Pudełko na kanapki wykonane zostało z tworzywa sztucznego bezpiecznego dla użytkowników. Ma prosty kształt o zaokrąglonych rogach i charakterystyczne zapięcie. Z takim pudełkiem lunch zawsze będzie bezpieczny, zdrowy i różnorodny. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Basic Bella</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,6 cm<br class="def">\ndługość - 16,8 cm<br class="def">\nszerokość - 12,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lunchbox-z-nadrukiem-12-2x16-8x6-6-cm-Koziol-BASIC-BELLA-bialy-KZ-3149525-p4309\',', '\'33\',', '\'26.83\',', '\'26.83\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki na lunch\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lunchbox-z-nadrukiem-12-2x16-8x6-6-cm-Koziol-BASIC-BELLA-bialy-KZ-3149525_[10782]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lunchbox-z-nadrukiem-12-2x16-8x6-6-cm-Koziol-BASIC-BELLA-bialy-KZ-3149525_[10783]_1200.jpg"}\''),
