	(345, '\'Lunchbox z separatorem 16,6x23,2x6,2 cm Koziol PASCAL L biały KZ-3152525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3152525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Co dziś zjesz na lunch? Domowe kanapki, tosty a może owoce? Chcesz wszystko, ale nie masz miejsca w torbie aby wsiąść więcej niż jeden pojemnik? Marka Koziol znalazła swoje rozwiązanie takich sytuacji &ndash; Lunchbox z wyjmowanym separatorem. Zdrowe, domowe kanapki i smakowite owoce na lunch to duet idealny, który zawsze możesz mieć ze sobą niezależnie od sytuacji. Wystarczy małe, ale brew pozorom bardzo pojemny pojemnik Pascal. \n Pomieści on wszystkie jedzenie, które chcesz zabrać ze sobą do szkoły, do pracy czy wycieczkę. Do tego nie musisz się ograniczać, dzięki wyjmowanemu separatorowi zabierzesz na raz różne przekąski, które będą od siebie skutecznie oddzielone. Smaki nie będą się mieszać, a w razie potrzeby gdy chcesz zabrać jedną potrawę w większej ilości wystarczy wyciągnąć część oddzielającą. Aby jeszcze lepiej zabezpieczyć jedzenie, możesz zaopatrzyć się w mniejszą wersję lunchboxa (Pascal S), która idealnie się mieści do pojemnika Pascal L.&nbsp; \n Pudełko na kanapki wykonane zostało z tworzywa sztucznego bezpiecznego dla użytkowników. Ma prosty kształt o zaokrąglonych rogach i charakterystycznym zapięciu. \n Z takim pudełkiem Twój lunch zawsze będzie bezpieczny, zdrowy i różnorodny. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Pascal</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,2 cm<br class="def">\ndługość - 23,2 cm<br class="def">\nszerokość - 16,6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,