	(352, '\'Maselniczka 12x17,5x5,8 cm Koziol RIO kobaltowa KZ-3619397\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3619397\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Prezentowana tu maselniczka to dowód na to, że proste akcesoria sprawdzają się zawsze. Praktyczna&nbsp; forma maselniczki, pozwoli nie tylko na higieniczne i wygodne przechowywanie masła na kuchennym blacie, szafce, lodówce, ale również na jego wytworne serwowanie bezpośrednio na uroczysty stół. Zaokrąglona na bokach podstawa ułatwia przenoszenie i użytkowanie. Transparentna pokrywka pozwala na sprawdzenie zawartości bez konieczności jej podnoszenia. \nProdukt dostępny w wielu wariantach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Rio</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5,8 cm<br class="def">\ndługość - 17,5 cm<br class="def">\nszerokość - 12 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Maselniczka-12x17-5x5-8-cm-Koziol-RIO-kobaltowa-KZ-3619397-p4789\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Maselniczki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Maselniczka-12x17-5x5-8-cm-Koziol-RIO-kobaltowa-KZ-3619397_[12257]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Maselniczka-12x17-5x5-8-cm-Koziol-RIO-kobaltowa-KZ-3619397_[12545]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Maselniczka-12-17-5-5-8-cm-Koziol-RIO-kobaltowa-KZ-3619397_[18262]_1200.jpg"}\''),
