	(368, '\'Misa do sałaty z łyżkami 3,5L Koziol SHADOW zielona z białymi łyżkami KZ-3869380\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3869380\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp;Misa ze sztućcami z kolekcji Shadow niemieckiej marki Koziol. Ułatwi nam serwowanie sałatek oraz pozwoli wygodnie nakładać odpowiednie porcje dania. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Shadow</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 13 cm<br class="def">\ndługość - 34 cm<br class="def">\nszerokość - 31 cm<br class="def">\npojemność - 3,5L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony, biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Misa-do-salaty-z-lyzkami-3-5L-Koziol-SHADOW-zielona-z-bialymi-lyzkami-KZ-3869380-p4791\',', '\'152\',', '\'123.58\',', '\'123.58\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Misy do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Misa-do-salaty-z-lyzkami-3-5L-Koziol-SHADOW-zielona-z-bialymi-lyzkami-KZ-3869380_[12260]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Misa-do-salaty-z-lyzkami-3-5L-Koziol-SHADOW-zielona-z-bialymi-lyzkami-KZ-3869380_[13013]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Misa-do-salaty-z-lyzkami-3-5L-Koziol-SHADOW-zielona-z-bialymi-lyzkami-KZ-3869380_[13014]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Misa-do-salaty-z-lyzkami-3-5L-Koziol-SHADOW-zielona-z-bialymi-lyzkami-KZ-3869380_[13015]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Misa-do-salaty-z-lyzkami-3-5L-Koziol-SHADOW-zielona-z-bialymi-lyzkami-KZ-3869380_[13016]_1200.jpg"}\''),
	(369, '\'Misa sałatkowa 29 cm Forme Casa biała FC-08602411\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-08602411\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Przedstawiona tu misa sałatkowa jest wykonana z tworzywa sztucznego, dlatego jest lekka, poręczna i odporna na zarysowania. Można ją również używać do przygotowywania różnego rodzaju mas, ciast czy marynowania mięs. Naczynie to dzięki swojemu niekonwencjonalnemu kształtowi stanie się elementem centralnym stołu służąc do serwowania sałatek, sałat, owoców, warzyw czy chipsów. Średnica misy to 29 cm. \n Marka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 14 cm<br class="def">\nśrednica - 29 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Misa-salatkowa-29-cm-Forme-Casa-biala-FC-08602411-p4096\',', '\'34\',', '\'27.64\',', '\'27.64\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Miski kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Misa-salatkowa-29-cm-Forme-Casa-biala-FC-08602411_[9954]_1200.jpg"}\''),
