	(375, '\'Misa sałatkowa 34 cm Forme Casa biała FC-08603111\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-08603111\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Przedstawiona tu misa sałatkowa jest wykonana z tworzywa sztucznego, dlatego jest lekka, poręczna i odporna na zarysowania. Można ją również używać do przygotowywania różnego rodzaju mas, ciast czy marynowania mięs. Naczynie to dzięki swojemu niekonwencjonalnemu kształtowi stanie się elementem centralnym stołu służąc do serwowania sałatek, sałat, owoców, warzyw czy chipsów. Średnica misy to 34 cm. \nMarka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 16 cm<br class="def">\nśrednica - 34 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Misa-salatkowa-34-cm-Forme-Casa-biala-FC-08603111-p4097\',', '\'45\',', '\'36.59\',', '\'36.59\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Miski kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Misa-salatkowa-34-cm-Forme-Casa-biala-FC-08603111_[9955]_1200.jpg"}\''),
