	(381, '\'Miseczka porcelanowa 14 cm Aida Denmark Poul Pava Original Icons 2 szt. A20405\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'A20405\',', 0, '\'Aida Denmark\',', NULL, 0, NULL, NULL, '\'.\',', '\'Miseczki porcelanowe duńskiej marki Aida z kolekcji Poul Pava Original Icons. Przeznaczone do serwowania przekąsek, śniadań czy deserów. \nUnikalna kolekcja marki Aida stworzona we współpracy z duńskim artystą. Poul Pava specjalizuje się w rysunkach malowanych jakby kredką przez dziecko. Wyjątkowa ekspresja, odważne kolory, niespotykane postacie - przenoszą w beztroski świat wyobraźni i swobody. Owoce współpracy Aida z Poul Pava zyskały swoich wielbicieli dzięki połączeniu odważnych projektów z doskonałą jakością duńskiej marki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Poul Pava Original Icons</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6 cm<br class="def">\nśrednica - 14 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">Porcelana</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Możliwość mycia w zmywarce: tak\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Miseczka-porcelanowa-14-cm-Aida-Denmark-Poul-Pava-Original-Icons-2-szt-A20405-p2035\',', '\'135\',', '\'109.76\',', '\'109.76\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Miseczki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Miseczka-porcelanowa-14-cm-Poul-Pava-Original-Icons-2-szt-A20405_[4106]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Miseczka-porcelanowa-14-cm-Poul-Pava-Original-Icons-2-szt-A20405_[4107]_1200.jpg"}\''),
	(382, '\'Miska 2,7L Koziol LEAF M biała KZ-3653525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3653525\',', 0, '\'Koziol\',', NULL, NULL, NULL, NULL, NULL, '\'Duża misa na sałatki o delikatnej formie w kształcie liścia to dobry początek i powód do zmiany stylu żywienia. Dekoracyjna misa bardzo zachęca do czestego użytkowania i jedzenia zdrowych, pysznych, domowych sałatek. \nTaka wspaniała misa na każdym stole zajmie główne miejsce wspaniale prezentując serwowane potrawy. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Leaf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 13,1 cm<br class="def">\ndługość - 40,4 cm<br class="def">\nszerokość - 29,6 cm<br class="def">\npojemność - 2,7L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Miska-2-7L-Koziol-LEAF-M-biala-KZ-3653525-p4739\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Misy do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Miska-2-7L-Koziol-LEAF-M-biala-KZ-3653525_[12194]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Miska-2-7L-Koziol-LEAF-M-biala-KZ-3653525_[12195]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-2-7L-Koziol-LEAF-M-biala-KZ-3653525_[13019]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-2-7L-Koziol-LEAF-M-biala-KZ-3653525_[13020]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-2-7L-Koziol-LEAF-M-biala-KZ-3653525_[13021]_1200.jpg"}\''),
