	(387, '\'Miska dla kota Koziol MIAOU biała KZ-2920525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2920525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Miseczka dla kotka o prostej formie z zaokrąglonymi brzegami. Bez żadnych kantów i ostrych powierzchni, aby przypadkiem pupil się nie zranił. Specjalnie została zaprojektowana nie zbyt wysoka dla wygodniejszego użytkownia. W centralnej części umieszczono wizerunek małego kotka, aby nie było wątpliwości do kogo należy miseczka oraz jej zawartość. \nProdukt idealnie dopasowany do potrzeb naszych czworonożnych przyjaciół \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 11,3 cm<br class="def">\ndługość - 15,7 cm<br class="def">\nszerokość - 15,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Miska-dla-kota-Koziol-MIAOU-biala-KZ-2920525-p4352\',', '\'55\',', '\'44.72\',', '\'44.72\',', NULL, '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Miska-dla-kota-Koziol-MIAOU-biala-KZ-2920525_[10940]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Miska-dla-kota-Koziol-MIAOU-biala-KZ-2920525_[10941]_1200.jpg"}\''),
