	(393, '\'Miska sałatkowa Guzzini Venice transparentna GU-11060000\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'GU-11060000\',', 0, '\'Guzzini\',', NULL, 0, NULL, NULL, NULL, '\'Miska sałatkowa&nbsp;marki Guzzini z kolekcji Venice.&nbsp; \n Misa sałatkowa z kolekcji&nbsp;Venice charakteryzuje się ciekawą budową i kolorystyką. Wewnątrz misa jest gładka, a z zewnątrz powierzchnia jest pokryta okrągłymi wypustkami. Misę można stosować do przechowywania owoców, sałaty lub podawania sałatek, mizerii i innych produktów przetworzonych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Venice</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5 cm<br class="def">\nszerokość - 11,9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Miska-salatkowa-Guzzini-Venice-transparentna-GU-11060000-p4119\',', '\'43\',', '\'34.96\',', '\'34.96\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Misy do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Miska-salatkowa-Guzzini-Venice-transparentna-GU-11060000_[9991]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Miska-salatkowa-Guzzini-Venice-transparentna-GU-11060000_[9992]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Miska-salatkowa-Guzzini-Venice-transparentna-GU-11060000_[9993]_1200.jpg"}\''),
	(394, '\'Miska z nadrukiem Tapas Ladelle niebieska LD-61320-1\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-61320-1\',', 0, '\'Ladelle\',', NULL, NULL, NULL, NULL, '\'.\',', '\'Miski z nadrukiem z kolekcji Tapas zostały zaprojektowane tak, aby pomagać łączyć ludzi z kulturą. Morskie printy wprowadzają nas w błogi klimat śródziemnomorski. Cała kolekcja została stworzona w 100% z naturalnej terakoty. Jest to produkt handmade więc każdy model jest jedyny w swoim rodzaju. Biała glazura kontrastuje z surową terakotą aby podkreślić naturalność materiałów. Poza sferą wizualną miseczki są niezwykle praktyczne, ponieważ nadają się zarówno do mikrofalówki jak i piekarnika czy zmywarki! \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tapas</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,5 cm<br class="def">\ndługość - 13 cm<br class="def">\nszerokość - 13 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">niebieski, biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">terakota</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Miska-z-nadrukiem-Tapas-Ladelle-niebieska-LD-61320-1-p3981\',', '\'44\',', '\'35.77\',', '\'35.77\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Miseczki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Miska-z-nadrukiem-Tapas-Ladelle-niebieska-LD-61320-1_[8366]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Miska-z-nadrukiem-Tapas-Ladelle-niebieska-LD-61320-1_[9041]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Miska-z-nadrukiem-Tapas-Ladelle-niebieska-LD-61320-1_[9042]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Miska-z-nadrukiem-Tapas-Ladelle-niebieska-LD-61320-1_[9043]_1200.jpg","4":"htt