i</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 23,5 cm<br class="def">\ndługość - 41 cm<br class="def">\nszerokość - 48,5 cm<br class="def">\npojemność - 15L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649-p4923\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Miski łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13311]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13312]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13313]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13314]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13315]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13316]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13317]_1200.jpg","7":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Miska-lazienkowa-Koziol-BOTTICHELLI-L-szmaragdowa-zielen-KZ-5730649_[13318]_1200.jpg"}\''),
