	(420, '\'Nawilżacz powietrza Koziol ELLI biały KZ-5065525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5065525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Nawilżacz powietrza ELLI to niezwykle wyróżniający się produkt z oferty niemieckiej marki Koziol. Jest bardzo prosty w obsłudze i zarazem posiada lekko zabawny, kształt sowy, co w połączeniu z pastelowymi kolorami daje przyjemny efekt wizualny. Nawilżacz to produkt, który ma pomóc w utrzymaniu optymalnej wilgotności w pomieszczeniach zapewniając tym samym łatwiejsze oddychanie i utrudnienie gromadzenia drobnoustrojów. Wystarczy napełnić go wodą i zawiesić w dowolnym miejscu na grzejniku, aby móc cieszyć się z korzyści jakie zapewnia. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Elli</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 18,5 cm<br class="def">\ndługość - 14,2 cm<br class="def">\nszerokość - 8,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Nawilzacz-powietrza-Koziol-ELLI-bialy-KZ-5065525-p4365\',', '\'76\',', '\'61.79\',', '\'61.79\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Nawilżacze powietrza\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Nawilzacz-powietrza-Koziol-ELLI-bialy-KZ-5065525_[10968]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Nawilzacz-powietrza-Koziol-ELLI-bialy-KZ-5065525_[10969]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Nawilzacz-powietrza-Koziol-ELLI-bialy-KZ-5065525_[10970]_1200.jpg"}\''),
