="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 10,8 cm<br class="def">\ndługość - 18,7 cm<br class="def">\nszerokość - 12,8 cm<br class="def">\npojemność - 1 L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638-p4380\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11048]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11049]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11050]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11051]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11052]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11053]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-1L-Koziol-BOXXX-S-pastelowy-roz-KZ-5745638_[11054]_1200.jpg"}\''),
