br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 15 cm<br class="def">\ndługość - 29,7 cm<br class="def">\nszerokość - 20,3 cm<br class="def">\npojemność - 3,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632-p4045\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9772]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9773]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9774]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9775]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9776]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9777]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9778]_1200.jpg","7":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9779]_1200.jpg","8":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9780]_1200.jpg","9":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Organizer-3-5L-Koziol-BOXXX-M-szary-KZ-5744632_[9781]_1200.jpg"}\''),
