ng>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 13 cm<br class="def">\ndługość - 18,8 cm<br class="def">\nszerokość - 23 cm<br class="def">\npojemność - 1,5L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649-p4928\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Miski łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13353]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13354]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13355]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13356]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13357]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13358]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-Koziol-BOTTICHELLI-S-szmaragdowa-zielen-KZ-5731649_[13359]_1200.jpg"}\''),
