\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 8 cm<br class="def">\ndługość - 12 cm<br class="def">\nszerokość - 9,5 cm<br class="def">\npojemność - 270 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-Koziol-BOTTICHELLI-XXS-pastelowy-roz-KZ-5734638-p4808\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Miski łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-Koziol-BOTTICHELLI-XXS-pastelowy-roz-KZ-5734638_[12277]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-Koziol-BOTTICHELLI-XXS-pastelowy-roz-KZ-5734638_[12681]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-Koziol-BOTTICHELLI-XXS-pastelowy-roz-KZ-5734638_[12682]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-Koziol-BOTTICHELLI-XXS-pastelowy-roz-KZ-5734638_[12683]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-Koziol-BOTTICHELLI-XXS-pastelowy-roz-KZ-5734638_[12684]_1200.jpg"}\''),
