	(481, '\'Organizer Koziol POTTICHELLI L kobaltowy KZ-2836585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2836585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Organizery Pottichelli marki Koziol to bardzo praktyczne i wielofunkcyjne pojemniki dostępne w trzech różnych rozmiarach: \n - XS pojemność 0,3L \n - M pojemność 1,2L \n - L pojemność 3L \n Organizery Pottichelli z pewnością zaskoczą Cię swoimi wszechstronnymi możliwościami. Sprawdzą się idealnie w biurze, łazience, ogrodzie, warsztacie jako pojemniki na drobne przedmioty takie jak akcesoria biurowe, długopisy, karteczki, kosmetyki,akcesoria do szycia, śrubki, narzędzia. Może również służyć jako nieprzeciętna doniczka na żywe kwiaty lub mały biurkowy kosz. \n Prosty, okrągły kształt z lekko wydłużoną częścią z otworem to jest znak rozpoznawczy produktów z tej kolekcji. Umieszczony otwór pozwala na zaczepienie organizera na haczyku, tworząc w ten sposób sprytny, wiszący pojemnik. Dostępność kolorów jest naprawdę duża, dzięki czemu każdy znajdzie dla siebie pojemnik w odpowiednim kolorze. \n Polecamy także organizery owalne - Bottichelli oraz prostokątne &ndash; BOXXX. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Pottichelli</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 23 cm<br class="def">\ndługość - 21 cm<br class="def">\nszerokość - 19.5 cm<br class="def">\npojemność - 3L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-Koziol-POTTICHELLI-L-kobaltowy-KZ-2836585-p4740\',', '\'50\',', '\'40.65\',', '\'40.65\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{