	(495, '\'Organizer z przykrywką Koziol PRIVATE BOX antracytowy KZ-5801540\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5801540\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Małe poręczne pudełeczko o nazwie Private Box to kolejna propozycja od marki Koziol mająca na celu dobre zabezpieczenie rzeczy cennych i ważnych dla nas. Pudełeczko jest małe, ale pojemne, w kształcie kwadratu o zaokrąglonych rogach. Na środku umieszczono zapięcie, które skutecznie je zamyka. Można go użytkować zarówno w domu jak i w podróży jako schowek na karty, bilety, pieniądze. \nDostępny w kilku wariantach kolorystycznych.&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Private Box</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 2,3 cm<br class="def">\ndługość - 6,5 cm<br class="def">\nszerokość - 6,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-z-przykrywka-Koziol-PRIVATE-BOX-antracytowy-KZ-5801540-p4408\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-z-przykrywka-Koziol-PRIVATE-BOX-antracytowy-KZ-5801540_[11194]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-z-przykrywka-Koziol-PRIVATE-BOX-antracytowy-KZ-5801540_[11195]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-z-przykrywka-Koziol-PRIVATE-BOX-antracytowy-KZ-5801540_[11196]_1200.jpg"}\''),
