	(506, '\'Organizer łazienkowy 9,5x27,5x13 cm Koziol SPLASH biały KZ-5240525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5240525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Praktyczna, nowoczesna półka prysznicowa wykonana z wysokiej jakości tworzywa sztucznego. Dzięki specjalnym przyssawkom jest bardzo łatwa w montażu i nie wymaga wiercenia dziur w ścianach. W dowolnym momencie można zmienić miejsce jej mocowania. Pojemnik doskonale nadaje się do przechowywania szamponów, żeli pod prysznic, gąbek oraz innych akcesoriów potrzebnych pod ręką. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Splash</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 13 cm<br class="def">\ndługość - 27,5 cm<br class="def">\nszerokość - 9,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-lazienkowy-9-5x27-5x13-cm-Koziol-SPLASH-bialy-KZ-5240525-p4400\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Organizery i półki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-9-5x27-5x13-cm-Koziol-SPLASH-bialy-KZ-5240525_[11152]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-9-5x27-5x13-cm-Koziol-SPLASH-bialy-KZ-5240525_[11153]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-9-5x27-5x13-cm-Koziol-SPLASH-bialy-KZ-5240525_[11154]_1200.jpg"}\''),
