638_[12751]_1200.jpg"}\''),
	(510, '\'Organizer łazienkowy Koziol SURF kobaltowy KZ-2845585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2845585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Organizer Surf marki Koziol to bardzo praktyczna i wielofunkcyjna półeczka łazienkowa dostępna w trzech różnych rozmiarach: małym XS, średnim M, dużym XL&nbsp; Surf pomoże w utrzymaniu porządku w łazience oraz w kuchni. W łazience nada się do przechowywania kosmetyków (szamponów,&nbsp; żeli pod prysznic, płynów do kąpieli, odżywek, mydła) oraz akcesoriów łazienkowych (gąbka, szczoteczka, maszynka do golenia, pumeks, czepek kąpielowy). W kuchni posłuży do przechowywania myjek, szczotek do naczyń, ściereczek kuchennych. Organizer Surf wyróżnia się charakterystycznym, bardzo nietypowym kształtem, wykończonym uchwytem przypominającym wzbierająca falę morską. Za pomocą tego uchwytu można zawiesić organizer wygodnie przy baterii, na relingu lub na wieszaczku bez kłopotliwego montażu i wiercenia ściany. Od spodu Surf ma dwa otwory&nbsp; mające dwojakie zastosowanie umożliwiające odprowadzenie nadmiaru wody oraz łatwe przyłączanie kolejnego organizera. \n Produkt dostępny w wielu wariantach kolorystycznych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Surf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 25,3 cm <br class="def">\ndługość - 21,6 cm<br class="def">\ngłębokość - 6,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585-p4816\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Organizery i półki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12285]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12752]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12753]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12754]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12755]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12756]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Organizer-lazienkowy-Koziol-SURF-kobaltowy-KZ-2845585_[12757]_1200.jpg"}\''),
	(511, '\'Organizer łazienkowy Koziol SURF miętowy KZ-2845634\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2845634\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Organizer Surf marki Koziol to bardzo praktyczna i wielofunkcyjna półeczka łazienkowa dostępna w trzech różnych rozmiarach: małym XS, średnim M, dużym XL&nbsp; Surf pomoże w utrzymaniu porządku w łazience oraz w kuchni. W łazience nada się do przechowywania kosmetyków (szamponów,&nbsp; żeli pod prysznic, płynów do kąpieli, odżywek, mydła) oraz akcesoriów łazienkowych (gąbka, szczoteczka, maszynka do golenia, pumeks, czepek kąpielowy). W kuchni posłuży do przechowywania myjek, szczotek do naczyń, ściereczek kuchennych. Organizer Surf wyróżnia się charakterystycznym, bardzo nietypowym kształtem, wykończonym uchwytem przypominającym wzbierająca falę morską. Za pomocą tego uchwytu można zawiesić organizer wygodnie przy baterii, na relingu lub na wieszaczku bez kłopotliwego montażu i wiercenia ściany. Od spodu Surf ma dwa otwory&nbsp; mające dwojakie zastosowanie umożliwiające odprowadzenie nadmiaru wody oraz łatwe przyłączanie kolejnego organizera. \n Produkt dostępny w wielu wariantach kolorystycznych. \n Poglądy marki Koziol najlepiej oddaje slogan Art At Work. Wszystkie produkty tej marki to małe dzieła sztuki projektowane tak aby spełniały swoją funkcję użytkową, a zarazem wprowadzały odrobinę humoru i ciekawego designu do wnętrza. Dzięki marce Koziol zwykłe przedmioty kuchenne i łazienkowe codziennego użytku stają się niezwykłe. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">SURF</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 25,3 cm<br class="def">\ndługość - 21,6 cm<br class="def">\nszerokość - 6,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634-p4403\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Organizery i półki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[13206]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11160]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11161]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11162]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11163]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11164]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11165]_1200.jpg","7":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11166]_1200.jpg","8":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11167]_1200.jpg","9":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-mietowy-KZ-2845634_[11168]_1200.jpg"}\''),
