span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634-p4405\',', '\'26\',', '\'21.14\',', '\'21.14\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Organizery i półki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[13205]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11177]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11178]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11179]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11180]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11181]_1200.jpg","6":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11182]_1200.jpg","7":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11183]_1200.jpg","8":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11184]_1200.jpg","9":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Organizer-lazienkowy-Koziol-SURF-XS-mietowy-KZ-2844634_[11185]_1200.jpg"}\''),
