	(529, '\'Otwieracz do słoików Koziol TOM antracytowy KZ-3712540\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3712540\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Przed sympatyczną wydrą z dużymi ząbkami o nazwie Tom wszystkie słoiki (nawet te najbardziej oporne) stoją otworem. Wystarczy, że delikatnie podważysz wieczko przy pomocy ząbków Toma, a powietrze z zewnątrz dostanie się do środka wyrównując ciśnienie i powodując łatwe otwarcie słoika. Dzięki takiemu gadżetowi otwieranie słoików nie będzie już nigdy więcej stanowić wyzwania. \n Produkt dostępny w kilku wersjach kolorystycznych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tom</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 3,1 cm<br class="def">\ndługość - 12,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Otwieracz-do-sloikow-Koziol-TOM-antracytowy-KZ-3712540-p4418\',', '\'29\',', '\'23.58\',', '\'23.58\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Inne akcesoria kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Otwieracz-do-sloikow-Koziol-TOM-antracytowy-KZ-3712540_[11218]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Otwieracz-do-sloikow-Koziol-TOM-antracytowy-KZ-3712540_[11219]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Otwieracz-do-sloikow-Koziol-TOM-antracytowy-KZ-3712540_[11220]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Otwieracz-do-sloikow-Koziol-TOM-antracytowy-KZ-3712540_[11221]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Otwieracz-do-sloi