	(571, '\'Parowar 1800W Tefal Vitacuisine Compact VS400333\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'VS400333\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Parowar-1800W-Tefal-Vitacuisine-Compact-VS400333-p5681\',', '\'0\',', '\'0\',', '\'0\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Parowar-1800W-Tefal-Vitacuisine-Compact-VS400333_[18842]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Parowar-1800W-Tefal-Vitacuisine-Compact-VS400333_[18843]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Parowar-1800W-Tefal-Vitacuisine-Compact-VS400333_[18844]_1200.jpg"}\''),
	(572, '\'Patelnia 24 cm Tefal Extra czarna B3010472\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'B3010472\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Patelnia 24 cm znanej marki TEFAL z serii Extra. Patelnie to praktyczne akcesoria kuchenne, które są niezbędne w każdym domu. \nPatelnia Extra doskonale nadaje się do smażenia, duszenia, gotowania na wodzie. Wyróżnia ją nieprzywierającą powłoką zewnętrzną i wewnętrzną co jest jej ogromną zaletą. Posiadają wskaźnik nagrzania patelni Termo-Spot, który zmienia kolor na intensywnie czerwony kiedy patelnia jest już nagrzana do odpowiedniej temperatury. Produkt jest wyposażony w ergonomiczny uchwyt z miejscem na kciuk. Posiada specjalnie wyprofilowany wysoki, brzeg, który zaprojektowany został tak, aby ułatwić serwowanie produktów bezpośrednio z patelni. Cechują się lekką konstrukcją zapewniającą łatwiejsze i wygodniejsze użytkowanie.&nbsp; Produkt można myć w zmywarce. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Extra</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 24 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patelnia-24-cm-Tefal-Extra-czarna-B3010472-p5659\',', '\'49\',', '\'39.84\',', '\'39.84\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-24-cm-Tefal-Extra-czarna-B3010472_[18122]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-24-cm-Tefal-Extra-czarna-B3010472_[18203]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-24-cm-Tefal-Extra-czarna-B3010472_[18204]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-24-cm-Tefal-Extra-czarna-B3010472_[18205]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-24-cm-Tefal-Extra-czarna-B3010472_[18206]_1200.jpg"}\''),
	(573, '\'Patelnia 24 cm Tefal Intuition A7030415\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'A7030415\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Patelnia o średnicy 28cm marki Tefal z serii Intuition to praktyczne naczynie. Patelnia jest niezbędnikiem każdego domu dlatego czemu nie zainwestować w produkt, który jest przystępnej cenie i do tego posiada same zalety.&nbsp; Patelnie z serii Institution cechują się: \n &nbsp;niezwykłe trwała jakością wykonania, dlatego posłuży przez długie długie lata \n powłoką Power Resist &ndash; w pełni zapobiegającą zarysowaniem powierzchni patelni \n ergonomiczną rączką, stabilna i wyprofilowana rączka pozwala na wygodne przenoszenie patelni z miejsca na miejsce. Dodatkowo umieszczony w rączce otwór pozwala na łatwiejsze przechowywanie patelni poprzez zawieszenie na haczyku \n wskaźnikiem Termo-Spot informującym o odpowiedniej temperaturze naczynia do rozpoczęcia użytkowania \n zaokrąglonym brzegiem pozwalającym na serwowanie gorących dań prosto na talerz \n zewnętrzna powłoką ze stali nierdzewnej \n \nPatelnie z serii Intuition są przystosowane do użytkowania na każdej kuchence, dzięki grubemu kapsułowemu dnu z stali ferrytycznej i aluminium. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Intuition</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 24 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">teflon</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patelnia-24-cm-Tefal-Intuition-A7030415-p5664\',', '\'85.9\',', '\'69.84\',', '\'69.84\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-24-cm-Tefal-Intuition-A7030415_[18165]_1200.jpg"}\''),
	(574, '\'Patelnia 28 cm Tefal Duetto A7040684\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'A7040684\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Tefal Duetto to patelnia ze stali nierdzewnej wyposażona w wielowarstwowe dno indykcyjne. Duża, pojemna - średnica 28 cm. Idealna pod każdym względem do codziennego użytkowania. Niezastąpiona w profesjonalnej kuchni, restauracji. Pokryta powłoką Power Resist pozwalająca na smażenie (bez przypalania) bez tłuszczu. Tak jak inne patelnie Tefal tai i w tej serii został zastosowany wskaźnik Thermo-spot informujący o gotowości patelni do użytkowania. Jeżeli patelnia jest nagrzana do odpowiedniej temperatury to umieszczony na środki znak T zmienia kolor na intensywny czerwony. Grube dno indukcyjne jest odporne na odkształcenia. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Duetto</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 28 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">stal nierdzewna</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patelnia-28-cm-Tefal-Duetto-A7040684-p5670\',', '\'99\',', '\'80.49\',', '\'80.49\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-28-cm-Tefal-Duetto-A7040684_[18185]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-28-cm-Tefal-Duetto-A7040684_[18186]_1200.jpg"}\''),
