	(577, '\'Patelnia 30 cm Tefal Extra czarna B3010772\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'B3010772\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Patelnia 30 cm znanej marki TEFAL z serii Extra. Patelnie to praktyczne akcesoria kuchenne, które są niezbędne w każdym domu. \nPatelnia Extra doskonale nadaje się do smażenia, duszenia, gotowania na wodzie. Wyróżnia ją nieprzywierającą powłoką zewnętrzną i wewnętrzną co jest jej ogromną zaletą. Posiadają wskaźnik nagrzania patelni Termo-Spot, który zmienia kolor na intensywnie czerwony kiedy patelnia jest już nagrzana do odpowiedniej temperatury. Produkt jest wyposażony w ergonomiczny uchwyt z miejscem na kciuk. Posiada specjalnie wyprofilowany wysoki, brzeg, który zaprojektowany został tak, aby ułatwić serwowanie produktów bezpośrednio z patelni. Cechują się lekką konstrukcją zapewniającą łatwiejsze i wygodniejsze użytkowanie.&nbsp; Produkt można myć w zmywarce. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Extra</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 30 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patelnia-30-cm-Tefal-Extra-czarna-B3010772-p5660\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-30-cm-Tefal-Extra-czarna-B3010772_[18123]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-30-cm-Tefal-Extra-czarna-B3010772_[18141]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-30-cm-Tefal-Extra-czarna-B3010772_[18142]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images