	(578, '\'Patelnia do naleśników 25 cm Tefal Extra czarna B3011072\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'B3011072\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Patelnia do naleśników uznanej marki TEFAL to prawdziwa gratka dla fanów dobry naleśników oraz prawdziwych pancakeów.&nbsp; Patelnia jest duża o średnicy 25 cm z niskimi i rozwartymi ściankami, dzięki którym przewracanie i zdejmowanie naleśników jest łatwiejsze. \nPatelnie z serii Extra to jedyne na świecie produkty wyposażone we wskaźnik nagrzania Termo-Spot. Zanikający wzór wskaźnika oznacza, że patelnia jest odpowiednio nagrzana i można rozpocząć użytkowanie. Patelnia posiada cienkie dno, pokryte powłoką teflonowa zapobiegającą przypalaniu się i zarysowaniu. Komfortowe smażenie zapewnia wyprofilowana, stabilna rączka, która pozwoli bez żadnych obaw, niczym prawdziwy Szef kuchni na przekręcanie naleśników w powietrzu. Ponadto rączka posiada uchwyt umożliwiający zawieszenie patelni na haczyku, co pozwoli zaoszczędzić miejsce w kuchni. \nJeżeli lubisz pyszne naleśniki lub często przygotowujesz je dla swoich dzieciaków to produkt marki Tefal jest idealny dla Ciebie! \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Extra</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 25 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patelnia-do-nalesnikow-25-cm-Tefal-Extra-czarna-B3011072-p5652\',', '\'48\',', '\'39.02\',', '\'39.02\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-do-nalesnikow-25-cm-Tefal-czarna-B3011072_[18072]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-do-nalesnikow-25-cm-Tefal-Extra-czarna-B3011072_[18145]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-do-nalesnikow-25-cm-Tefal-Extra-czarna-B3011072_[18146]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-do-nalesnikow-25-cm-Tefal-Extra-czarna-B3011072_[18147]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-do-nalesnikow-25-cm-Tefal-Extra-czarna-B3011072_[18148]_1200.jpg"}\''),
	(579, '\'Patelnia grillowa 26x26 cm Tefal Extra B3014072\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'B3014072\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Patelnia grillowa uznanej marki TEFAL to prawdziwa gratka dla fanów dobrych steków oraz kiełbasek&nbsp; Patelnia jest duża o 26x26 cm z niskimi i rozwartymi ściankami, dzięki którym przewracanie i zdejmowanie produktów jest łatwiejsze. \nPatelnie z serii Extra to jedyne na świecie produkty wyposażone we wskaźnik nagrzania Termo-Spot. Zanikający wzór wskaźnika oznacza, że patelnia jest odpowiednio nagrzana i można rozpocząć użytkowanie. Komfortowe smażenie zapewnia wyprofilowana, stabilna rączka. Ponadto rączka posiada uchwyt umożliwiający zawieszenie patelni na haczyku, co pozwoli zaoszczędzić miejsce w kuchni. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Extra</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 26 cm<br class="def">\nszerokość - 26 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patelnia-grillowa-26x26-cm-Tefal-Extra-B3014072-p5665\',', '\'94\',', '\'76.42\',', '\'76.42\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-grillowa-26x26-cm-Tefal-Extra-B3014072_[18166]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Patelnia-grillowa-26x26-cm-Tefal-Extra-B3014072_[18207]_1200.jpg"}\''),
	(580, '\'Patera 19,8 cm Koziol BABELL XS kobaltowa KZ-3181585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3181585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Patera Babell stworzona jest do stylowego serwowania smakołyków. Dobrze sprawdzi się na czekoladki, owoce, słodycze czy ciasteczka. Urocze, opływowe kształty dodadzą im jeszcze więcej &quot;smaku&quot;. Lekka i praktyczna forma sprawiają, że przy użyciu niewielkiej ilości miejsca na stole, można podać w pięknym stylu wiele różnych przysmaków. Patera składa się z trzech tacek o różnych wielkościach z lekko zaokrąglonymi brzegami, które złożone w całość tworzą prawdziwą i smakowitą wieże słodkości. Dodatkowo, tacki nie są ze sobą trwale połączone, dlatego można również je wykorzystywać jako oddzielne miseczki i rozstawiać w różnych częściach stołu. Złożona etażerka stoi stabilnie na stole, jednak nie należy przenosić jej wyłącznie za jeden górny element tylko chwytając od samego spodu. \n Produkt dostępny w kilku wariantach kolorystycznych. \n Dostępne rozmiary: \n - Babell XS (3 poziomy) \n - Babell L (3 poziomy) \n - Babell BIG (5 poziomów) \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Babell</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 22 cm<br class="def">\nśrednica - 19,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patera-19-8-cm-Koziol-BABELL-XS-kobaltowa-KZ-3181585-p4420\',', '\'59\',', '\'47.97\',', '\'47.97\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Patery i etażerki na ciasto\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Patera-19-8-cm-Koziol-BABELL-XS-kobaltowa-KZ-3