	(606, '\'Patera Koziol BABELL L miętowa KZ-3180634\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3180634\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Patera Babell stworzona jest do stylowego serwowania smakołyków. Dobrze sprawdzi się na czekoladki, owoce, słodycze czy ciasteczka. Urocze, opływowe kształty dodadzą im jeszcze więcej &quot;smaku&quot;. Lekka i praktyczna forma sprawiają, że przy użyciu niewielkiej ilości miejsca na stole, można podać w pięknym stylu wiele różnych przysmaków. Patera składa się z trzech tacek o różnych wielkościach z lekko zaokrąglonymi brzegami, które złożone w całość tworzą prawdziwą i smakowitą wieże słodkości. Dodatkowo, tacki nie są ze sobą trwale połączone, dlatego można również je wykorzystywać jako oddzielne miseczki i rozstawiać w różnych częściach stołu. Złożona etażerka stoi stabilnie na stole, jednak nie należy przenosić jej wyłącznie za jeden górny element tylko chwytając od samego spodu. \n Produkt dostępny w kilku wariantach kolorystycznych. \n Dostępne rozmiary: \n - Babell XS (3 poziomy) \n - Babell L (3 poziomy) \n - Babell BIG (5 poziomów) \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Babell</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 34 cm<br class="def">\ndługość - 31,4 cm<br class="def">\nszerokość - 31,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Patera-Koziol-BABELL-L-mietowa-KZ-3180634-p4898\',', '\'110\',', '\'89.43\',', '\'89.43\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Patery i etażerki na ciasto\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Patera-Koziol-BABELL-L-