	(612, '\'Podstawka do jajka serduszko Koziol SUSI malinowa KZ-3035583\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3035583\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kieliszek na jajko z kolekcji Susi, niemieckiej marki Koziol spodoba się wszystkim tym, którzy wkładają serce w przygotowanie zdrowego, pożywnego śniadania. Specjalnie przygotowane zagłębienie kieliszka stabilnie przytrzyma jajo, a pojemne boki pojemniczka pomieszczą skorupki, sól i łyżeczkę. Optymistyczna kolekcja Susi stawia na miłość, przypominając o niej kształtem produktów.&nbsp; &nbsp; \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Susi</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 1,9 cm<br class="def">\ndługość - 10,8 cm<br class="def">\nszerokość - 9,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czerwony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Podstawka-do-jajka-serduszko-Koziol-SUSI-malinowa-KZ-3035583-p4442\',', '\'8\',', '\'6.5\',', '\'6.5\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Podstawki do jajka\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Podstawka-do-jajka-serduszko-Koziol-SUSI-malinowa-KZ-3035583_[11345]_1200.jpg"}\''),
	(613, '\'Podstawka pod gorące naczynia 25,5 cm Koziol FLAME kobaltowa KZ-3160585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3160585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Podkładka pod naczynia niemieckiej marki Koziol z kolekcji Flame. Odporna na działanie wysokich temperatur aż do 220&deg;C, dzięki czemu uchroni blaty kuchenne przed zniszczeniem. Nowoczesny wzór przypominający połączone liście lub języczki ognia powoduje, że podkładka będzie nie tylko praktycznym akcesorium, ale również ciekawą ozdobą każdej kuchni i jadalni. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Flame</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 25,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Podstawka-pod-gorace-naczynia-25-5-cm-Koziol-FLAME-kobaltowa-KZ-3160585-p4889\',', '\'50\',', '\'40.65\',', '\'40.65\',', '\'KUCHNIA &amp; JADALNIA/Gotowanie i pieczenie/Podstawki pod garnki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Podstawka-pod-gorace-naczynia-25-5-cm-Koziol-FLAME-kobaltowa-KZ-3160585_[12801]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Podstawka-pod-gorace-naczynia-25-5-cm-Koziol-FLAME-kobaltowa-KZ-3160585_[12802]_1200.jpg"}\''),
