	(616, '\'Podstawka pod tablet Koziol DUMBO biała KZ-5933525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5933525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zgrabna, niewielka podstawka pod tablet z kolekcji Dumbo. Wykonana z wysokiej jakości tworzywa sztucznego. Ma kompaktowy rozmiar, który sprawia, że doskonale odnajduje się w każdym pomieszczeniu nawet tym najmniejszym. Stabilna konstrukcja daje radę utrzymać nie tylko tablet, ale również telefon. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Dumbo</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 3,8 cm<br class="def">\ndługość - 12,6 cm<br class="def">\nszerokość - 0,6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Podstawka-pod-tablet-Koziol-DUMBO-biala-KZ-5933525-p4444\',', '\'16\',', '\'13.01\',', '\'13.01\',', NULL, '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Podstawka-pod-tablet-Koziol-DUMBO-biala-KZ-5933525_[11348]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Podstawka-pod-tablet-Koziol-DUMBO-biala-KZ-5933525_[11349]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Podstawka-pod-tablet-Koziol-DUMBO-biala-KZ-5933525_[11350]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Podstawka-pod-tablet-Koziol-DUMBO-biala-KZ-5933525_[11351]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Podstawka-pod-tablet-Koziol-DUMBO-biala-KZ-5933525_[11352]_1200.jpg"}\''),
