	(619, '\'Pojemnik higieniczny Koziol MIGG biały KZ-5657479\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5657479\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Pojemnik higieniczny Migg to zabawny i ciekawy organizer w kształcie oryginalnego ludka z bardzo szerokim uśmiechem.&nbsp; Na pierwszy rzut oka nie widać, że jest to pojemnik, dlatego w sprytny sposób można ukryć w nim cenne rzeczy. Produkt został zaprojektowany do przechowywania aparatu dentystycznego, dlatego fikuśny ludek ma wyjmowane ząbki, ale z powodzeniem można również ukrywać w nim cenne drobiazgi takie jak zegarek, biżuteria. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Migg</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9,2 cm<br class="def">\nśrednica - 8,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-higieniczny-Koziol-MIGG-bialy-KZ-5657479-p4447\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-higieniczny-Koziol-MIGG-bialy-KZ-5657479_[11359]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-higieniczny-Koziol-MIGG-bialy-KZ-5657479_[11360]_1200.jpg"}\''),
	(620, '\'Pojemnik higieniczny Koziol MIGG czarny KZ-5657499\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5657499\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Pojemnik higieniczny Migg to zabawny i ciekawy organizer w kształcie oryginalnego ludka z bardzo szerokim uśmiechem.&nbsp; Na pierwszy rzut oka nie widać, że jest to pojemnik, dlatego w sprytny sposób można ukryć w nim cenne rzeczy. Produkt został zaprojektowany do przechowywania aparatu dentystycznego, dlatego fikuśny ludek ma wyjmowane ząbki, ale z powodzeniem można również ukrywać w nim cenne drobiazgi takie jak zegarek, biżuteria. \nPoglądy marki Koziol najlepiej oddaje slogan Art At Work. Wszystkie produkty tej marki to małe dzieła sztuki projektowane tak aby spełniały swoją funkcję użytkową, a zarazem wprowadzały odrobinę humoru i ciekawego designu do wnętrza. Dzięki marce Koziol zwykłe przedmioty kuchenne i łazienkowe codziennego użytku stają się niezwykłe. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Migg</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9,2 cm<br class="def">\nśrednica - 8,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-higieniczny-Koziol-MIGG-czarny-KZ-5657499-p4448\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-higieniczny-Koziol-MIGG-czarny-KZ-5657499_[11361]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-higieniczny-Koziol-MIGG-czarny-KZ-5657499_[11362]_1200.jpg"}\''),
	(621, '\'Pojemnik higieniczny Koziol MIGG kobaltowy KZ-5657398\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5657398\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Pojemnik higieniczny Migg to zabawny i ciekawy organizer w kształcie oryginalnego ludka z bardzo szerokim uśmiechem.&nbsp; Na pierwszy rzut oka nie widać, że jest to pojemnik, dlatego w sprytny sposób można ukryć w nim cenne rzeczy. Produkt został zaprojektowany do przechowywania aparatu dentystycznego, dlatego fikuśny ludek ma wyjmowane ząbki, ale z powodzeniem można również ukrywać w nim cenne drobiazgi takie jak zegarek, biżuteria. \nBriq to nie tylko taboret, produkt ten sprawdzi się również jako mały stolik, podnóżek, taborecik dla dziecka. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Migg</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9,2 cm<br class="def">\nśrednica - 8,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-higieniczny-Koziol-MIGG-kobaltowy-KZ-5657398-p4829\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-higieniczny-Koziol-MIGG-kobaltowy-KZ-5657398_[12299]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-higieniczny-Koziol-MIGG-kobaltowy-KZ-5657398_[12804]_1200.jpg"}\''),
