	(625, '\'Pojemnik higieniczny Koziol MIGG szary KZ-5657456\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5657456\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Pojemnik higieniczny Migg to zabawny i ciekawy organizer w kształcie oryginalnego ludka z bardzo szerokim uśmiechem.&nbsp; Na pierwszy rzut oka nie widać, że jest to pojemnik, dlatego w sprytny sposób można ukryć w nim cenne rzeczy. Produkt został zaprojektowany do przechowywania aparatu dentystycznego, dlatego fikuśny ludek ma wyjmowane ząbki, ale z powodzeniem można również ukrywać w nim cenne drobiazgi takie jak zegarek, biżuteria. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Migg</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9,2 cm<br class="def">\nśrednica - 8,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-higieniczny-Koziol-MIGG-szary-KZ-5657456-p4451\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-higieniczny-Koziol-MIGG-szary-KZ-5657456_[11367]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-higieniczny-Koziol-MIGG-szary-KZ-5657456_[11368]_1200.jpg"}\''),
	(626, '\'Pojemnik kuchenny 1L Forme Casa biały FC-27405111\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-27405111\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Pojemnik kuchenny o wysokości 14,4 cm marki Forme Casa służy do przechowywania drobnej, suchej żywności takiej jak: ryże, kasze, mąki, ciasteczka, orzechy, cukierki, ziarna, makarony. Dostępny w dwóch różnych pojemnościach 0,5L oraz 1L. Mniejsze pojemniki sprawdzą się również jako gustowna cukierniczka lub pojemnik na sól, miód, dżem. \nNiepospolity i przyciągający oko okrągły kształt oraz stonowana kolorystyka to elementy wyróżniające prezentowany produkt. Pojemnik został wykonany z tworzywa sztucznego do złudzenia przypominającego szkło. Hermetyczne zamknięcie sprawi, że znajdujący się wewnątrz pojemnika produkt zachowa świeżość przez dłuższy czas i ochroni go przed insektami. Pojemnik składa się z przezroczystego &bdquo;słoiczka&rdquo; z kolorową przykrywką. \nMarka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 14,4 cm<br class="def">\nszerokość - 12,2 cm<br class="def">\npojemność - 1L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-kuchenny-1L-Forme-Casa-bialy-FC-27405111-p4103\',', '\'30\',', '\'24.39\',', '\'24.39\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Pojemnik-kuchenny-1L-Forme-Casa-bialy-FC-27405111_[9966]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Pojemnik-kuchenny-1L-Forme-Casa-bialy-FC-27405111_[10001]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Pojemnik-kuchenny-1L-Forme-Casa-bialy-FC-27405111_[10002]_1200.jpg"}\''),
	(627, '\'Pojemnik na chleb 23x37x17 cm Koziol MANNA pastelowy róż KZ-3041638\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3041638\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp; Wolnostojący pojemnik na chleb Manna do nowoczesnych kuchni. Można swobodnie go przenosić, z każdej strony wygląda świetnie. Stawiając go na stole można serwować pieczywo, po czym przykrywając pokrywą odstawić na blat. Dzięki wywietrznikom pieczywo pozostaje świeże na dłużej. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Manna</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 17 cm<br class="def">\ndługość - 37 cm<br class="def">\nszerokość - 23 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-na-chleb-23x37x17-cm-Koziol-MANNA-pastelowy-roz-KZ-3041638-p4452\',', '\'182\',', '\'147.97\',', '\'147.97\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Chlebaki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-na-chleb-23x37x17-cm-Koziol-MANNA-pastelowy-roz-KZ-3041638_[11369]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-na-chleb-23x37x17-cm-Koziol-MANNA-pastelowy-roz-KZ-3041638_[11370]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-chleb-23x37x17-cm-Koziol-MANNA-pastelowy-roz-KZ-3041638_[12806]_1200.jpg"}\''),
	(628, '\'Pojemnik na kapsułki z kawą Koziol ORION SMALL biały KZ-2026103\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2026103\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Pojemnik na kapsułki Orion powstał ze szczególną myślą o wielbicielach kawy z ekspressu. Pojemnik ma za zadanie pomóc w dobrej organizacji kuchni i bezpiecznym przechowywaniu kapsułek kawowych. Dostępny w kilku klasycznych wariantach kolorystycznych. Ma bardzo charakterystyczny kształ, przypominający gwiazdę &ndash; Oriona.&nbsp; Dzięki uniwersalnemu kształtowi sprawdzi się również w szeregu innych zastosowań takich jak pojemnik na kosmetyki, pojemnik wystawowy na lakiery, gumy, słodycze etc.. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Orion</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 20 cm<br class="def">\ndługość - 22,6 cm<br class="def">\nszerokość - 22,6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-na-kapsulki-z-kawa-Koziol-ORION-SMALL-bialy-KZ-2026103-p4890\',', '\'131\',', '\'106.5\',', '\'106.5\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-kapsulki-z-kawa-Koziol-ORION-SMALL-bialy-KZ-2026103_[12807]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-kapsulki-z-kawa-Koziol-ORION-SMALL-bialy-KZ-2026103_[12808]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-kapsulki-z-kawa-Koziol-ORION-SMALL-bialy-KZ-2026103_[12809]_1200.jpg"}\''),
