	(644, '\'Pojemnik na kawę z miarką 500g Koziol HOT STUFF M szmaragdowa zieleń KZ-3058380\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3058380\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zabawny i bardzo praktyczny pojemnik z pokrywką Hot Stuff wyposażony w stylową miarkę w kształcie ludzika. Pojemnik został tak zaprojektowany, aby jego pokrywka stanowiła równocześnie uchwyt na miarkę. W ten sposób miarka jest zawsze pod ręką, gotowa do precyzyjnego odmierzania porcji. Dzięki szczelnej pokrywce przechowywana w środku kawa zachowuje swój aromat na dłużej. \n Pojemnik może również posłużyć do przechowywania żywności sypkiej takiej jak: ryże, kasze, mąki, ziarna, orzechy, makarony, musli, płatki oraz ciasteczek, cukierków. Dobrze odnajdzie się&nbsp; także jako gustowna cukierniczka lub pojemnik na sól. \n Pojemnik dostępny w dwóch pojemnościach 350g lub 500g oraz w wielu wariantach kolorystycznych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Hot stuff</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 20 cm<br class="def">\ndługość - 17 cm<br class="def">\nszerokość - 8,5 cm<br class="def">\npojemność - 500 g</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-na-kawe-z-miarka-500g-Koziol-HOT-STUFF-M-szmaragdowa-zielen-KZ-3058380-p4464\',', '\'38\',', '\'30.89\',', '\'30.89\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-na-kawe-z-miarka-500g-Koziol-HOT-STUFF-M-szmaragdowa-zielen-KZ-3058380_[11412]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-1