	(645, '\'Pojemnik na parmezan z łyżeczką Forme Casa biały FC-16505411\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-16505411\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Duży pojemnik (wym. średnica 15 cm, wysokość 8 cm) do przechowywania parmezanu.&nbsp; Dołączona do pojemnika łyżeczka pozwoli na odmierzenie odpowiedniej ilości parmezanu. Pojemnik jest przezroczysty co jest niewątpliwie jego największą zaletą. Dzięki temu bez konieczności otwiera łatwo jest sprawdzić jego zawartość oraz dostępną ilość na wypadek gdyby trzeba było uzupełnić zapas. W bocznej powierzchni znajduje się niewielki otwór pozwalający na umieszczenie łyżeczki wewnątrz i swobodne zamknięcie pojemnika. Pojemnik jest umieszczony na podstawie w kolorze białym. Choć pojemnik wykonany jest z tworzywa sztucznego nie wygląda tandetnie, a wręcz przeciwnie elegancko i wytwornie. Do tego jest lekki i odporny na uszkodzenia. Sprawdzi się również jako gustowna cukierniczka lub pojemnik na sól, vegete, dżem, miód lub przyprawy kuchenne. \n Marka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 8 cm<br class="def">\nśrednica - 15 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-na-parmezan-z-lyzeczka-Forme-Casa-bialy-FC-1650541