	(652, '\'Pojemnik na pieczywo chrupkie 9x18 cm Koziol BROD kobaltowy KZ-3042585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3042585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp;Pojemnik na pieczywo chrupkie niemieckiej marki Koziol. Wykonany z najwyższej jakości tworzywa sztucznego, dzięki czemu pieczywo na dłużej zachowuje swoją świeżość. Wierzch pokrywki swoim kształtem i fakturą przypomina chrupką kanapkę, dzięki czemu już na pierwszy rzut oka wiadomo, co znajduje się w środku. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Brod</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 14,6 cm<br class="def">\ndługość - 18 cm<br class="def">\nszerokość - 9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-na-pieczywo-chrupkie-9x18-cm-Koziol-BROD-kobaltowy-KZ-3042585-p4749\',', '\'84\',', '\'68.29\',', '\'68.29\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Chlebaki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-pieczywo-chrupkie-9x18-cm-Koziol-BROD-kobaltowy-KZ-3042585_[12207]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-pieczywo-chrupkie-9x18-cm-Koziol-BROD-kobaltowy-KZ-3042585_[12208]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Pojemnik-na-pieczywo-chrupkie-9x18-cm-Koziol-BROD-kobaltowy-KZ-3042585_[12209]_1200.jpg"}\''),
