	(670, '\'Pojemnik wielofunkcyjny na kubek 17,2x12,8 cm Koziol MIAOU kobaltowa KZ-3498585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3498585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zawieszka z kotkiem Miaou to propozycja marki Koziol mająca na celu rozwiązanie problemu wykorzystanej torebeczki herbaty. Pojemnik można powiesić za główkę na krawędzi kubka, szklanki lub miseczki i umieścić w nim torebkę z herbatą przed i/lub po zaparzeniu. Zawieszkę można również wykorzystać jako pojemnik na cukier, cytrynę, miód lub słodką przekąskę. Wysokiej jakości tworzywo, z którego znana jest niemiecka firma, stanowi gwarancję jakości produktu. Produkt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5,7 cm<br class="def">\ndługość - 7,2 cm<br class="def">\nszerokość - 7,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pojemnik-wielofunkcyjny-na-kubek-17-2x12-8-cm-Koziol-MIAOU-kobaltowa-KZ-3498585-p4484\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-wielofunkcyjny-na-kubek-17-2x12-8-cm-Koziol-MIAOU-kobaltowa-KZ-3498585_[11464]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-wielofunkcyjny-na-kubek-17-2x12-8-cm-Koziol-MIAOU-kobaltowa-KZ-3498585_[11465]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pojemnik-wielofunkcyjny-na-kubek-17-2x12-8-cm-Koziol-MIAOU-kobaltowa-KZ-34985