	(678, '\'Przybory kuchenne 3 szt. na stojaku Koziol KANT szare KZ-3309457\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3309457\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Przybory kuchenne na stojaku z kolekcji Kant to przyrządy ułatwiające prace w kuchni, pozwalające na poradzenie sobie ze wszystkimi czynnościami w kuchni. W skład zestawu wchodzą: łopatka, szczypce oraz łyżka do mieszania. Gdy narzędzia nie będą użytkowane można je odłożyć na stojak zaprojektowany specjalny w tym celu. Dzięki niemu zawsze wiemy gdzie znajdują się potrzebne akcesoria. Całość prezentuje się bardzo elegancko, dlatego zestaw ten będzie wspaniałą ozdobą każdej nowoczesnej kuchni. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">KANT</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 31,8 cm<br class="def">\ndługość - 40,7 cm<br class="def">\nszerokość - 6,9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Przybory-kuchenne-3-szt-na-stojaku-Koziol-KANT-szare-KZ-3309457-p4491\',', '\'106\',', '\'86.18\',', '\'86.18\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Stojaki na narzędzia kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Przybory-kuchenne-3-szt-na-stojaku-Koziol-KANT-szare-KZ-3309457_[11488]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Przybory-kuchenne-3-szt-na-stojaku-Koziol-KANT-szare-KZ-3309457_[11489]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Przybory-kuchenne-3-szt-na-stojaku-Koziol-KANT-szare-KZ-3309457_[11490]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/1100