	(687, '\'Pucharek deserowy 250 ml Koziol CRYSTAL 2.0 pastelowy róż KZ-3577640\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3577640\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp; Pucharek z kolekcji Crystal 2.0 świetnie nadaje się do podawania zarówno napojów jak i deserów! \n Wspaniałe kolory i oryginalny promienny szlif jakim ozdobione są produkty z kolekcji Crystal 2.0 sprawia, że odbijają one promienie na wszystkie strony. Wyglądają jak cudowne kryształy. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 12 cm<br class="def">\nśrednica - 8,4 cm<br class="def">\npojemność - 250 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Pucharek-deserowy-250-ml-Koziol-CRYSTAL-2-0-pastelowy-roz-KZ-3577640-p4496\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Kieliszki i pucharki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pucharek-deserowy-250-ml-Koziol-CRYSTAL-2-0-pastelowy-roz-KZ-3577640_[11504]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pucharek-deserowy-250-ml-Koziol-CRYSTAL-2-0-pastelowy-roz-KZ-3577640_[11505]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pucharek-deserowy-250-ml-Koziol-CRYSTAL-2-0-pastelowy-roz-KZ-3577640_[11506]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pucharek-deserowy-250-ml-Koziol-CRYSTAL-2-0-pastelowy-roz-KZ-3577640_[11507]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Pucharek-deserowy-250-ml-Koziol-CRYSTAL-2-0-pastelowy-roz-KZ-3577640_[11508]_1200.jpg"}\''),
	(688, '\'Rączka-uchwyt Tefal Ingenio czarna L9933072\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'L9933072\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Wyjmowana rączka marki Tefal z serii Ingenio. Jest uniwersalna - pasuje zarówno do patelni jak i garnków tej samej marki. Jest niewielka dzięki czemu zmieści się do każdej szuflady i zajmuje bardzo mało miejsca. Rączka jest bardzo wygodna. Jej kształt został dobrze dopasowany do ludzkiej dłoni, co daje wysoki komfort użytkowania. Maksymalne obciążenie jakie utrzyma to 10 kg, Produkt wykonano z wysokiej jakości czarnego bakelitu i stali nierdzewnej. Połączenie klasycznej czerni i koloru stalowego pozwala na to, że rączka oprócz swych dużych walorów funkcjonalnych wpasowuje się doskonale kolorystycznie do każdego wnętrza. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Ingenio</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">bakelit, stal nierdzewna</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Maksymalne obciążenie;: 10 kg\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Raczka-uchwyt-Tefal-Ingenio-czarna-L9933072-p5661\',', '\'67\',', '\'54.47\',', '\'54.47\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Raczka-uchwyt-Tefal-Ingenio-czarna-L9933072_[18124]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Raczka-uchwyt-Tefal-Ingenio-czarna-L9933072_[18149]_1200.jpg"}\''),
	(689, '\'Sitko do odcedzania Koziol SIEBFIED kobaltowe KZ-3811585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3811585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Sitko do odcedzania Siebfried to rozwiązanie doskonałe pod każdym względem. Ciekawie się prezentuje i w 100% spełnia swoją funkcję. Do tego dzięki temu, że jest płaskie zajmuje bardzo mało miejsca w kuchennej szafce. Sitko można także schować w szufladzie lub zawiesić za uchwyt na haczyku. Wykonane z wysokiej jakości tworzywa sztucznego odpornego na temperaturę do 220 stopni Celsjusza. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Siebfried</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 1,2 cm<br class="def">\ndługość - 35,3 cm<br class="def">\nszerokość - 12 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Sitko-do-odcedzania-Koziol-SIEBFIED-kobaltowe-KZ-3811585-p4497\',', '\'33\',', '\'26.83\',', '\'26.83\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Durszlaki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Sitko-do-odcedzania-biale-Koziol-SIEBFIED-kobaltowe-KZ-3811585_[11509]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Sitko-do-odcedzania-biale-Koziol-SIEBFIED-kobaltowe-KZ-3811585_[11510]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Sitko-do-odcedzania-biale-Koziol-SIEBFIED-kobaltowe-KZ-3811585_[12833]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Sitko-do-odcedzania-biale-Koziol-SIEBFIED-kobaltowe-KZ-3811585_[12834]_1200.jpg"}\''),
