	(691, '\'Solniczka i pieprzniczka Koziol MIAOU biel/czerń KZ-3103496\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3103496\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Jeżeli lubisz koty to czemu nie wybierzesz wesołego zestawu solniczki i pieprzniczki MIAO? Jak wiadomo żaden dom nie obejdzie bez tych akcesoriów, dlatego warto zainwestować w akcesoria wysokiej jakości, które nie dość, że spełnią w pełni swoje zadanie do tego będą cieszyć oko swoim nadzwyczajnym wyglądem. Wykonane z tworzywa sztucznego, ale nie wyglądają kiczowato, wręcz przeciwnie wyglądają elegancko i gustownie. Z powodzeniem odnajdą się na Twoim stole. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5 cm<br class="def">\ndługość - 5,8 cm<br class="def">\nszerokość - 2,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Solniczka-i-pieprzniczka-Koziol-MIAOU-biel-czern-KZ-3103496-p4500\',', '\'33\',', '\'26.83\',', '\'26.83\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Przyprawniki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-Koziol-MIAOU-bielczern-KZ-3103496_[11515]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-Koziol-MIAOU-bielczern-KZ-3103496_[11516]_1200.jpg"}\''),
	(692, '\'Solniczka i pieprzniczka Koziol MIAOU biel/róż KZ-3103395\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3103395\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Jeżeli lubisz koty to czemu nie wybierzesz wesołego zestawu solniczki i pieprzniczki MIAO? Jak wiadomo żaden dom nie obejdzie bez tych akcesoriów, dlatego warto zainwestować w akcesoria wysokiej jakości, które nie dość, że spełnią w pełni swoje zadanie do tego będą cieszyć oko swoim nadzwyczajnym wyglądem. Wykonane z tworzywa sztucznego, ale nie wyglądają kiczowato, wręcz przeciwnie wyglądają elegancko i gustownie. Z powodzeniem odnajdą się na Twoim stole. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5 cm<br class="def">\ndługość - 5,8 cm<br class="def">\nszerokość - 2,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy, biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Solniczka-i-pieprzniczka-Koziol-MIAOU-biel-roz-KZ-3103395-p4933\',', '\'33\',', '\'26.83\',', '\'26.83\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Przyprawniki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Solniczka-i-pieprzniczka-Koziol-MIAOU-bielroz-KZ-3103395_[13378]_1200.jpg"}\''),
	(693, '\'Solniczka i pieprzniczka Koziol STEP´N PEP KZ-3110001\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3110001\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Codzienne posiłki nie muszą być już dużej nudne. A to za sprawą solniczki i pieprzniczki step&acute;n pep czyli wesołych, fikuśnych ludzików, które nie wyobrażają sobie życia bez tańca. Zawsze występują razem, złączone w tańcu przy pomocy umieszczonych w ich łapkach magnesów. Swoją obecnością wprowadzą na stół szczyptę zabawy, radości, a w razie potrzeby służą pomocą w doprawianu posiłków.&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">STEP´N PEP</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 8 cm<br class="def">\ndługość - 11,5 cm<br class="def">\nszerokość - 6,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Solniczka-i-pieprzniczka-Koziol-STEPN-PEP-KZ-3110001-p4501\',', '\'127\',', '\'103.25\',', '\'103.25\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Przyprawniki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-Koziol-STEP-N-PEP-KZ-3110001_[11517]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-Koziol-STEP-N-PEP-KZ-3110001_[11518]_1200.jpg"}\''),
	(694, '\'Solniczka i pieprzniczka na stojaku Koziol ELLI biel/czerń KZ-3113417\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3113417\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Przyprawniki w kształcie uroczych sów umieszczone na stojaku w kształcie gałęzi to kolejna perfekcyjna&nbsp; propozycja od marki Koziol. Niewielkie wymiary, doskonale dobrane kolory i projekt dopracowany w każdym calu to cechy charakterystyczne dla tego pionierskiego projektu. Solniczka i pieprzniczka są w odmiennych kolorach, aby zapewnić wybór zawsze odpowiedniej przyprawy. Rewelacyjny zestaw wzbogaci stół swoim wyjątkowym wyglądem. Sprawdzi się także jako pomysłowy upominek dla miłośników dobrze przyprawionych potraw i eleganckich akcesoriów kuchennych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Elli</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7,4 cm<br class="def">\ndługość - 16,7 cm<br class="def">\nszerokość - 10,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Solniczka-i-pieprzniczka-na-stojaku-Koziol-ELLI-biel-czern-KZ-3113417-p4502\',', '\'63\',', '\'51.22\',', '\'51.22\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Przyprawniki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-na-stojaku-Koziol-ELLI-bielczern-KZ-3113417_[11519]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-na-stojaku-Koziol-ELLI-bielczern-KZ-3113417_[11520]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Solniczka-i-pieprzniczka-na-stojaku-Koziol-ELLI-bielczern-KZ-3113417_[11521]_12