	(696, '\'Spodeczki na przekąski 4 szt. Koziol LEAF-ON białe KZ-3556101\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3556101\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Leaf-on to rozwiązanie które zaskakuje. Wspaniałe spodeczki w formie pięknego liścia są wielofunkcyjne.&nbsp;Nadają się zarówno jako podkładka pod torebkę zaparzonej herbaty, małe ciasteczko, koreczek, lub przekąskę. Jednak wykorzystasz je nie tylko na stole. W codziennym użytkowaniu sprawdzą się świetnie jako podstawki pod łyżkę w kuchni ponieważ są bardzo stabilne i mają odpowiednią powierzchnię. W zestawie znajdują się cztery spodeczki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Leaf-on</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 14 cm<br class="def">\nszerokość - 9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Spodeczki-na-przekaski-4-szt-Koziol-LEAF-ON-biale-KZ-3556101-p4504\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Patery i etażerki na ciasto\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Spodeczki-na-przekaski-4-szt-Koziol-Leaf-on-biale-KZ-3556101_[11526]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Spodeczki-na-przekaski-4-szt-Koziol-Leaf-on-biale-KZ-3556101_[11527]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Spodeczki-na-przekaski-4-szt-Koziol-LEAF-ON-biale-KZ-3556101_[12838]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Spodeczki-na-przekaski-4-szt-Koziol-LEAF-ON-biale-KZ-3556101_[12839]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetro