	(706, '\'Stojak na biżuterie 21,5 cm Koziol MIAOU kobaltowy KZ-5263645\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5263645\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Przedstawiony tu produkt to stojak na biżuterię w kształcie kotka o nazwie Miaou.&nbsp; Stojak służy do uporządkowania drobnej biżuterii, a szczególnie pierścionków, tak aby zawsze były pod ręką.&nbsp; Do zawieszania wykorzystać można uszy (dziurki w uszach umożliwiają zawieszenie kolczyków klipsów) oraz wysoko wyciągnięty ogonek, na którym zmieści się nie dwa nie trzy, a dużo dużo więcej pierścionków. Idealny na prezent dla miłośników zwierząt. Kotek Miaou lubi przebywać w towarzystwie swoich przyjaciół WOW (sympatyczny piesek) oraz Ringo (urocza myszka). Stojaki zwierzaki razem tworzą super trio, które oprócz wprowadzania harmonii i porządku, tworzą niespotykaną dekorację wnętrza. \n Produkt dostępny w wielu wariantach kolorystycznych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 21,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Stojak-na-bizuterie-21-5-cm-Koziol-MIAOU-kobaltowy-KZ-5263645-p4512\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Stojaki na biżuterię\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-bizuterie-21-5-cm-Koziol-MIAOU-kobaltowy-KZ-5263645_[11567]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-bizuterie-21-5-cm-Koziol-MIAOU-kobaltowy-KZ-5263645_[11568]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/