	(712, '\'Stojak na biżuterie Koziol WOW kobaltowy KZ-5266645\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5266645\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'WOW!&nbsp; Od tej reakcji wywoływanej na widok stojaka w kształcie sympatycznego Jamnika powstała nazwa całej kolekcji. Stojak służy do uporządkowania drobnej biżuterii, a szczególnie pierścionków, tak aby zawsze były pod ręką.&nbsp; Do zawieszania wykorzystać można sympatyczny pyszczek, oklapnięte uszka oraz wysoko wyciągnięty ogonek, na którym zmieści się nie dwa nie trzy, a dużo dużo więcej pierścionków. Idealny na prezent dla miłośników naszych czworonożnych przyjaciół. Piesek WOW lubi przebywać w towarzystwie swoich przyjaciół Ringo (urzekająca myszka) oraz Miaou (osobliwy kotek). Stojaki zwierzaki razem tworzą super trio, które oprócz wprowadzania harmonii i porządku, tworzą niespotykaną dekorację wnętrza. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Wow</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 21,6 cm<br class="def">\ndługość - 5,1 cm<br class="def">\nszerokość - 14,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Stojak-na-bizuterie-Koziol-WOW-kobaltowy-KZ-5266645-p4513\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Stojaki na biżuterię\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-bizuterie-Koziol-WOW-kobaltowy-KZ-5266645_[11570]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-bizuterie-Koziol-WOW-kobaltowy-KZ-5266645_[11571]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images