	(714, '\'Stojak na butelki 35x23 cm Koziol SET-UP kobaltowy KZ-3596585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3596585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Elegancki stojak na butelki z serii Set-UP to propozycja dla ludzi kreatywnych. Pojedynczy moduł mieści 8 butelek, ale z powodzeniem można łączyć&nbsp; ze sobą kilka modułów, mieszać kolory i tworzyć własne, niepowtarzalne kombinacje np. ścianka, lada. Stojak o minimalistycznej formie nie tłumi przechowywanej w nich zawartości. Set-up to jeden z niekwestionowanych bestsellerów marki Koziol. Sukces zapewniła mu wielofunkcyjność. Można bowiem przetrzymywać w nim butelki wina (w pozycji poziomej czyli tak jak lubi ono najbardziej), butelki wody, napoje kolorowe lub inne rzeczy takie jak gazety, ręczniki, tekstylia. Ponadto jest to spory przedmiot, co pozwala mu grać ważną rolę w wystroju wnętrza. Taki element dodaje wystrojowi charakteru i &quot;tego czegoś&quot; co dopełnia idealnie przemyślane wnętrza. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Set-up</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 23 cm<br class="def">\nszerokość - 35 cm<br class="def">\npojemność - 8 butelek<br class="def">\n<br class="def">\n<strong class="def">otwory:</strong><br class="def">\nśrednica - ok. 9 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">kremowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Stojak-na-butelki-35x23-cm-Koziol-SET-UP-kobaltowy-KZ-3596585-p4515\',', '\'152\',', '\'123.58\',', '\'123.58\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Stojaki na butelki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-butelki