	(729, '\'Stojak na ręcznik papierowy z rączką Forme Casa biały FC-01455711\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-01455711\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Elegancki i funkcjonalny stojak na ręcznik papierowy. Posiada ułatwiającą przenoszenie wygodną rączkę. Umocowany na szerokim rancie który zapewnia stabilnosć. Prosty i elegancki, znajdzie swoje zastosowanie w każdej kuchni. \n Marka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 28 cm<br class="def">\nśrednica - 12,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Stojak-na-recznik-papierowy-z-raczka-Forme-Casa-bialy-FC-01455711-p4106\',', '\'36\',', '\'29.27\',', '\'29.27\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Stojaki na ręczniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Stojak-na-recznik-papierowy-z-raczka-Forme-Casa-bialy-FC-01455711_[9962]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Stojak-na-recznik-papierowy-z-raczka-Forme-Casa-bialy-FC-01455711_[10004]_1200.jpg"}\''),
	(730, '\'Stojak na ręczniki papierowe 12,3x33,4 cm Koziol ROGER czerwony KZ-5226583\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5226583\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Uroczy kotek czy nieśmiały królik? Wprowadź do swojej kuchni odrobinę dobrego humoru wraz z praktycznym stojakiem na ręcznik papierowy potraktowany z &quot;przymrużeniem oka&quot;. Nieśmiały królik, który uwielbia ukrywać się w rolce ręcznika nazywa się Roger. Z nad rolki ręcznika wystają uszy królika, pozwalając na łatwe przenoszenie stojaka. A z boku wystają długie królicze łapki przytrzymujące papier przed rozwijaniem się i ułatwiające odrywanie kawałków ręcznika.&nbsp; Stojak na ręczniki kuchenne Roger sprawi, że nawet tak nudna czynność jak czyszczenie kuchennego stołu, blatu stanie się przyjemniejsza. \nProdukt dostępny w wielu wariantach kolorystycznych. \nA dla miłośników kotków polecamy stojak Miaou. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Roger</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 33,4 cm<br class="def">\ndługość - 11,6 cm<br class="def">\nszerokość - 12,3 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czerwony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Stojak-na-reczniki-papierowe-12-3x33-4-cm-Koziol-ROGER-czerwony-KZ-5226583-p4892\',', '\'97\',', '\'78.86\',', '\'78.86\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Stojaki na ręczniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Stojak-na-reczniki-papierowe-12-3x33-4-cm-Koziol-ROGER-czerwony-KZ-5226583_[12868]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Stojak-na-reczniki-papierowe-12