	(733, '\'Stojak na ręczniki papierowe 12,8x35,5cm Koziol ELLI biały KZ-5227525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5227525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Uroczy kotek, nieśmiały królik, a może dumna sowa? Wprowadź do swojej kuchni odrobinę dobrego humoru wraz z praktycznym stojakiem na ręcznik papierowy potraktowanym z &quot;przymrużeniem oka&quot;. Z nad rolki ręcznika wystaje główka sowy dodająca całości wyjątkowego charakteru. Stojak na ręczniki kuchenne Elli sprawi, że nawet tak nudna czynność jak czyszczenie kuchennego stołu, blatu stanie się przyjemniejsza. \nA dla miłośników zwierząt polecamy stojak z kotkiem Miaou lub królikiem Rogerem. Produkt dostępny w wielu wariantach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Elli</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 35,5 cm<br class="def">\nśrednica - 12,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Stojak-na-reczniki-papierowe-12-8x35-5cm-Koziol-ELLI-bialy-KZ-5227525-p4523\',', '\'84\',', '\'68.29\',', '\'68.29\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Stojaki na ręczniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-reczniki-papierowe-12-8x35-5cm-Koziol-ELLI-bialy-KZ-5227525_[11602]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-reczniki-papierowe-12-8x35-5cm-Koziol-ELLI-bialy-KZ-5227525_[11603]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Stojak-na-reczniki-papierowe-12-8x35-5cm-Koziol-ELLI-bialy-KZ-5227525_[11604]_1200.jpg"}\''),
