	(745, '\'Szczotka do naczyń 26,3 cm Koziol TIM kobaltowa KZ-5043585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5043585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Szczotka do mycia naczyń Tim będzie przydatnym akcesorium w każdej kuchni. Wykonana z należytą starannością z wysokiej jakości tworzywa sztucznego, będzie idealnym pomocnikiem przez długi czas. Rączka, w zabawnym kształcie, jest wyprofilowana w taki sposób, aby wygodnie trzymała się w dłoni. Długie włosie świetnie poradzi sobie z każdym zabrudzeniem. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tim</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 26,3 cm<br class="def">\ndługość - 6,5 cm<br class="def">\nszerokość - 6,6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szczotka-do-naczyn-26-3-cm-Koziol-TIM-kobaltowa-KZ-5043585-p4847\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Szczotki do naczyń\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Szczotka-do-naczyn-26-3-cm-Koziol-TIM-kobaltowa-KZ-5043585_[12319]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Szczotka-do-naczyn-26-3-cm-Koziol-TIM-kobaltowa-KZ-5043585_[12879]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Szczotka-do-naczyn-26-3-cm-Koziol-TIM-kobaltowa-KZ-5043585_[12880]_1200.jpg"}\''),
