	(757, '\'Szczotka do WC 11,3x44,3 cm Koziol TOQ kobaltowy KZ-5010585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5010585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zobaczcie, jak w humorystyczny sposób można urządzić przestrzeń łazienki z kolekcją TOQ. Niesamowita kolekcja z marsjaninem to jeden z najlepszych produktów marki Koziol.&nbsp; Przedstawiona tu szczotka do WC&nbsp; na uchwycie posiada wielkie białe oko. W całości imituje ona niezwykłego przybysza pozaziemskiego, co&nbsp; stanowić będzie intrygujący element wyposażenia. Prezentuje się on interesująco. Razem z pozostałymi produktami z serii Toq z pewnością stworzą prawdziwie kosmiczny klimat. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">TOQ</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 44,3 cm<br class="def">\nśrednica - 11,3 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szczotka-do-WC-11-3x44-3-cm-Koziol-TOQ-kobaltowy-KZ-5010585-p4938\',', '\'169\',', '\'137.4\',', '\'137.4\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Szczotki do WC\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Szczotka-do-WC-11-3x44-3-cm-Koziol-TOQ-kobaltowy-KZ-5010585_[13390]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Szczotka-do-WC-11-3x44-3-cm-Koziol-TOQ-kobaltowy-KZ-5010585_[13391]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Szczotka-do-WC-11-3x44-3-cm-Koziol-TOQ-kobaltowy-KZ-5010585_[13392]_1200.jpg"}\''),
