	(766, '\'Szczypce kuchenne 33,5 cm Koziol KANT czarne KZ-3227526\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3227526\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Szczypce niemieckiej marki Koziol zachwycają swoim geometrycznym kształtem. Możesz ich użyć do podnoszenia ciasteczek, serwowania spaghetti, używać jako szpatułki lub sztućców do sałaty. Są zawsze tak gdzie ich potrzebujesz.&nbsp;Odporne na temperaturę do 220 st. C. \n &nbsp; \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Kant</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 33,5 cm<br class="def">\ndługość - 6 cm<br class="def">\nszerokość - 5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szczypce-kuchenne-33-5-cm-Koziol-KANT-czarne-KZ-3227526-p4537\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'KUCHNIA &amp; JADALNIA/Narzędzia kuchenne/Inne narzędzie kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Szczypce-kuchenne-33-5-cm-Koziol-KANT-czarne-KZ-3227526_[11627]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Szczypce-kuchenne-33-5-cm-Koziol-KANT-czarne-KZ-3227526_[11628]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Szczypce-kuchenne-33-5-cm-Koziol-KANT-czarne-KZ-3227526_[11629]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Szczypce-kuchenne-33-5-cm-Koziol-KANT-czarne-KZ-3227526_[11630]_1200.jpg"}\''),
	(767, '\'Szczypce kuchenne 33,5 cm Koziol KANT szare KZ-3227632\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3227632\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Szczypce niemieckiej marki Koziol zachwycają swoim geometrycznym kształtem. Możesz ich użyć do podnoszenia ciasteczek, serwowania spaghetti, używać jako szpatułki lub sztućców do sałaty. Są zawsze tak gdzie ich potrzebujesz.&nbsp;Odporne na temperaturę do 220 st. C. \n &nbsp; \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Kant</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 33,5 cm<br class="def">\ndługość - 6 cm<br class="def">\nszerokość - 5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szczypce-kuchenne-33-5-cm-Koziol-KANT-szare-KZ-3227632-p4538\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'KUCHNIA &amp; JADALNIA/Narzędzia kuchenne/Inne narzędzie kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Szczypce-kuchenne-33-5-cm-Koziol-KANT-szare-KZ-3227632_[11631]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Szczypce-kuchenne-33-5-cm-Koziol-KANT-szare-KZ-3227632_[11632]_1200.jpg"}\''),
	(768, '\'Szklanka 250 ml Koziol CHEERS TUMBLER antracytowa KZ-3404540\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3404540\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Czy marzyłeś kiedyś o kieliszku, który się nigdy nie stłucze? Jeżeli tak to mamy dobrą wiadomość. Marka Koziol spełniła Twoje marzenie i stworzyła unikatową kolekcją nietłukących się szklanek, kieliszków do wina, kieliszków do szampana wydanej pod nazwą Koziol SUPERGLAS. Co prawda są stworzone z tworzywa sztucznego, ale tak jak prawdziwe szkło odbijają i załamują światło w podobny sposób. Z pewnością nie dostrzeżesz różnicy, a wiele zyskasz. Naczynia są dostępne w kilku kolorach z ciekawymi nadrukami. Dzięki czemu można zakupić zestaw różnorodnych kieliszków i nigdy więcej nie spotkać z problemem &ldquo;który to jest mój kieliszek?&rdquo;.&nbsp; \n Przedstawiony tu produkt to szklanka w kolorze antracytowym. \n Naczynia z serii Koziol Superglas sprawdzą się świetnie podczas rodzinnych spotkań, większych imprez oraz w plenerze.&nbsp; \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">CHEERS TUMBLER</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 8,7 cm<br class="def">\nśrednica - 9,2 cm<br class="def">\npojemność - 250 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szklanka-250-ml-Koziol-CHEERS-TUMBLER-antracytowa-KZ-3404540-p4968\',', '\'33\',', '\'26.83\',', '\'26.83\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Szklanki i kubki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Szklanka-250-ml-Koziol-CHEERS-TUMBLER-antracytowa-KZ-3404540_[13488]_1200.jpg","1":"http:\\/\\/wetr