	(794, '\'Szklanka na zimne napoje 200 ml Koziol CRYSTAL S szmaragdowa zieleń KZ-3545650\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3545650\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Czy marzyłeś kiedyś o kieliszku, który się nigdy nie stłucze? Jeżeli tak to mamy dobrą wiadomść. Marka Koziol spełniła Twoje marzenie i stworzyła unikatową kolekcją nietłukących się szklanek, kieliszków do wina, kieliszków do szampana wydanej pod nazwą Koziol SUPERGLAS. Co prawda są stworzone z tworzywa sztucznego, ale tak jak prawdziwe szkło odbijają i załamują światło w podobny sposób. Z pewnością nie dostrzerzesz różnicy, a wiele zyskasz. Naczynia są dostępne w kilku kolorach z ciekawymi nadrukami. Dzięki czemu można zakupić zestaw różnorodnych kieliszków i nigdy więcej nie spotkać z problemem &ldquo;który to jest mój kieliszek?&rdquo;. \nPrzedstawionu tu produkt to szkalnka w kolorze szmaragdowej zieleni. \nNaczynia z serii Koziol Superglas sprawdzą się świetnie podczas rodzinnych spotkań,&nbsp; większych imprez oraz w plenerze. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Crystal 2.0.</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9 cm<br class="def">\nśrednica - 8,4 cm<br class="def">\npojemność - 200 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szklanka-na-zimne-napoje-200-ml-Koziol-CRYSTAL-S-szmaragdowa-zielen-KZ-3545650-p4939\',', '\'12\',', '\'9.76\',', '\'9.76\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Szklanki i kubki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Szklanka-na-zimne-napoje-200-ml-Koziol-CRYSTAL-S-szmaragdowa-zielen-