	(796, '\'Szklanka na zimne napoje 450 ml Koziol CLUB L szmaragdowa zieleń KZ-3578650\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3578650\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Czy marzyłeś kiedyś o kieliszku, który się nigdy nie stłucze? Jeżeli tak to mamy dobrą wiadomość. Marka Koziol spełniła Twoje marzenie i stworzyła unikatową kolekcją nietłukących się szklanek, kieliszków do wina, kieliszków do szampana wydanej pod nazwą Koziol SUPERGLAS. Co prawda są stworzone z tworzywa sztucznego, ale tak jak prawdziwe szkło odbijają i załamują światło w podobny sposób. Z pewnością nie dostrzeżesz różnicy, a wiele zyskasz. Naczynia są dostępne w kilku kolorach z ciekawymi nadrukami. Dzięki czemu można zakupić zestaw różnorodnych kieliszków i nigdy więcej nie spotkać z problemem &ldquo;który to jest mój kieliszek?&rdquo;.&nbsp; \n Przedstawiony tu produkt to szklanka na zimne napoje w kolorze szmaragdowej zieleni. \n Naczynia z serii Koziol Superglas sprawdzą się świetnie podczas rodzinnych spotkań, większych imprez oraz w plenerze.&nbsp; \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Club</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 14,1 cm<br class="def">\nśrednica - 8,8 cm<br class="def">\npojemność - 400 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Szklanka-na-zimne-napoje-450-ml-Koziol-CLUB-L-szmaragdowa-zielen-KZ-3578650-p4940\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Szklanki i kubki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Szklanka-na-zimne-napoje-450-ml-Koziol-CLUB-L-szmarag