	(844, '\'Taboret 42,8x40,6x41,6 cm Koziol BRIQ kobaltowy KZ-5788585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5788585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Designerski taboret w kształcie przypominającym duży klocek lego, któremu ciekawego designu dodaje jedna &quot;zawinięta&quot; ścianka boczna. Taboret wykonany został z tworzywa sztucznego, więc jest bardzo lekki i łatwo go przenosić. Do tego jest odporny na warunki atmosferyczne, dlatego z powodzeniem można go użytkować również na tarasie czy ogrodzie. Kiedy nie jest używany można układać taborety jeden na drugim dla zaoszczędzenia miejsca. \nBriq to nie tylko taboret, produkt ten sprawdzi się również jako mały stolik, podnóżek, taborecik dla dziecka. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Briq</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 41,6 cm<br class="def">\ndługość - 40,6 cm<br class="def">\nszerokość - 42,8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Taboret-42-8x40-6x41-6-cm-Koziol-BRIQ-kobaltowy-KZ-5788585-p4566\',', '\'297\',', '\'241.46\',', '\'241.46\',', '\'LAMPY &amp; MEBLE/Meble/Taborety\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Taboret-12-8x40-6x41-6-cm-Koziol-BRIQ-kobaltowy-KZ-5788585_[11693]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Taboret-12-8x40-6x41-6-cm-Koziol-BRIQ-kobaltowy-KZ-5788585_[11694]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Taboret-12-8x40-6x41-6-cm-Koziol-BRIQ-kobaltowy-KZ-5788585_[11695]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12