	(848, '\'Taca do serwowania przekąsek 21x21 cm Koziol KANT kobaltowa KZ-3660585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3660585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Nietuzinkowe tace do serwowania z niepowtarzalnej kolekcji Kant marki Koziol inspirowane prawdziwą naturą. Prosta, naturalna elegancja to dziś jeden z najchętniej stosowanych trendów w nowoczesnym designie! \nAkcesorium wykonane zostało z tworzywa sztucznego, lekkiego i trwałego. Posiada bardzo charakterystyczny kształt pogiętej kartki, podzielonej na cztery komory. Dzięki komorom na raz można podawać cztery (różne) przekąski na raz. Tacki stworzono z myślą o eleganckim serwowaniu drobnych przekąsek podczas przyjęć okolicznościowych np. owoców, orzeszków, ciasteczek, cukiereczków czy dipów etc. Wspaniale prezentują się na stole. Nie może ich zabraknąć w Twoim domu. Produkt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Kant</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 4 cm<br class="def">\ndługość - 21 cm<br class="def">\nszerokość - 21 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Taca-do-serwowania-przekasek-21x21-cm-Koziol-KANT-kobaltowa-KZ-3660585-p4568\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Deski i tacki do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Taca-do-serwowania-przekasek-21x21-cm-Koziol-KANT-kobaltowa-KZ-3660585_[11709]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Taca-do-serwowania-przekasek-21x21-cm-Koziol-KANT-koba