	(857, '\'Taca na przekąski Koziol TANGRAM READY kobaltowa KZ-3480390\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3480390\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Najnowsze trendy w designie wnętrz to produkty o kształtach prostych, geometrycznych zaczerpniętych z natury i architektury. W większosci używanymi kolorami są więc biele, czernie,&nbsp; szarości oraz intensywne odcienie zieleni. Zgodnie z najnowszym trendem oraz dzięki inspiracją tangramami niemiecka marka Koziol stworzyła swój bestsellowy produkt tackę do serwowania przekasek Kant w całkowicie nowej odsłonie. \nStandardowa tacka Kant kwadratowa z podziałką na cztery cześci teraz dostępna jest w kilku innych wersjach: \nTangram Ready &ndash; powiększona wersja, powiększony wymiar z podziałem na 7 części o różnych kształatch i wielkościach, dzięki czemu zmieści się aż dwa razy wiecej różnych przekąsek, \nTangram &ndash; modułowa wersja, dwu lub czteroczęściowe zestawy pojedynczych miseczek w kształcie trójkątnym lub kwadratowym. Przy czy zestawy są różnokolorowe. \nPrzedstawiony tu produkt to Tangram Ready z elementami w odcieniach bieli, różu i granatu. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tangram Ready</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 3,2 cm<br class="def">\ndługość - 30,3 cm<br class="def">\nszerokość - 30,3 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Taca-na-przekaski-Koziol-TANGRAM-READY-kobaltowa-KZ-3480390-p4572\',', '\'127\',', '\'103.25\',', '\'103.25\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Deski i tacki do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Taca-na-przekaski-Koziol-TANGRAM-READY-kobaltowa-KZ-3480390_[11728]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Taca-na-przekaski-Koziol-TANGRAM-READY-kobaltowa-KZ-3480390_[14316]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Taca-na-przekaski-Koziol-TANGRAM-READY-kobaltowa-KZ-3480390_[14317]_1200.jpg"}\''),
