eski i tacki do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Tacki-na-przekaski-kwadratowe-4-szt-Koziol-TANGRAM-zielone-KZ-3483386_[12222]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Tacki-na-przekaski-kwadratowe-4-szt-Koziol-TANGRAM-zielone-KZ-3483386_[14337]_1200.jpg"}\''),
