	(878, '\'Talerz z nadrukiem Tapas Ladelle niebieski LD-61318-1\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-61318-1\',', 0, '\'Ladelle\',', NULL, NULL, NULL, NULL, '\'.\',', '\'Talerz z nadrukiem z kolekcji Tapas zostały zaprojektowane tak, aby pomagać łączyć ludzi z kulturą. Morskie printy wprowadzają nas w błogi klimat śródziemnomorski. Cała kolekcja została stworzona w 100% z naturalnej terakoty. Jest to produkt handmade więc każdy model jest jedyny w swoim rodzaju. Biała glazura kontrastuje z surową terakotą aby podkreślić naturalność materiałów. Poza sferą wizualną miseczki są niezwykle praktyczne, ponieważ nadają się zarówno do mikrofalówki jak i piekarnika czy zmywarki! \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tapas</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 2 cm<br class="def">\ndługość - 17,5 cm<br class="def">\nszerokość - 17,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">niebieski, biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">terakota</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Talerz-z-nadrukiem-Tapas-Ladelle-niebieski-LD-61318-1-p3987\',', '\'44\',', '\'35.77\',', '\'35.77\',', '\'KUCHNIA &amp; JADALNIA/Zastawa stołowa/Talerze\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Talerz-z-nadrukiem-Tapas-Ladelle-niebieski-LD-61318-1_[8372]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Talerz-z-nadrukiem-Tapas-Ladelle-niebieski-LD-61318-1_[9339]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Talerz-z-nadrukiem-Tapas-Ladelle-niebieski-LD-61318-1_[9340]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Talerz-z-nadrukiem-Tapas-Ladelle-niebieski-LD-61318-1_[9341]_1200.jpg",