	(881, '\'Tarka 15x25,5 cm Koziol KANT szara KZ-3087632\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3087632\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp;Tarka do warzyw i owoców niemieckiej marki Koziol. Podwójny uchwyt powoduje, że można ją trzymać bardziej pewnie i stabilnie. Wykonana z wysokiej jakości tworzywa sztucznego. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">KAnt</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 25,5 cm<br class="def">\ndługość - 15 cm<br class="def">\nszerokość - 6,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Tarka-15x25-5-cm-Koziol-KANT-szara-KZ-3087632-p4138\',', '\'76\',', '\'61.79\',', '\'61.79\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Tarki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Tarka-15x25-5-cm-Koziol-KANT-szara-KZ-3087632_[10132]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Tarka-15x25-5-cm-Koziol-KANT-szara-KZ-3087632_[10133]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Tarka-15x25-5-cm-Koziol-KANT-szara-KZ-3087632_[10134]_1200.jpg"}\''),
	(882, '\'Tarka do sera 9,9x15,3x6,6 cm Koziol KASIMIR kobaltowa KZ-3079585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3079585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp; Tarka kuchenna Kasimir wspaniale nadaje się do tarcia niewielkich składników takich jak np. czekolada, imbir, skórki cytrusów, ser.&nbsp; Pomysłowy design uczyni ja prawdziwą ozdobą stołu, dzięki czemu każdy z domowników lub gości będzie chciał własnoręcznie doprawić lub udekorować swoją potrawę z pomocą tarki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Kasimir</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,6 cm<br class="def">\ndługość - 15,6 cm<br class="def">\nszerokość - 10 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-kobaltowa-KZ-3079585-p4581\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Tarki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-kobaltowa-KZ-3079585_[11759]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-kobaltowa-KZ-3079585_[11760]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-kobaltowa-KZ-3079585_[11761]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-kobaltowa-KZ-3079585_[11762]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-kobal