	(883, '\'Tarka do sera 9,9x15,3x6,6 cm Koziol KASIMIR pastelowy róż KZ-3079638\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3079638\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp; Tarka kuchenna Kasimir wspaniale nadaje się do tarcia niewielkich składników takich jak np. czekolada, imbir, skórki cytrusów, ser.&nbsp; Pomysłowy design uczyni ja prawdziwą ozdobą stołu, dzięki czemu każdy z domowników lub gości będzie chciał własnoręcznie doprawić lub udekorować swoją potrawę z pomocą tarki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Kasimir</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,6 cm<br class="def">\ndługość - 15,6 cm<br class="def">\nszerokość - 10 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-pastelowy-roz-KZ-3079638-p4582\',', '\'46\',', '\'37.4\',', '\'37.4\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Tarki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-pastelowy-roz-KZ-3079638_[11764]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-pastelowy-roz-KZ-3079638_[11765]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-pastelowy-roz-KZ-3079638_[11766]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-pastelowy-roz-KZ-3079638_[11767]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Tarka-do-sera-9-9x15-3x6-6-cm-Koziol-KASIMIR-pastelowy-roz-KZ-3079638_[11768]_1200.jpg"}\''),
	(884, '\'Tarka do sera Forme Casa biała FC-12045611\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-12045611\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Gratka dla wielbicieli włoskiej kuchni i serów. Tarki do sera marki Forme Casa została precyzyjnie zaprojektowana. Ma poręczny kształt dlatego łatwo się ja trzyma podczas czynności ścierania.&nbsp; Wyposażona w wygodny uchwyt do łatwego przenoszenia. Posiada szeroki rant pozwalający na stabilne oparcie na blacie lub miseczce do której będą od razu wpadać kawałki produktu. Może również służyć jako tarka do czekolady, ciasta oraz innych produktów, które trzeba rozdrobnić. \nMarka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 4,5 cm<br class="def">\nszerokość - 30,5 cm<br class="def">\ngłębokość - 14,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Tarka-do-sera-Forme-Casa-biala-FC-12045611-p4109\',', '\'79\',', '\'64.23\',', '\'64.23\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Tarki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Tarka-do-sera-Forme-Casa-biala-FC-12045611_[9959]_1200.jpg"}\''),
	(885, '\'Torba 32,7x13x38,6 cm Koziol TASCHELINO kobaltowa KZ-5411585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5411585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Torebka Tasche marki Kozla to doskonałe rozwiązanie dla osób ceniących sobie porządek, dobrą organizację i ekologię. Torba nada się jako: \n- torba zakupowa wielokrotnego użytku, \n- organizery do przechowywania gadżetów,&nbsp; drobnych rzeczy, długopisów, akcesoriów biurowych, kosmetyków, zabawek, gazet. \n- oryginalna torba prezentowa, \n- koszyk na wakacyjne wypady na plaże, \n- koszyk piknikowy, \n- bądź doniczka do zasadzenia żywych kwiatów. \nTak wiele zastosowań czyni z niej prawdziwą torebeczkę wielofunkcyjną. Praktyczne, długie uchwyty pomagają w noszeniu torby na ramieniu oraz wieszaniu na haczyku, wieszaku, krześle. A Ty jak wykorzystasz swoją torbę Tasche? \nProdukt jest dostępny w trzech rozmiarach: małym (Taschelini), średnim (Taschelino), dużym (Tasche XL). \nProdukt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Taschelino</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 38,6 cm<br class="def">\ndługość - 13 cm<br class="def">\nszerokość - 32,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Torba-32-7x13x38-6-cm-Koziol-TASCHELINO-kobaltowa-KZ-5411585-p4761\',', '\'50\',', '\'40.65\',', '\'40.65\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Pudełka i organizery\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Torba-32-7x13x38-6-cm-Koziol-TASCHELINO-kobaltowa-KZ-5411585_[12223]_1200.jpg","1":"http:\\/\\/wetro.