	(899, '\'Torebeczka wielofunkcyjna na kubek 2 szt. Koziol LILLI kobaltowa KZ-3558585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3558585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'&nbsp; Oryginalna propozycja od Kozla dla ludzi lubiących nowości, ciekawostki oraz niebanalne rozwiązania, które zaskakują. Wielofunkcyjna torebka na kubek prezentuje się świetnie i ciekawie. Ma także inne zalety: nadaje się na ulokowanie małych&nbsp;przekąsek, ciasteczek do herbaty, a także jako elegancki pojemniczek na torebkę&nbsp;zaparzonej herbaty. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Lilli</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6,6 cm<br class="def">\ndługość - 6,2 cm<br class="def">\nszerokość - 3 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Torebeczka-wielofunkcyjna-na-kubek-2-szt-Koziol-LILLI-kobaltowa-KZ-3558585-p4591\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Torebeczka-wielofunkcyjna-na-kubek-2-szt-Koziol-LILLI-kobaltowa-KZ-3558585_[11799]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Torebeczka-wielofunkcyjna-na-kubek-2-szt-Koziol-LILLI-kobaltowa-KZ-3558585_[11800]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Torebeczka-wielofunkcyjna-na-kubek-2-szt-Koziol-LILLI-kobaltowa-KZ-3558585_[11801]_1200.jpg"}\''),
