	(904, '\'Uchwyt na papier toaletowy 14,4x19,2 cm Koziol TOQ kobaltowy KZ-5234585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5234585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zobaczcie, jak w humorystyczny sposób można urządzić przestrzeń łazienki z kolekcją TOQ. Niesamowita kolekcja z marsjaninem to jeden z najlepszych produktów marki Koziol.&nbsp; Przedstawiony tu uchwyt na papier toaletowy jest jednym z produktów kolekcji TOQ. Wieszak imitujący przybysza z innej planety stanowić będzie intrygujący element wyposażenia łazienki. Prezentuje się on interesująco. Razem z pozostałymi produktami z serii Toq z pewnością stworzy kosmiczny klimat. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">TOQ</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 19,2<br class="def">\nszerokość - 14,4</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Uchwyt-na-papier-toaletowy-14-4x19-2-cm-Koziol-TOQ-kobaltowy-KZ-5234585-p4865\',', '\'97\',', '\'78.86\',', '\'78.86\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki i stojaki na papier toaletowy\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Uchwyt-na-papier-toaletowy-14-4x19-2-cm-Koziol-TOQ-kobaltowy-KZ-5234585_[12337]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Uchwyt-na-papier-toaletowy-14-4x19-2-cm-Koziol-TOQ-kobaltowy-KZ-5234585_[12940]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Uchwyt-na-papier-toaletowy-14-4x19-2-cm-Koziol-TOQ-kobaltowy-KZ-5234585_[12941]_1200.jpg"}\''),
