	(906, '\'Uchwyt na szczoteczkę do zębów 3 szt. Koziol TOMMY KZ-5826459\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5826459\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zabawny uchwyt na szczoteczkę do zębów niemieckiej marki Koziol. Wykonany z wysokiej jakości tworzywa sztucznego, wprowadzi odrobinę humoru do każdej łazienki. Produkt posiada uniwersalną przyssawkę, dzięki której w łatwy sposób można ją zamontować i w każdej chwili zmienić miejsce jej przytwierdzenia. Zestaw zawiera 3szt. uchwytów. Produkt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tommy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5,7 cm<br class="def">\ndługość - 4,7 cm<br class="def">\nszerokość - 3,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny, przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Uchwyt-na-szczoteczke-do-zebow-3-szt-Koziol-TOMMY-KZ-5826459-p4596\',', '\'67\',', '\'54.47\',', '\'54.47\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Uchwyt-na-szczoteczke-do-zebow-3-szt-Koziol-TOMMY-KZ-5826459_[11814]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Uchwyt-na-szczoteczke-do-zebow-3-szt-Koziol-TOMMY-KZ-5826459_[11815]_1200.jpg"}\''),
