	(923, '\'Wałek uszczelniający na okno Ladelle szary LD-69024\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-69024\',', 0, '\'Ladelle\',', NULL, 0, NULL, NULL, '\'.\',', '\'Wałek uszczelniający to designerski gadżet służący do uszczelniania okien, drzwi zarówno w domu jak i samochodzie w celu zabezpieczenia przed niepożądanym zimnem, ciepłem, hałasem. Idealny podczas przeciągów, nieszczelności okien, drzwi. Szczególnie przydatny w okresie jesiennym, zimowym, gdy na zewnątrz deszcz i śnieg, a wieczory długie i chłodne. \n Sprawdzi się także jako ozdobna (oryginalna) poduszka na sofę, łóżko, taras czy werandę. \n Wałek jest długi 20 cm wykonany z bawełny , wypełniony poliestrem i piaskiem. Starannie wykończony delikatnym wzorem, małych równoległoboków w kolorze szarym oddzielonych białymi paskami. \n Dostępny w wielu kolorach (niebieskim, czerwonym, szarym, czarnym), aby pasował do każdego domu. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 20 cm<br class="def">\nszerokość - 6,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, szary</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">bawełna , piasek, poliester</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Walek-uszczelniajacy-na-okno-Ladelle-szary-LD-69024-p3817\',', '\'79\',', '\'64.23\',', '\'64.23\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Wałki uszczelniające\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Walek-uszczelniajacy-na-okno-Ladelle-szary-LD-69024_[8062]_1200.jpg"}\''),
