	(939, '\'Widelczyki do przekąsek na stojaku Koziol PIC UP kolorowe KZ-3120100\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3120100\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw 8 szt. widelczyków do przekąsek z kolekcji PIC UP&nbsp; to rarytas dla poszukiwaczy dobrego designu. Widelczyki są lekkie i kolorowe. Sprawdzą się zarówno podczas domowych eventów jak również imprez organizowanych na świeżym powietrzy w ogrodzie, tarasie, parku. Znacznie ułatwiają swoją obecności sięganie po małe przekąski i finezyjnie dekorują stół.&nbsp; Dodatkowo jak nie będą używane można je odłożyć do stojak w kształcie doniczki, dzięki czemu razem wyglądają jak wielokolorowy, egzotyczny kwiatek. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Pic up</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 18,2 cm<br class="def">\ndługość - 7,5 cm<br class="def">\nszerokość - 7,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">wielokolorowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Widelczyki-do-przekasek-na-stojaku-Koziol-PIC-UP-kolorowe-KZ-3120100-p4624\',', '\'86\',', '\'69.92\',', '\'69.92\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Akcesoria do przekąsek\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Widelczyki-do-przekasek-na-stojaku-Koziol-PIC-UP-kolorowe-KZ-3120100_[11893]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Widelczyki-do-przekasek-na-stojaku-Koziol-PIC-UP-kolorowe-KZ-3120100_[11894]_1200.jpg"}\''),
	(940, '\'Wieszak Koziol MIAOU biały KZ-3905525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3905525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kotek w łazience&nbsp;to zazwyczaj problem, ale nie z kotkiem Miaou z którym powstała cała seria różnych produktów, akcesoriów łazienkowych. Zabawny wieszak na ręcznik łazienkowy Miaou w kształcie sympatycznego kotka. Mocowany w łatwy sposób za pomocą dwustronnej taśmy. Sprawdzi się zarówno w łazience do zawieszania na ręczniki, szlafroki, a także w kuchni do wieszania ściereczek. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7,9 cm<br class="def">\ndługość - 8,4 cm<br class="def">\nszerokość - 2,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-Koziol-MIAOU-bialy-KZ-3905525-p4625\',', '\'29\',', '\'23.58\',', '\'23.58\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-MIAOU-bialy-KZ-3905525_[11895]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-MIAOU-bialy-KZ-3905525_[11896]_1200.jpg"}\''),
