	(943, '\'Wieszak Koziol SPOT antracytowy KZ-5679540\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5679540\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Wieszak Spot wydaje się zwykły, banalny ponieważ jest okrągły i ma prostą formę, ale tak nie jest. Jest duży, ma lekko pofalowaną powierzchnię i mieniące się wykończenie. Zamontowany w większej ilości tworzy wspaniałą dekorację, która wywiera zachwyt na osobach podziwiajacych. Do tego jest niezwykle funkcjonalny. Można na nim zawiesić ręczniki, paski, płaszcze, a nawet zabawki np. Skakankę. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Spot</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7 cm<br class="def">\ndługość - 12,2 cm<br class="def">\nszerokość - 12,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-Koziol-SPOT-antracytowy-KZ-5679540-p4628\',', '\'59\',', '\'47.97\',', '\'47.97\',', '\'DEKORACJE &amp; AKCESORIA/Dekoracje tematyczne/Dekoracje do pokoju dziecka\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-SPOT-antracytowy-KZ-5679540_[11900]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-SPOT-antracytowy-KZ-5679540_[11901]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-SPOT-antracytowy-KZ-5679540_[11902]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-SPOT-antracytowy-KZ-5679540_[11903]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-Koziol-SPOT-antracytowy-KZ-5679540_[11904]_1200.jpg"}\''),
