	(947, '\'Wieszak na apaszki i akcesoria 44,90 cm Koziol DW IT BAG miedziany KZ-5688622\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5688622\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Apaszki, chustki, chusteczki, szaliki, szaliczki i czapeczki lubią zalegać na dnie każdej szafeczki :) Marka Koziol ma na to radę! Wieszak na szaliki i akcesoria It Bag pozwoli zrobić porządek ze wszystkimi dodatkami tego typu dzięki prostej, a jednocześnie pomysłowej konstrukcji. Wykonany z tworzywa wieszak ma kształt niesymetrycznej sieci, na okach której przewiesić można apaszki i szaliki, które od tej pory będą zawsze na widoku, po ręką i w wyjątkowo dobrej kondycji. Dostępne kolory, łatwy montaż na drążku w dowolnej szafie lub na haczyku to dodatkowe atuty produktu. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">It Bag</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 44,90 cm<br class="def">\nszerokość - 31,50 cm<br class="def">\ngłębokość - 2,90 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-na-apaszki-i-akcesoria-44-90-cm-Koziol-DW-IT-BAG-miedziany-KZ-5688622-p2841\',', '\'55\',', '\'44.72\',', '\'44.72\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE GARDEROBY/Wieszaki na ubrania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/5000-6000\\/Wieszak-na-apaszki-i-akcesoria-miedziany-KZ-5688622_[5734]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/17000-18000\\/Wieszak-na-apaszki-i-akcesoria-44-90-cm-Koziol-IT-BAG-miedziany-KZ-5688622_[17911]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/17000-18000\\/Wieszak-na-apaszki-i-akcesoria-44-90-cm-Koziol-IT-BAG-miedziany-KZ-5688622_[17912]_1200.jpg"}\''),
