	(950, '\'Wieszak na drzwi Koziol MIAOU biały KZ-4110525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-4110525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Kotek w łazienece to zazwyczaj problem, ale nie z kotkiem Miaou z którym powstała cała seria różnych produktów, akcesoriów łazienkowych. Zabawny wieszak na ręcznik łazienkowy Miaou w kształcie sympatycznego kotka. Mocowany w łatwy sposób za pomocą dwustronnej taśmy. Sprawdzi się zarówno w łazience do zawieszania na ręczniki, szlafroki, a także w kuchni do wieszania ściereczek. Wieszak wykonany z wysokiej jakości tworzywa sztucznego.&nbsp; Przystosowany do zawieszania na drzwiach dzięki specjalnemu zakrzywionemu uchwytowi. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 12,6 cm<br class="def">\ndługość - 8,4 cm<br class="def">\nszerokość - 6,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-na-drzwi-Koziol-MIAOU-bialy-KZ-4110525-p4642\',', '\'38\',', '\'30.89\',', '\'30.89\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-na-drzwi-Koziol-MIAOU-bialy-KZ-4110525_[11952]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-na-drzwi-Koziol-MIAOU-bialy-KZ-4110525_[11953]_1200.jpg"}\''),
