	(967, '\'Wieszak na ręcznik Koziol PI:P kobaltowy KZ-3903645\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3903645\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Wesoły akcent od marki Koziol, w praktycznej funkcji wieszaka sprawdzi się zarówno w łazience jak i w kuchni. Można zawiesić na nim niewielki recznik lub kuchenną ściereczkę. Mocowany jest na przyssawce więc można ulokować go w wygodnym miejscu bez ingerowania w powierzchnię mebli. Ponadto, jeśli zajdzie taka potrzeba, można zmienić jego miejsce, łatwo i szybko. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">PI:P</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5,8 cm<br class="def">\nszerokość - 8,5 cm<br class="def">\ngłębokość - 4,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-na-recznik-Koziol-PI-P-kobaltowy-KZ-3903645-p4873\',', '\'29\',', '\'23.58\',', '\'23.58\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Wieszak-na-recznik-Koziol-PI-P-kobaltowy-KZ-3903645_[12345]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Wieszak-na-recznik-Koziol-PI-P-kobaltowy-KZ-3903645_[12962]_1200.jpg"}\''),
