	(969, '\'Wieszak na ręcznik Koziol PI:P pastelowy róż KZ-3903638\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3903638\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Wesoły akcent od marki Koziol, w praktycznej funkcji wieszaka sprawdzi się zarówno w łazience jak i w kuchni. Można zawiesić na nim niewielki ręcznik&nbsp;lub kuchenną ściereczkę. Mocowany jest na przyssawce więc można ulokować go w wygodnym miejscu bez ingerowania w powierzchnię mebli. Ponadto, jeśli zajdzie taka potrzeba, można zmienić jego miejsce, łatwo i szybko. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">PI:P</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5,8 cm<br class="def">\nszerokość - 8,5 cm<br class="def">\ngłębokość - 4,4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-na-recznik-Koziol-PI-P-pastelowy-roz-KZ-3903638-p4657\',', '\'29\',', '\'23.58\',', '\'23.58\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-na-recznik-Koziol-PI-P-pastelowy-roz-KZ-3903638_[11976]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Wieszak-na-recznik-Koziol-PI-P-pastelowy-roz-KZ-3903638_[12963]_1200.jpg"}\''),
	(970, '\'Wieszak na ręczniki Koziol SVEN kobaltowy KZ-3902645\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3902645\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Wieszak łazienkowy dwuramienny z łatwością utrzyma dwa ręczniki. Jest praktyczny i jednocześnie pełni funkcję dekoracyjną. Łoś Sven to fantastyczny, zabawny element jaki doda trochę radości każdej łazience. Mocowany jest na przyssawkach więc nie wymaga wiercenia w ścianie. Łatwo go zamontować a także, w razie potrzeby, przemieścić. \n \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Sven</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6 cm<br class="def">\nszerokość - 15,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-na-reczniki-Koziol-SVEN-kobaltowy-KZ-3902645-p5227\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Wieszak-na-reczniki-Koziol-SVEN-kobaltowy-KZ-3902645_[14353]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Wieszak-na-reczniki-Koziol-SVEN-kobaltowy-KZ-3902645_[14354]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Wieszak-na-reczniki-Koziol-SVEN-kobaltowy-KZ-3902645_[14355]_1200.jpg"}\''),
