	(987, '\'Wieszak łazienkowy Koziol SVEN mietowy KZ-3902634\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3902634\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Wieszak łazienkowy dwuramienny z łatwością utrzyma dwa ręczniki. Jest praktyczny i jednocześnie pełni funkcję dekoracyjną. Łoś Sven to fantastyczny, zabawny element jaki doda trochę radości każdej łazience. Mocowany jest na przyssawkach więc nie wymaga wiercenia w ścianie. Łatwo go zamontować a także, w razie potrzeby, przemieścić. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Sven</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 6 cm<br class="def">\ndługość - 15,5 cm<br class="def">\nszerokość - 4,3cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">zielony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wieszak-lazienkowy-Koziol-SVEN-mietowy-KZ-3902634-p4638\',', '\'42\',', '\'34.15\',', '\'34.15\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-lazienkowy-Koziol-SVEN-mietowy-KZ-3902634_[11937]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-lazienkowy-Koziol-SVEN-mietowy-KZ-3902634_[11938]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-lazienkowy-Koziol-SVEN-mietowy-KZ-3902634_[11939]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/11000-12000\\/Wieszak-lazienkowy-Koziol-SVEN-mietowy-KZ-3902634_[11940]_1200.jpg"}\''),
