	(993, '\'Wkład do szuflady na sztućce 21x32 cm Koziol RIO kobaltowy KZ-5210585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5210585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Praktyczny wkład do szuflady. Poszukiwane sztućce już zawsze będą pod ręką w estetycznym pudełku. Wkład jest prostokątny w wymiarze 32x21x4,6 cm, a więc jest bardzo pojemny. Posiada trzy nieprzedzielone do końca przegródki na łyżki, widelce i noże, z dodatkowym miejscem na dole na łyżeczki. Wykonany z wysokiej jakości tworzywa sztucznego, a więc jest lekki, poręczny i odporny na uszkodzenia. \nProdukt dostępny w kilku wariantach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Rio</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 4,6 cm<br class="def">\ndługość - 32 cm<br class="def">\nszerokość - 21 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wklad-do-szuflady-na-sztucce-21x32-cm-Koziol-RIO-kobaltowy-KZ-5210585-p4874\',', '\'38\',', '\'30.89\',', '\'30.89\',', '\'KUCHNIA &amp; JADALNIA/Organizacja kuchni/Wkłady do szuflad\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Wklad-do-szuflady-na-sztucce-21x32-cm-Koziol-RIO-kobaltowy-KZ-5210585_[12346]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Wklad-do-szuflady-na-sztucce-21x32-cm-Koziol-RIO-kobaltowy-KZ-5210585_[12966]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Wklad-do-szuflady-na-sztucce-21x32-cm-Koziol-RIO-kobaltowy-KZ-5210585_[12967]_1200.jpg"}\''),
