	(1001, '\'Wyciskacz do cytryn Koziol JUICY biały KZ-3732525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3732525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Wyciskacz do cytryn niemieckiej marki Koziol. Jest to praktyczne akcesorium, które znajdzie zastosowanie w każdej kuchni. Niezależnie od tego, czy potrzebujesz wycisnąć sok do herbaty, sałatki czy innej potrawy, z wyciskaczem Juicy stanie się to bardzo wygodne. Wystarczy wbić dziubek w owoc, a sok będzie spływał po listku dokładnie w to miejsce, w które potrzebujesz. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Juicy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 10,5 cm<br class="def">\nszerokość - 7,4 cm<br class="def">\ngłębokość - 6 cm </strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">Tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Wyciskacz-do-cytryn-Koziol-JUICY-bialy-KZ-3732525-p2854\',', '\'30\',', '\'24.39\',', '\'24.39\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Wyciskacze do cytrusów\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/5000-6000\\/Wyciskacz-do-cytryn-bialy-Juicy-KZ-3732525_[5752]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/5000-6000\\/Wyciskacz-do-cytryn-bialy-Juicy-KZ-3732525_[5753]_1200.jpg"}\''),
