	(1012, '\'Wypiekacz do chleba 1600W Tefal Bread of the World czarny PF611838\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'PF611838\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'\n<p style="margin: 0px; padding: 0px 0px 10px; font-family: Tahoma, Arial, Helvetica; font-size: 12px;" class="def">Wypiekacz do chleba Bread of the World renomowanej marki Tefal. Jest to wyjątkowe i praktyczne urządzenie! Dzięki niemu będziesz cieszył się smakiem prawdziwego, domowego pieczywa! Zrób sam i bez trudu: chleb, bagietki i bułeczi, makaron, ciasto drożdżowe, ciasto do pizzy i wiele innych. Ciepłe pieczywo o poranku bez wychodzenia z domu. Wypiekacz Bread of the world posiada aż 19 automatycznych wbudowanych programów: 8 do pieczenia chleba, 7 do pieczenia bagietek i bułeczek, 1 program do wyrabiania ciasta na makaron, 1 do ciasta drożdżowego, 1 do ciasta do pizzy oraz 1 do robienia dżemu. Ponadto producent pomyślał także o alergikach i osobach na dziecie! Istnieje możliwość wybrania programu bezglutenowego. Zaletą dlaprawdziwych smakoszy będzie także możliwosć wyboru jednego z trzech poziomów przyrumienienia skórki (lekko/średnio/mocno opieczona). Ten model wypiekacza posiada wyjątkowo dużą pojemność - nawet do 1,5 kg. Pozwoli to wypiekać chleb dla całej rodziny nie tylko na jeden dzień. Pieczywo zrobione w domu dłużej pozostaje świeże i smaczne niż kupione w sklepie.&nbsp;<br class="def">\n<br class="def">\nKażdy poradzi sobie z wypiekiem domowego chleba. Dodatkowo zachowasz czystość w kuchni. Wypiekacz posiada łatwy w obsłudze panel sterowania. Obsługę ułatwia wyświetlacz LCD, na którym można odczytać wszystkie parametry i ustawienia. Wbudowane w pokrywę okienko, pozwala cały czas kontrolować stan wypieku.&nbsp;<br class="def">\n&nbsp;<br class="def">\nDo wypiekacza dołączane są następujące akcesoria:<br class="def">\n- Ostry nożyk do robienia nacięć na cieście<br class="def">\n- Miarka równą łyżce do zupy&nbsp;<br class="def">\n- Miarka równa łyżeczce do herbaty<br class="def">\n- Pędzelek<br class="def">\n- Kubek z podziałką<br class="def">\n- Haczyk do wyciągania mieszadeł<br class="def">\n<br class="def">\nW zestawie znajdują się cztery foremki pokryte powłoką nieprzywierającą w tym:<br class="def">\n- 2 szt do bagietek<br class="def">\n- 2 szt foremek płaskich</p>\n<p style="margin: 0px; padding: 0px 0px 10px; font-family: Tahoma, Arial, Helvetica; font-size: 12px;" class="def">W zestawie także:&nbsp;<br class="def">\n- mieszadła do wyrabiania ciasta (2 szt),&nbsp;<br class="def">\n- wyjmowana misa&nbsp;<br class="def">\n- szczegółowa instrukcja obsługi wraz z podstawowymi PRZEPISAMI.<br class="def">\n<br class="def">\n19 dostępnych programów wypiekania:<br class="def">\nBagietka<br class="def">\nCiabatta<br class="def">\nGressin<br class="def">\nChleb płaski<br class="def">\nSandwich<br class="def">\nSłodka bułeczka<br class="def">\nPieczenie małych bułeczek<br class="def">\nChleb podstawowy<br class="def">\nChleb francuski<br class="def">\nChleb pełnoziarnisty<br class="def">\nChleb słodki<br class="def">\nChleb szybki<br class="def">\nChleb bezglutenowy<br class="def">\nChleb bez soli<br class="def">\nPieczenie chleba<br class="def">\nCiasto na pizze<br class="def">\nCiasto na makaron<br class="def">\nCiasto<br class="def">\nKonfitury</p>\n<p style="margin: 0px; padding: 0px 0px 10px; font-family: Tahoma, Arial, Helvetica; font-size: 12px;" class="def">&nbsp;</p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">Moc:&nbsp;1600 W</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">Liczba programów:&nbsp;</span><span style="font-size: 12px;" class="def">19</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">Utrzymanie temperatury:&nbsp;</span><span style="font-size: 12px;" class="def">1 godzina</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">Opóźniony start:&nbsp;</span><span style="font-size: 12px;" class="def">do 15 godzin</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">Pojemność max:&nbsp;</span><span style="font-size: 12px;" class="def">1,5 kg</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-size: 12px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def">3 ustawienia wagi:&nbsp;</span></span><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">750 g, 1000 g, 1500 g</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-size: 12px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def">3 poziomy opiekania skórki:&nbsp;&nbsp;</span></span><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def">lekko/średnio/mocno opieczona</span></span></p>\n<p style="margin: 0px; padding: 0px 0px 10px;" class="def"><span style="font-family: Tahoma, Arial, Helvetica;" class="def"><span style="font-size: 12px;" class="def"><br class="def">\n</span></span></p>\n<p class="def"><span style="font-family: Tahoma, Arial, Helvetica; font-size: 12px;" class="def"><img height="695" width="695" src="http://wetro.pl/images/wetrosklep/18000-19000/Wypiekacz-do-chleba-1600W-Tefal-Bread-of-the-World-czarny-PF611838_[18061]_695.jpg" alt="image" class="def"><br class="def">\n </span></p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, N