	(1023, '\'Zaparzaczka do herbaty kotek Koziol MIAOU kobaltowa KZ-3236585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3236585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Lubisz spędzać długie, zimowe wieczory z kubkiem gorącej herbaty? Z zaparzaczką MIAOU herbata zawsze wyjdzie wybornie \nZaparzaczkę wiesza się na brzegu kubka za pomocą głowy kotka, a następnie umieszcza się herbatę w koszyku pełniącym rolę filtru i zalewa się ją wrzątkiem. Do pojemniczka można wsypywać herbatę, kawę&nbsp; lub umieszczać w nim konfitury, cytrynę. Wykonana z najwyższej jakości tworzywa sztucznego. Zaparzaczka do herbaty marki Koziol to świetny pomysł na prezent dla miłośników aromatycznej herbaty oraz fanów kotków. Produkt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7,80 cm<br class="def">\nszerokość - 7,70 cm<br class="def">\ngłębokość - 6,40 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zaparzaczka-do-herbaty-kotek-Koziol-MIAOU-kobaltowa-KZ-3236585-p4681\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-kotek-Koziol-MIAOU-kobaltowa-KZ-3236585_[12048]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-kotek-Koziol-MIAOU-kobaltowa-KZ-3236585_[12049]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-kotek-Koziol-MIAOU-kobaltowa-KZ-32365