	(1030, '\'Zaparzaczka do herbaty Koziol RUDOLF biała kz-3233010\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'kz-3233010\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Lubisz spędzać długie, zimowe wieczory z kubkiem gorącej herbaty? Z zaparzaczką Rudolf herbata zawsze wyjdzie wybornie. Zaparzaczkę wiesza się na brzegu kubka za pomocą głowy Renifera, a następnie umieszcza się herbatę w koszyku pełniącym rolę filtru i zalewa się ją wrzątkiem. Do pojemniczka można wsypywać herbatę, kawę&nbsp; lub umieszczać w nim konfitury, cytrynę. Wykonana z najwyższej jakości tworzywa sztucznego. Renifer świetnie wpasuje się w wesoły nastrój Świąt. \nZaparzaczka do herbaty marki Koziol to świetny pomysł na prezent dla miłośników aromatycznej herbaty oraz zwierząt. \nPoglądy marki Koziol najlepiej oddaje slogan Art At Work. Wszystkie produkty tej marki to małe dzieła sztuki projektowane tak aby spełniały swoją funkcję użytkową, a zarazem wprowadzały odrobinę humoru i ciekawego designu do wnętrza. Dzięki marce Koziol zwykłe przedmioty kuchenne i łazienkowe codziennego użytku stają się niezwykłe. \nProdukt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Rudolf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9 cm<br class="def">\ndługość - 6,6 cm<br class="def">\nszerokość - 7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zaparzaczka-do-herbaty-Koziol-RUDOLF-biala-kz-3233010-p4687\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/