	(1034, '\'Zaparzaczka do herbaty Koziol SUSI malinowa KZ-3237583\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3237583\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Lubisz spędzać długie, zimowe wieczory z kubkiem gorącej herbaty? Z zaparzaczką SUSI herbata zawsze wyjdzie wybornie \nZaparzaczkę wiesza się na brzegu kubka za pomocą serduszka, a następnie umieszcza się herbatę w koszyku pełniącym rolę filtru i zalewa się ją wrzątkiem. Do pojemniczka można wsypywać herbatę, kawę&nbsp; lub umieszczać w nim konfitury, cytrynę. Wykonana z najwyższej jakości tworzywa sztucznego. Zaparzaczka do herbaty marki Koziol to świetny pomysł na prezent dla miłośników aromatycznej, świeżo parzonej herbaty. Produkt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Susi</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 7,8 cm<br class="def">\ndługość - 6,7 cm<br class="def">\nszerokość - 6,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czerwony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zaparzaczka-do-herbaty-Koziol-SUSI-malinowa-KZ-3237583-p4691\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-Koziol-SUSI-malinowa-KZ-3237583_[12089]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-Koziol-SUSI-malinowa-KZ-3237583_[12090]_1200.jpg"}\''),
	(1035, '\'Zaparzaczka do herbaty renifer Koziol RUDOLF pastelowy róż KZ-3233638\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3233638\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Lubisz spędzać długie, zimowe wieczory z kubkiem gorącej herbaty? Z zaparzaczką Rudolf herbata zawsze wyjdzie wybornie. Zaparzaczkę wiesza się na brzegu kubka za pomocą głowy Renifera, a następnie umieszcza się herbatę w koszyku pełniącym rolę filtru i zalewa się ją wrzątkiem. Do pojemniczka można wsypywać herbatę, kawę&nbsp; lub umieszczać w nim konfitury, cytrynę. Wykonana z najwyższej jakości tworzywa sztucznego. Renifer świetnie wpasuje się w wesoły nastrój Świąt. \nZaparzaczka do herbaty marki Koziol to świetny pomysł na prezent dla miłośników aromatycznej herbaty oraz zwierząt. Produkt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Rudolf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9 cm<br class="def">\ndługość - 7,3 cm<br class="def">\nszerokość - 6,6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zaparzaczka-do-herbaty-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3233638-p4768\',', '\'25\',', '\'20.33\',', '\'20.33\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3233638_[12234]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zaparzaczka-do-herbaty-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3233638_[12235]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/1