	(1036, '\'Zapasowa końcówka do szczotki Koziol Toq/Mary Loo KZ-5012999\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5012999\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zapasowa końcówka do szczotek Toq i Mary Loo niemieckiej marki Koziol. Wymienna końcówka pozwala zachować czystość i higienę w łazience, bez konieczności wymiany całego akcesorium. Montowana poprzez wkręcenie, pozwala na szybką wymianę zużytej części. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 10 cm<br class="def">\nśrednica - 8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">Tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zapasowa-koncowka-do-szczotki-Koziol-Toq-Mary-Loo-KZ-5012999-p4692\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Szczotki do WC\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zapasowa-koncowka-do-szczotki-ToqMary-Loo-do-wyczerpania-zapasow-KZ-5012999_[12091]_1200.jpg"}\''),
	(1037, '\'Zapasowa szczotka do WC uniwersalna Koziol KZ-5012998\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5012998\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zapasowa końcówka do szczotek MIAOU, SENSE oraz RIO niemieckiej marki Koziol. Wymienna końcówka pozwala zachować czystość i higienę w łazience, bez konieczności wymiany całego akcesorium. Montowana poprzez wkręcenie, pozwala na szybką wymianę zużytej części. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9,3 cm<br class="def">\ndługość - 7,7 cm<br class="def">\nszerokość - 7,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zapasowa-szczotka-do-WC-uniwersalna-Koziol-KZ-5012998-p4693\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Szczotki do WC\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zapasowa-szczotka-do-WC-uniwersalna-KZ-5012998_[12093]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zapasowa-szczotka-do-WC-uniwersalna-KZ-5012998_[12092]_1200.jpg"}\''),
	(1038, '\'Zapinki do organizacji przypraw 12 szt. Jolko JO-2805060\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'JO-2805060\',', 0, '\'Jolko\',', NULL, 0, NULL, NULL, NULL, '\'Zapinki do przypraw, ziół, opakowań są przydatne w każdej kuchni. \nZapinki Jolko znalazły swoje uznanie wśród licznego grona Klientów. Dzięki swej prostocie montażu i użycia doskonale sprawdzają się w każdej kuchni. Wystarczy wyjąc zapinkę z opakowania, nakleić na niej wybraną nazwę i przyłożyć do opakowania i kliknąć. \nZapinki można wykorzystywać również w biurze np. do spinania dokumentów. \nZalety zapinek do organizacji: \n segregują i pozwalają na szybkie odszukanie produktów, \n łatwe w użyciu \n zabezpieczają przyprawy przed utratą świeżości i rozsypaniem \n \nZestaw zawiera: \n 12 zapinek (kolor kremowy) \n 16 gotowych samoprzylepnych etykiet (pieprz ziołowy, papryka ostra, czosnek granulowany, bazylia, kolendra, lubczyk, gorczyca, KEBAB-GYROS, pieprz cytrynowy, przyprawa do kurczaka, przyprawa do gulaszu, pietruszka) \n 4 puste etykiety do wpisania dowolnej nazwy. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def"><strong class="def">pojedyncza zapinka:</strong><br class="def">\nwysokość - 1,9 cm<br class="def">\nszerokość - 4,3 cm<br class="def">\ngłębokość - 0,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zapinki-do-organizacji-przypraw-12-szt-Jolko-JO-2805060-p5657\',', '\'8.99\',', '\'7.31\',', '\'7.31\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Inne akcesoria kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zapinki-do-organizacji-przypraw-12-szt-Jolko-JO-2805060_[18092]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zapinki-do-organizacji-przypraw-12-szt-Jolko-JO-2805060_[18091]_1200.jpg","2":