	(1039, '\'Zawieszenie do lamp Koziol biało-czarne KZ-1994100\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-1994100\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zawieszenie do lamp marki Koziol jest kompatybilne z kloszami/abażurami Josephine, Stella Silk oraz Reed od tego samego producenta. \nZestaw zawieszenia składa się z: \n kabla o długości 2 m \n plastikowej oprawki na żarówkę E27 \n metalowej puszki sufitowej (śr. 11,7 cm, wys. 2,5 cm) \n UWAGA! W skład zestawu nie wchodzi żarówka. \nZawieszenie dostępne jest w pięciu wersjach kolorystycznych: \n biało-czerwone, \n biało-czarne, \n czarne, \n kobaltowe oraz \n biało-różowe. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 200 cm<br class="def">\nśrednica - 11,70 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">metal, plastik termiczny, tworzywo sztuczne</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Moc: max.: 40 Watt\nOprawa: E27\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zawieszenie-do-lamp-Koziol-bialo-czarne-KZ-1994100-p4694\',', '\'125\',', '\'101.63\',', '\'101.63\',', '\'LAMPY &amp; MEBLE/Lampy/Abażury i klosze\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszenie-do-lamp-Koziol-bialo-czarne-KZ-1994100_[12094]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszenie-do-lamp-Koziol-bialo-czarne-KZ-1994100_[12095]_1200.jpg"}\''),
