	(1044, '\'Zawieszka na kubek renifer Koziol RUDOLF czarna KZ-3557526\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3557526\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zawieszka z reniferem Rudolf to propozycja marki Koziol mająca na celu rozwiązanie problemu wykorzystanej torebeczki herbaty. Pojemnik można powiesić za główkę na krawędzi kubka, szklanki lub miseczki i umieścić w nim torebkę z herbatą przed i/lub po zaparzeniu. Zawieszkę można również wykorzystać jako pojemnik na cukier, cytrynę, miód lub słodką przekąskę. Wysokiej jakości tworzywo, z którego znana jest niemiecka firma, stanowi gwarancję jakości produktu. \nProdukt jest dostępny w kilku wersjach kolorystycznych. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Rudolf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9 cm<br class="def">\ndługość - 7cm <br class="def">\nszerokość - 6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-czarna-KZ-3557526-p4699\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-czarna-Koziol-RUDOLF-czarna-KZ-3557526_[12104]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-czarna-Koziol-RUDOLF-czarna-KZ-3557526_[12105]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-czarna-Koziol-RUDOLF-czarna-KZ-3557526_[12106]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-czarna-Koziol-RUDOLF-czarna-KZ-3557526_[12107]_1200.jpg"}\''),
	(1045, '\'Zawieszka na kubek renifer Koziol RUDOLF pastelowy róż KZ-3557638\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3557638\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zawieszka Rudolf to najnowsza propozycja marki Koziol. Pojemnik można powiesić za pyszczek na krawędzi kubka, szklanki lub miseczki i umieścić w nim torebkę z herbatą, torebeczkę cukru lub ciasteczko. &nbsp;Wysokiej jakości tworzywo, z którego znana jest niemiecka firma, stanowi gwarancję jakości produktu. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Rudolf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 9 cm<br class="def">\ndługość - 7 cm<br class="def">\nszerokość - 6 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3557638-p4876\',', '\'21\',', '\'17.07\',', '\'17.07\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Zaparzaczki do herbaty\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3557638_[12348]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3557638_[12986]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3557638_[12987]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3557638_[12988]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zawieszka-na-kubek-renifer-Koziol-RUDOLF-pastelowy-roz-KZ-3557638_[12989]_1200.jpg"}\''),
	(1046, '\'Zegar ścienny 24 cm Koziol PINBALL biały KZ-2341525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2341525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Pinball to zegar wykonany w stylu nowoczesnym, który odnajdzie się szczególnie w salonie, pokoju młodzieżowym, pokoju zabawowym. Zegar wykonany jest z wysokiej jakości tworzywa sztucznego dzięki czemu dodaje on wnętrzu lekkości, a dzięki ciekawej formie&nbsp; odrobinę humoru.&nbsp; Duża tarcza zegara (średnica 24 cm) składa się z 12 wąskich linii zakończonych kulkami z wyciętymi w środku kształtami kolejnych cyfr. Wskazówki są proste, z zaokrąglonymi końcami. W zależności od modelu w kolorze czarnym lub białym. Dzięki pustym przestrzeniom pomiędzy kolejnymi elementami zegar może stapiać się z kolorem ściany lub z nim kontrastować, dając ciekawy efekt \nKażdy zegar pakowany jest w dekoracyjne, kartonowe pudełko z przezroczystą przednią ścianką. Idealne na prezent. \nJeżeli zegar PINBALL&nbsp; nie sprostał Twoim oczekiwaniom, marka Koziol oferuje jeszcze zegar: \n- PIANO (zegar wzorowany klawiaturą fortepianu) \n- TOC TOC (współczesna wersja zegara z kukułką) \n- PI:P (asymetryczny zegar ze zwierzątkami) \n- SILK (proste linie poplątane w kontrolowanym chaosie) \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Pinball</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">szerokość - 24 cm<br class="def">\ngłębokość - 2,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zegar-scienny-24-cm-Koziol-PINBALL-bialy-KZ-2341525-p4064\',', '\'199\',', '\'161.79\',', '\'161.79\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Zegary\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Zegar-scienny-24-cm-Koziol-PINBALL-bialy-KZ-2341525_[9828]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Zegar-scienny-24-cm-Koziol-PINBALL-bialy-KZ-2341525_[9829]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zegar-scienny-24-cm-Koziol-PINBALL-bialy-KZ-2341525_[18821]_1200.jpg"}\''),
	(1047, '\'Zegar ścienny 24 cm Koziol PINBALL czarny KZ-2341526\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2341526\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Pinball to zegar wykonany w stylu nowoczesnym, który odnajdzie się szczególnie w salonie, pokoju młodzieżowym, pokoju zabawowym. Zegar wykonany jest z wysokiej jakości tworzywa sztucznego dzięki czemu dodaje on wnętrzu lekkości, a dzięki ciekawej formie&nbsp; odrobinę humoru.&nbsp; Duża tarcza zegara (średnica 24 cm) składa się z 12 wąskich linii zakończonych kulkami z wyciętymi w środku kształtami kolejnych cyfr. Wskazówki są proste, z zaokrąglonymi końcami. W zależności od modelu w kolorze czarnym lub białym. Dzięki pustym przestrzeniom pomiędzy kolejnymi elementami zegar może stapiać się z kolorem ściany lub z nim kontrastować, dając ciekawy efekt \nKażdy zegar pakowany jest w dekoracyjne, kartonowe pudełko z przezroczystą przednią ścianką. Idealne na prezent. \nJeżeli zegar PINBALL&nbsp; nie sprostał Twoim oczekiwaniom, marka Koziol oferuje jeszcze zegar: \n- PIANO (zegar wzorowany klawiaturą fortepianu) \n- TOC TOC (współczesna wersja zegara z kukułką) \n- PI:P (asymetryczny zegar ze zwierzątkami) \n- SILK (proste linie poplątane w kontrolowanym chaosie) \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Pinball</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">szerokość - 24 cm<br class="def">\ngłębokość - 2,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zegar-scienny-24-cm-Koziol-PINBALL-czarny-KZ-2341526-p4065\',', '\'199\',', '\'161.79\',', '\'161.79\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Zegary\',',