	(1051, '\'Zegar ścienny 24 cm Koziol TOC TOC czarny KZ-2329103\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2329103\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Intrygujący zegar Toc Toc to współczesna wersja klasycznego zegara z kukułką. Umieszczony w okienku mały ptaszek PI:P (znany motyw wśród oferty marki Koziol), który w odróżnieniu do kukułki jest&nbsp; wyjątkowo cichym ptaszkiem. Zegar swoją oryginalną formą przykuwa uwagę, podobnie jak zastosowane kontrastowe&nbsp; kolory tarczy i wskazówek. Jeśli ktoś poszukuje czegoś wyjątkowego, to zegar ścienny Toc Toc wydaje się być idealnym wyborem. \nKażdy zegar pakowany jest w dekoracyjne, kartonowe pudełko z przezroczystą przednią ścianką. Idealne na prezent. \nJeżeli zegar TOC TOC nie sprostał Twoim oczekiwaniom, marka Koziol oferuje jeszcze zegar: \n- PINBALL (rozpryśnięta kulka z farbą) \n- PI:P (asymetryczny zegar ze zwierzątkami) \n- SILK (proste linie poplątane w kontrolowanym chaosie) \n- PIANO (zegar wzorowany klawiaturą fortepianu) \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Toc Toc</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 30,5 cm<br class="def">\nszerokość - 24 cm<br class="def">\ngłębokość - 2,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zegar-scienny-24-cm-Koziol-TOC-TOC-czarny-KZ-2329103-p4067\',', '\'169\',', '\'137.4\',', '\'137.4\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Zegary\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Zegar-scienny-24-cm-Koziol-TOC-TOC-czarny-KZ-2329103_[9834]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\