	(1053, '\'Zegar ścienny 45 cm Koziol PI:P pastelowy róż KZ-2327638\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2327638\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zegar Pi:P inspirowany prawdziwą naturą, a dokładniej lasem i leśnymi zwierzętami. Duża tarcza (śr. 45 cm) tego niezwykłego, oryginalnego zegara składa się z połączonych ze sobą cyfr o nieregularnej wielkości. Na niektórych z cyfr umieszczono leśne zwierzątka takie jak ptaszek, zajączek. Jasne, zaokrąglone wskazówki precyzyjnie wskazują aktualną godzinę. Taki zegar wprowadza do wnętrza inspirujący akcent i odrobinę humoru. \n Każdy zegar pakowany jest w dekoracyjne, kartonowe pudełko z przezroczystą przednią ścianką. Idealne na prezent. \n Jeżeli zegar PI:P nie sprostał Twoim oczekiwaniom, marka Koziol oferuje jeszcze zegar: \n - PINBALL (rozpryśnięta kulka z farbą) \n - SILK (proste linie poplątane w kontrolowanym chaosie) \n - PIANO (zegar wzorowany klawiaturą fortepianu) \n - TOC TOC (współczesna wersja zegara z kukułką) \n Produkt dostępny w wielu wariantach kolorystycznych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">PI:P</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 44,5 cm<br class="def">\nszerokość - 45 cm <br class="def">\ngłębokość - 3,3 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zegar-scienny-45-cm-Koziol-PI-P-pastelowy-roz-KZ-2327638-p4878\',', '\'199\',', '\'161.79\',', '\'161.79\',', '\'DEKORACJE &amp; AKCESORIA/Dekoracje ścienne/Panele dekoracyjne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zegar-scienny-45-cm-Koziol-PI-P-pastelowy-roz-KZ-2327638