	(1058, '\'Zegar ścienny 45 cm Koziol SILK kobaltowy KZ-2328585\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2328585\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Prezentowany tu elegancki i nowoczesny zegar ścienny pochodzi z kolekcji Silk, znanej z prostych linii poplątanych w kontrolowanym chaosie. Wskazówki zegara są wykonane&nbsp; w kontrastowym kolorze w stosunku do tarczy czyli białym, dlatego bardzo dobrze są widoczne. Zegar z tej serii charakteryzuje się brakiem cyfr na tarczy przez co nie da się precyzyjnie&nbsp; odczytać godziny. Czas szybko przemija, na szczęście szczęśliwi czasu nie liczą, a w tym przedmiocie najważniejszy jest jego ciekawy design! Idealnie wpasuje się we wnętrza urządzone w stylu loftowym, nowoczesnym i&nbsp; prowansalskim.&nbsp; Zegar wykonano z wysokiej jakości tworzywa sztucznego, dzięki czemu jest on lekki i nie nadaje wnętrzu zbędnej ciężkości. \n Każdy zegar pakowany jest w dekoracyjne, kartonowe pudełko z przezroczystą przednią ścianką. Idealne na prezent. \n Jeżeli zegar Silk nie sprostał Twoim oczekiwaniom, marka Koziol oferuje jeszcze zegar: \n - PINBALL (rozpryśnięta kulka z farbą) \n - PIANO (zegar wzorowany klawiaturą fortepianu) \n - TOC TOC (współczesna wersja zegara z kukułką) \n - PI:P (asymetryczny zegar ze zwierzątkami) \n Produkt dostępny w wielu wariantach kolorystycznych. \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Silk</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 45 cm<br class="def">\nszerokość - 45 cm<br class="def">\ngłębokość - 3,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">granatowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zegar-scienny-45-cm-Koziol-SILK-kobaltowy-KZ-2328585-p4701\',', '\'199\',', '\'161.79\',', '\'161.79\',', '\'DEKORACJE &amp; AKCESORIA/Akcesoria do domu/Zegary\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zegar-scienny-45-cm-Koziol-SILK-kobaltowy-KZ-2328585_[12111]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zegar-scienny-45-cm-Koziol-SILK-kobaltowy-KZ-2328585_[12112]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zegar-scienny-45-cm-Koziol-SILK-kobaltowy-KZ-2328585_[12113]_1200.jpg"}\''),
