	(1060, '\'Zestaw 2 szt patelni 24/28 cm + rączka Tefal Ingenio Expertise czarne L6509205\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'L6509205\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Tefal Ingenio Expertise to zestaw dwóch patelni 24 cm i 28 cm z odłączana rączką. Patelnie to praktyczne wyposażenie kuchenne, które jest niezbędne w każdym domu. \nPatelnie Tefal doskonale nadają się do smażenia, duszenia, gotowania na wodzie i do każdej innej obróbki żywności. Posiadają wskaźnik nagrzania patelni Termo-Spot, który zmienia kolor na intensywnie czerwony kiedy patelnia jest już nagrzana do temperatury pozwalajacej na rozpoczęcie użytkowania. Zestaw jest wyposażony w jedną łatwą w demontażu rączkę. Dzięki czemu gdy patelnie nie będą potrzebne można je schować do szafki i nie zajmują dużo miejsca. \nZestaw składa się: \npatelnia mała 24 cm \npatelnia duża 28 cm \nzdejmowaną rączkę \nDzięki zestawowi Tefal Ingenio Expertise zawsze będziesz mieć pod ręką patelnie dostosowaną do swoich potrzeb. Potrzebujesz patelni żeby zrobić grzankę, użyj patelni małej. Potrzebujesz usmażyć kotlety dla całej czteroosobowej rodziny wybierz dużą patelnie. Gotowanie szybko, sprawnie, niezawodnie tylko z marką Tefal. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Ingenio Expertise</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 24/28cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-2-szt-patelni-24-28-cm-raczka-Tefal-Ingenio-Expertise-czarne-L6509205-p5672\',', '\'254\',', '\'206.5\',', '\'206.5\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-2-szt-patelni-2428-cm-raczka-Tefal-Ingenio-Expertise-L6509205_[18188]_1200.jpg","1":"http:\\/\\/wetro.pl\\/