	(1062, '\'Zestaw 3 organizerów łazienkowych XS,M,XL Koziol biały KZ-2847525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2847525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Organizer łazienkowy Surf zapewnia porządek i wygodę w łazience. Można zawiesić go wygodnie przy baterii lub na relingu. Od spodu ma dwa otwory umożliwiające odprowadzenie wody lub przyłączanie kolejnego organizera Surf. Surf przeznaczony jest to trzymania akcesoriów łazienkowych i kosmetyków. \n Zestaw składa się z trzech organizerów o wielkości XS, M, XL. Każdy w kolorze białym. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Surf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def"><strong class="def">Surf XS:</strong><br class="def">\nwysokość - 17,6 cm<br class="def">\nszerokość - 15 cm<br class="def">\ngłębokość - 5,3 cm<br class="def">\n<br class="def">\n<strong class="def">Surf M:</strong><br class="def">\nszerokość - 21,6 cm<br class="def">\ngłębokość - 6,5 cm<br class="def">\n<br class="def">\n<strong class="def">Surf XL:</strong><br class="def">\nwysokość - 31,50 cm<br class="def">\nszerokość - 27 cm<br class="def">\ngłębokość - 8,10 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-3-organizerow-lazienkowych-XS-M-XL-Koziol-bialy-KZ-2847525-p5232\',', '\'0\',', '\'0\',', '\'0\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Organizery i półki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Zestaw-3-organizerow-lazienkowych-XS-M-XL-Koziol-bialy-KZ-2847525_[14376]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Zestaw-3-organizerow-lazienk