	(1069, '\'Zestaw 4 szt. Podkładek Stone Marble Ladelle LD-49270\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-49270\',', 0, '\'Ladelle\',', NULL, 0, NULL, NULL, '\'.\',', '\'Zestaw 4 szt. Podkładek Stone Marble nie tylko okaże się świetną dekoracją dla Twojego jadalnianego stołu, ale także ochroni go przed plamami po napojach czy gorącą temperaturą kubków. Idealnie nadadzą się na kolacje w gronie rodziny lub spotkania towarzyskie. Wykonane zostały z korka z połyskującą powierzchnią. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 33,5 cm<br class="def">\nszerokość - 26 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">korek</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-4-szt-Podkladek-Stone-Marble-Ladelle-LD-49270-p3923\',', '\'124\',', '\'100.81\',', '\'100.81\',', '\'KUCHNIA &amp; JADALNIA/Tekstylia kuchenne/Podkładki na stół\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-4-szt-Podkladek-Stone-Marble-Ladelle-LD-49270_[13160]_1200.jpg"}\''),
	(1070, '\'Zestaw 4 szt. Podkładek z nadrukiem Korek Ladelle czarny LD-40046\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-40046\',', 0, '\'Ladelle\',', NULL, 0, NULL, NULL, '\'.\',', '\'Podkładka czy bieżnik? Co wolisz? aby zabezpieczyć swój stół przed zabrudzeniem i zniszczeniem. Marka Ladelle przychodzi z pomocą z tym dylematem i oferuje kilka ciekawych wzorów podkładek na stół. Dostępna szeroka oferta na pewno pozwoli aby każdy znalazł wśród niej coś co będzie mu od powiać, coś co będzie spełniać oczekiwania i będzie się wpisywać w charakter posiadanego mieszkania, domu. \n Podkładka na stół to nowoczesne podejście do nakrywania stołów &nbsp;wykorzystywana nie tylko podczas spożywania posiłków. Produkt może stanowić stałą i elegancką ozdobę do użytku codziennego. Dekoracja położona na stole&nbsp; może zastąpić tradycyjny obrus , który raz zalany napojem czy zabrudzony kawałkami jedzenia nadaje się do prania. Podkładka w takich przypadkach ma znaczną przewagę, wystarczy jedynie przetrzeć ściereczką podkładkę, a wróci ona do pełnej czystości, bez prania i suszenia. Podkładka ma kształt prostokąta z zaokrąglonymi bokami, wykonana z bardzo modnego obecnie materiału - naturalnego korka. Na powierzchni jest nadrukowany delikatny wzór symetrycznych figur geometrycznych w kolorze czarnym.&nbsp; \n Zestaw zawiera 4 szt. podkładek. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">długość - 45 cm<br class="def">\nszerokość - 30 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">korek</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-4-szt-Podkladek-z-nadrukiem-Korek-Ladelle-czarny-LD-40046-p3928\',', '\'132\',', '\'107.32\',', '\'107.32\',', '\'KUCHNIA &amp; JADALNIA/Tekstylia kuchenne/Podkładki na stół\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-4szt-Podkladek-z-nadrukiem-Korek-Ladelle-czarny-LD-40046_[8173]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Zestaw-4-szt-Podkladek-z-nadrukiem-Korek-Ladelle-czarny-LD-40046_[9565]_1200.jpg"}\''),
	(1071, '\'Zestaw 7 el. garnków Tefal Duetto srebrny A705A835\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'A705A835\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw pięciu garnków z przykrywkami marki TEFAL z serii Duetto to idealny komplet do codziennego gotowania. \n Zestaw 7 el. Tefal Duetto składa się z \n - rondelka o średnicy 16 cm i pojemności 1,3 litra \n- garnka o średnicy 18 cm ze szklaną pokrywą o pojemności 1,9 litra \n- garnka o średnicy 20 cm ze szklaną pokrywą o pojemności 2,7 litra \n- garnka o średnicy 24 cm ze szklaną pokrywą o pojemności 4,7 litra \n lGarnki są wykonane z najwyższej jakości stali nierdzewnej, a pokrywki ze szkła. Gruby spód kapsułowy zapewnia równomierną dystrybucję ciepła i najwyższą odporność produktu na niechciane odkształcenia. Rączki nie nagrzewają się do temperatury skutkującej poparzeniem dłoni.&nbsp; Wewnątrz garnków znajduje się miarka ułatwiająca odmierzanie i przygotowywanie potraw. Specjalne dziurkowane wypustki w pokrywkach ułatwiają odlewanie. Jedną z wielu zalet zestawu Duetto jest możliwość użytkowania również w piekarniku w temperaturze do 260?C (pokrywki do 170?C). Posiada aż 10 lat gwarancji na stal nierdzewną. \nTaki różnorodny, praktyczny i elegancki zestaw naczyń doskonale sprawdzi się w każdym domu! \nIdealny na prezent z okazji parapetówki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Duetto</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 16/18/20/24 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">stal nierdzewna</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835-p5678\',', '\'420\',', '\'341.46\',', '\'341.46\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835_[18219]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835_[18220]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835_[18221]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835_[18222]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835_[18223]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-7-el-garnkow-Tefal-Duetto-srebrny-A705A835_[18224]_1200.jpg"}\''),
	(1072, '\'Zestaw 8 szt. widelczyków do koreczków na drzewku Koziol A:PRIL kolorowe KZ-3126473\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3126473\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw 8 szt. widelczyków do przekąsek z kolekcji A-pril to rarytas dla poszukiwaczy dobrego designu. Widelczyki są lekkie i kolorowe, zakończone ozdobnym kwiatuszkiem. Sprawdzą się zarówno podczas domowych eventów jak również imprez organizowanych na świeżym powietrzy w ogrodzie, tarasie, parku. Znacznie ułatwiają swoją obecności sięganie po małe przekąski. Dodatkowo jak nie będą używane można je odłożyć do stojak w kształcie drzewka. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">A-Pril</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 19,2 cm<br class="def">\ndługość - 17 cm<br class="def">\nszerokość - 4 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">wielokolorowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-8-szt-widelczykow-do-koreczkow-na-drzewku-Koziol-A-PRIL-kolorowe-KZ-3126473-p4702\',', '\'86\',', '\'69.92\',', '\'69.92\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Akcesoria do przekąsek\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-8-szt-widelczykow-do-koreczkow-na-drzewku-Koziol-A-PRIL-kolorowe-KZ-3126473_[12114]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-8-szt-widelczykow-do-koreczkow-na-drzewku-Koziol-A-PRIL-kolorowe-KZ-3126473_[12115]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-8-szt-widelczykow-do-koreczkow-na-drzewku-Koziol-A-PRIL-kolorowe-KZ-3126473_[12116]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/we