	(1077, '\'Zestaw 8 szt. widelczyków do koreczków na stojaku Koziol A-PRIL KZ-3119473\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3119473\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw 8 szt. widelczyków do przekąsek z kolekcji A-pril to rarytas dla poszukiwaczy dobrego designu. Widelczyki są lekkie i kolorowe, zakończone ozdobnym kwiatuszkiem. Sprawdzą się zarówno podczas domowych eventów jak również imprez organizowanych na świeżym powietrzy w ogrodzie, tarasie, parku. Znacznie ułatwiają swoją obecności sięganie po małe przekąski. Dodatkowo jak nie będą używane można je odłożyć do stojak w kształcie doniczki. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">A-Pril</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 12,2 cm<br class="def">\nśrednica - 8 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">wielokolorowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-8-szt-widelczykow-do-koreczkow-na-stojaku-Koziol-A-PRIL-KZ-3119473-p4707\',', '\'84\',', '\'68.29\',', '\'68.29\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Akcesoria do przekąsek\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-8-szt-widelczykow-do-koreczkow-na-stojaku-Koziol-A-PRIL-KZ-3119473_[12126]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-8-szt-widelczykow-do-koreczkow-na-stojaku-Koziol-A-PRIL-KZ-3119473_[12127]_1200.jpg"}\''),
	(1078, '\'Zestaw do cytrusów Koziol FRESH VITAMINS KZ-3734100\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3734100\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw akcesoriów do cytrusów Fresh Vitamins to zestaw, który powinien się znaleźć w każdym domu w którym króluje zdrowa żywność, zwłaszcza pełne witamin, smaczne owoce. W skład zestawu wchodzą trzy narzędzia nawiązują swoim kształtem do zwierzątek. Pomarańczowy ślimaczek - Emma P., to znany już bohater oferty marki Koziol, służący do obierania pomarańczy. Różowy flaming &ndash; Pink, służy jako mała łyżeczka do wybierania kawałków grejpfruta. Ostatni zielony zwierzak to ptaszek Kiwi, pomagający w wybieraniu miąższu kiwi. Z takim wesołym zestawem nie trudno będzie namówić dzieciaki do owocowych, zdrowych podwieczorków. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">FRESH VITAMINES</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 20 cm<br class="def">\ndługość - 12,5 cm<br class="def">\nszerokość - 1,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">wielokolorowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-do-cytrusow-Koziol-FRESH-VITAMINS-KZ-3734100-p4708\',', '\'29\',', '\'23.58\',', '\'23.58\',', '\'KUCHNIA &amp; JADALNIA/Akcesoria kuchenne/Inne akcesoria kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-do-cytrusow-Koziol-FRESH-VITAMINS-KZ-3734100_[12128]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-do-cytrusow-Koziol-FRESH-VITAMINS-KZ-3734100_[12129]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-do-cytrusow-Koziol-FRESH-VITAMINS-KZ-3734100_[12130]_1200.jpg"}\''),
	(1079, '\'Zestaw dwóch patelni 20/26 cm Tefal Extra czarny B3019072\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'B3019072\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw dwóch patelni uznanej marki TEFAL z serii Extra. Zestaw składa się z dwóch patelni mniejszej (średnica 20 cm) oraz większej (średnica 26 cm). Patelnie to praktyczne akcesoria kuchenne, które są niezbędne w każdym domu. \nPatelnie Tefal doskonale nadają się do smażenia, duszenia, gotowania na wodzie. Wyróżniają się nieprzywierającą powłoką zewnętrzną i wewnętrzną co jest ich ogromną zaletą. Posiadają wskaźnik nagrzania patelni Termo-Spot, który zmienia kolor na intensywnie czerwony kiedy patelnia jest już nagrzana do temperatury pozwalajacej na rozpoczęcie uzytkowania. Patelnie są wyposażone w ergonomiczny uchwyt z miejscem na kciuk. Cechują się lekką konstrukcję zapewniającą łatwiejsze i wygodniejsze użytkowanie. Produkt można myć w zmywarce i użytkować na kuchenkach gazowych oraz ceramicznych. \n \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Extra</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def"><strong class="def">mała patelnia:</strong><br class="def">\nśrednica - 20 cm<br class="def">\n<br class="def">\n<strong class="def">duża patelnia:</strong><br class="def">\nśrednica - 26 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-dwoch-patelni-20-26-cm-Tefal-Extra-czarny-B3019072-p5655\',', '\'98\',', '\'79.67\',', '\'79.67\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-Patelni-Tefal-2026cm-B3019072_[18075]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-dwoch-patelni-2026-cm-Tefal-Extra-czarny-B3019072_[18155]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-dwoch-patelni-2026-cm-Tefal-Extra-czarny-B3019072_[18156]_1200.jpg"}\''),
	(1080, '\'Zestaw garnków 20 el. Tefal Ingenio Essential czarny L2009702\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'L2009702\',', 0, '\'Tefal\',', NULL, 0, NULL, NULL, NULL, '\'Ingenio Essential kupujesz jeden produkt, a masz zapewnione kompleksowe wyposażenie całej kuchni! \n Zestaw 20 elementów marki TEFAL z serii Ingenio Essential to idealny komplet zawierający wszystkie niezbędne naczynia i akcesoria w Twojej kuchni do codziennego gotowania. \nW zestawie Ingenio Essential otrzymasz:&nbsp;3 rondle, 4 patelnie , patelnię głęboką, pokrywę do smażenia, pokrywkę&nbsp;do odcedzania, plastikowe pokrywki o średnicach 16, 20, 28 cm. Dodatkowo zestaw zawiera następujące akcesoria: trzy&nbsp;szpatułki - długą, naleśnikową i zakrzywioną, chochlę, łyżkę i dwie wyjmowane rączki Ingenio. \nKompleksowy i praktyczny zestaw garnków, patelni i akcesoriów Ingenio z odłączaną rączką to podstawowe i kompleksowe wyposażenie każdej kuchni. Z Ingenio możesz używać tego samego naczynia wykorzystując je różnorodnie od gotowania, przygotowania posiłków po przechowywanie i serwowania na stół.&nbsp; Do tego w garnkach z tego zestawu zostało zastosowane nałożenie powłoki Resistium oraz wskaźnika temperatury Termo-Spot. Powłoka Resistium chroni przed niechcianymi zarysowaniami oraz zapobiega przywieraniu&nbsp;żywności do wewnętrznej części, dzięki czemu można dłużej cieszyć się znakomitym wyglądem garnków nie tracąc przy tym ich dobrych właściwości. Natomiast wskaźnik temperatury Termo-Spot informujący o tym, kiedy temperatura garnka jest odpowiednia do rozpoczęcia użytkowania. Po osiągnięciu optymalnej temperatury czerwony wzór Thermo-Spot zaczyna znikać.&nbsp; Odłączana rączka pozwala włożyć jeden garnek w drugi oszczędzając przy tym miejsce. Plastikowe i szczelne pokrywki są idealne do przechowywania ugotowanych potraw w lodówce, a także do zabrania gotowego posiłku do szkoły lub pracy. \nSzczegółowy skład zestawu: \n rondle, średnica 16/18/20cm \n patelnie, średnica 20/24/26/28cm \n patelnia głęboka, średnica 24cm \n pokrywka do smażenia 20-28cm, \n pokrywka do odcedzania 14-20cm \n plastikowe pokrywki, średnica 16/28/20cm \n akcesoria: długa szpatułka, naleśnikowa, chochla, łyżka, szpatułka zakrzywiona \n 2 rączki Ingenio \n &nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">średnica - 16/18/20/20/24/26/28</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">aluminium, szkło, stal nierdzewna</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-garnkow-20-el-Tefal-Ingenio-Essential-czarny-L2009702-p5662\',', '\'694\',', '\'564.23\',', '\'564.23\',', '\'_Import WETRO/Tefal\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-garnkow-20-el-Tefal-Ingenio-Essential-czarny-L2009702_[18125]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-garnkow-20-el-Tefal-Ingenio-Essential-czarny-L2009702_[18158]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-garnkow-20-el-Tefal-Ingenio-Essential-czarny-L2009702_[18159]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-garnkow-20-el-Tefal-Ingenio-Essential-czarny-L2009702_[18160]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Zestaw-garnkow-20-el-Tefal-Ingenio-Essential-czarny-L2009702_[18161]_1200.jpg"}\''),
	(1081, '\'Zestaw misa i sztućce do sałaty Koziol LEAF zielona KZ-3692377\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3692377\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw: biała misa do sałatek wraz z musztardowymi sztućcami z kolekcji Leaf, niemieckiej marki &quot;fabryki szczęścia&quot; Koziol. Zainspirowana kształtem liści, misa doskonale nada się na sałatki, dania i owoce. Wykonana z trwałego, przyjemnego w dotyku tworzywa sztucznego dedykowanego do przemysłu spożywczego. Opływowa, stabilna konstrukcja z wygodnymi uchwytami zapewnia łatwość i przyjemność użytkowania. Pomysłowo dopasowane kształtem do misy sztućce są poręczne, wygodne w użyciu. \n Dobierz miseczki w innych kształtach, rozmiarach i korzystaj z możliwości praktycznego przechowywania mis jedna w drugiej. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Leaf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 32,9 cm<br class="def">\ndługość - 48,6 cm<br class="def">\nszerokość - 32,9 cm<br class="def">\npojemność - 3L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">szary, czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-misa-i-sztucce-do-salaty-Koziol-LEAF-zielona-KZ-3692377-p4943\',', '\'148\',', '\'120.33\',', '\'120.33\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Misy do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misa-i-sztucce-do-salaty-Koziol-LEAF-zielona-KZ-3692377_[13412]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misa-i-sztucce-do-salaty-Koziol-LEAF-zielona-KZ-3692377_[13413]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misa-i-sztucce-do-salaty-Koziol-LEAF-zielona-KZ-3692377_[13414]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misa-i-sztucce-do-salaty-Koziol-LEAF-zielona-KZ-3692377_[13415]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misa-i-sztucce-do-salaty-Koziol-LEAF-zielona-KZ-3692377_[13416]_1200.jpg"}\''),
	(1082, '\'Zestaw misek 4 szt. Koziol Leaf XXS białe KZ-3654525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3654525\',', 0, '\'Koziol\',', NULL, NULL, NULL, NULL, NULL, '\'Niezależnie od okoliczności spotkania, przyjęcia, imprezy niezbędne zawsze są miseczki na przekąski, przystawki, dipy. Zestaw czterech identycznych, małych miseczek (pojemność 40 ml każda&nbsp; o delikatnej formie w kształcie liścia sprawdzą się za każdym razem. Miseczki są małe, ale pojemne. Można je łatwo przenieść i rozmieścić w różnych miejscach stołu tak, aby każdy uczestnik zabawy miał swobodny dostęp do smakołyków. Miseczki są wykonane z tworzywa sztucznego, ale nie wyglądają tandetnie, wręcz przeciwnie są eleganckie i delikatne. \n&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Leaf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 4,2 cm<br class="def">\ndługość - 10 cm<br class="def">\nszerokość - 6,9 cm<br class="def">\npojemność - 40 ml</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-misek-4-szt-Koziol-Leaf-XXS-biale-KZ-3654525-p4769\',', '\'12\',', '\'9.76\',', '\'9.76\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Misy do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-misek-4-szt-Koziol-Leaf-XXS-biale-KZ-3654525_[12236]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-misek-4-szt-Koziol-Leaf-XXS-biale-KZ-3654525_[12237]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misek-4-szt-Koziol-Leaf-XXS-biale-KZ-3654525_[13071]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misek-4-szt-Koziol-Leaf-XXS-biale-KZ-3654525_[13072]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/13000-14000\\/Zestaw-misek-4-szt-Koziol-Leaf-XXS-biale-KZ-3654525_[13073]_1200.jpg"}\''),
	(1083, '\'Zestaw patery na tort i łopatki do serwowania Ladelle biały LD-61047\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'LD-61047\',', 0, '\'Ladelle\',', NULL, 0, NULL, NULL, '\'.\',', '\'Zestaw patery na tort i łopatki do serwowania jest idealny do prezentowania i podawania pięknych tortów, ciast. Wyposażona w wytłaczane wzorki i koronkowe detale sprawią, że ??goście będą Ci jej zazdrościć! W zestawie oprócz patery jest też łopatka wykonana w tym samym do bezpiecznego nakładania ciasta, tak aby jego forma pozostała niezmieniona. Zestaw jest wykonany z wysokiej jakości porcelany w jednolitym, pastelowym kolorze. \n Dostępne kolory: biały, różowy turkusowy. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 2,8 cm<br class="def">\ndługość - 30 cm<br class="def">\nszerokość - 30 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">porcelana</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047-p3952\',', '\'165\',', '\'134.15\',', '\'134.15\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Patery i etażerki na ciasto\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047_[8197]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047_[8449]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047_[8450]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047_[8451]_1200.jpg","4":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047_[8452]_1200.jpg","5":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/8000-9000\\/Zestaw-patery-na-tort-i-lopatki-do-serwowania-Ladelle-bialy-LD-61047_[8453]_1200.jpg"}\''),
	(1084, '\'Zestaw pojemników na przyprawy 4x0,035L z etui EMSA wielokolorowe EM-513680\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'EM-513680\',', 0, '\'EMSA\',', NULL, 0, NULL, NULL, '\'.\',', '\'Zestaw pojemniczków na sól, pieprz, paprykę i bazylię w praktycznym etui. Każdy z pojemniczków ma wymiary: długość - 14,5 cm, szerokość - 2,2 cm , natomiast ich pojemność wynosi 0.035 L. Wykonane z wysokiej jakości tworzywa sztucznego, świetnie sprawdzą się zarówno w kuchni jak i na grillu w ogrodzie. Do zestawu załączony zestaw czterech przypraw - gratis. Etui można prać w pralce, a pojemniczki bez obaw myć w zmywarce. \n Posiada 2 lata gwarancji. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Spice Box</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 23,5 cm<br class="def">\ndługość - 15 cm<br class="def">\nszerokość - 2,5 cm<br class="def">\npojemność - 4x0,035 l</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">pomarańczowy, biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">Tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-pojemnikow-na-przyprawy-4x0-035L-z-etui-EMSA-wielokolorowe-EM-513680-p2284\',', '\'109\',', '\'88.62\',', '\'88.62\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Przyprawniki\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Zestaw-pojemnikow-na-przyprawy-4-x-0-035-l-z-etui-EM-513680_[4651]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/4000-5000\\/Zestaw-pojemnikow-na-przyprawy-4-x-0-035-l-z-etui-EM-513680_[4652]_1200.jpg"}\''),
	(1085, '\'Zestaw trzech pojemników kuchennych 570ml/ 1,4L/ 2,95L Forme Casa biały FC-21885211\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-21885211\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw trzech pojemników do przechowywania żywność. Pojemniki mają różną pojemność 2,95L, 1,4L, 570 ml. Wykonane z wysokiej jakości tworzywa sztucznego. Świetnie sprawdzą się zarówno w kuchni jak i na kanapki/obiady zabierane do pracy. Są bezpieczne do przechowywania żywności. \nPojemniki posiadają przemyślaną formę i dopasowaną przykrywkę co sprawia, że użytkowanie ich jest łatwe i przyjemne. Można je bezpiecznie przenosić, chwytając zarówno za spód jak i za samą przykrywkę. Nie ma obaw o&nbsp; zawartość nawet kiedy pojemnik upadnie lub przewróci się, ponieważ jest bardzo szczelny. Żywność w nim całkowicie bezpieczna i dłużej świeża. Cały pojemnik jest przezroczysty, dlatego zawsze przed otwarciem można podejrzeć jego zawartość. Wykończony&nbsp; przykryciem w jednolitym kolorze z delikatnym symbolem (na każdym z pojemników inny). \nZestaw pojemników dostępny jest w czterech kolorach: białym, niebieskim, czerwonym i zielonym. \nMarka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">pojemność - 570 ml<br class="def">\npojemność - 1,4 L<br class="def">\npojemność - 2,95 L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały, przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-trzech-pojemnikow-kuchennych-570ml-1-4L-2-95L-Forme-Casa-bialy-FC-21885211-p4112\',', '\'49\',', '\'39.84\',', '\'39.84\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Zestaw-trzech-pojemnikow-kuchennych-570ml-1-4L-2-950L-Forme-Casa-bialy-FC-21885211_[9957]_1200.jpg"}\''),
	(1086, '\'Zestaw trzech pojemników kuchennych 570ml/ 1,4L/ 2,95L Forme Casa czerwony FC-21885231\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'FC-21885231\',', 0, '\'Forme Casa\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw trzech pojemników do przechowywania żywność. Pojemniki mają różną pojemność 2,95L, 1,4L, 570 ml. Wykonane z wysokiej jakości tworzywa sztucznego. Świetnie sprawdzą się zarówno w kuchni jak i na kanapki/obiady zabierane do pracy. Są bezpieczne do przechowywania żywności. \nPojemniki posiadają przemyślaną formę i dopasowaną przykrywkę co sprawia, że użytkowanie ich jest łatwe i przyjemne. Można je bezpiecznie przenosić, chwytając zarówno za spód jak i za samą przykrywkę. Nie ma obaw o&nbsp; zawartość nawet kiedy pojemnik upadnie lub przewróci się, ponieważ jest bardzo szczelny. Żywność w nim całkowicie bezpieczna i dłużej świeża. Cały pojemnik jest przezroczysty, dlatego zawsze przed otwarciem można podejrzeć jego zawartość. Wykończony&nbsp; przykryciem w jednolitym kolorze z delikatnym symbolem (na każdym z pojemników inny). \nZestaw pojemników dostępny jest w czterech kolorach: białym, niebieskim, czerwonym i zielonym. \nMarka Forme Casa zrodziła się z potrzeby występującej na rynku na proste, a zarazem eleganckie i użyteczne akcesoria kuchenne. Forme Casa to nowa propozycja od włoskiego, popularnego na rynku polskim producenta Guzzini. W ofercie produktowej nowej marki można rozpoznać kształty, kolory i wysoką jakość tak bardzo charakterystyczną dla Guzzini. Uproszczone zostały jedynie formy, tak aby zaproponować produkty atrakcyjne cenowo. \n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">pojemność - 570 ml<br class="def">\npojemność - 1,4 L<br class="def">\npojemność - 2,95 L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czerwony, przeźroczysty</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-trzech-pojemnikow-kuchennych-570ml-1-4L-2-95L-Forme-Casa-czerwony-FC-21885231-p4113\',', '\'49\',', '\'39.84\',', '\'39.84\',', '\'KUCHNIA &amp; JADALNIA/Przechowywanie/Pojemniki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/9000-10000\\/Zestaw-trzech-pojemnikow-kuchennych-570ml-1-4L-2-950L-Forme-Casa-czerwony-FC-21885231_[9971]_1200.jpg"}\''),
