	(1089, '\'Zestaw uchwytów na szczoteczki do zębów 3 szt. Koziol TOMMY KZ-5826393\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-5826393\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Zestaw trzech uchwytów na szczoteczki do zębów w kolorze transparentnym, niebieskim, pastelowym różowym.&nbsp; \n Zabawny uchwyt na szczoteczkę do zębów niemieckiej marki Koziol. Wykonany z wysokiej jakości tworzywa sztucznego, wprowadzi odrobinę humoru do każdej łazienki. Produkt posiada uniwersalną przyssawkę, dzięki której w łatwy sposób można ją zamontować i w każdej chwili zmienić miejsce jej przytwierdzenia. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Tommy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 5,7 cm<br class="def">\ndługość - 4,7 cm<br class="def">\nszerokość - 3,2 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">niebieski, różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-uchwytow-na-szczoteczki-do-zebow-3-szt-Koziol-TOMMY-KZ-5826393-p5233\',', '\'67\',', '\'54.47\',', '\'54.47\',', '\'ŁAZIENKA &amp; GARDEROBA/WYPOSAŻENIE ŁAZIENKI/Wieszaki łazienkowe\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Zestaw-uchwytow-na-szczoteczki-do-zebow-3-szt-Koziol-TOMMY-KZ-5826393_[14379]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Zestaw-uchwytow-na-szczoteczki-do-zebow-3-szt-Koziol-TOMMY-KZ-5826393_[14380]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/14000-15000\\/Zestaw-uchwytow-na-szczoteczki-do-zebow-3-szt-Koziol-TOMMY-KZ-5826393_[14381]_1200.jpg"}\''),
	(1090, '\'Zestaw: misa i sztućce do serwowania sałatek Koziol LEAF L pastelowy róż-pastelowy błękit KZ-3692416\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3692416\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Duża misa na sałatki o delikatnej formie w kształcie liścia z dużymi, wygodnymi sztućcami to dobry początek i powód do zmiany stylu żywienia. Dekoracyjna misa bardzo zachęca do czestego użytkowania i jedzenia zdrowych, pysznych, domowych sałatek. \nTaka wspaniała misa na każdym stole zajmie główne miejsce wspaniale prezentując serwowane potrawy. \nDobierz miseczki w innych kształtach, rozmiarach i korzystaj z możliwości praktycznego przechowywania mis jedna w drugiej. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Leaf</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 12,7 cm<br class="def">\ndługość - 48,6 cm<br class="def">\nszerokość - 32,9 cm<br class="def">\npojemność - 3 L</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">niebieski, różowy</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Zestaw-misa-i-sztucce-do-serwowania-salatek-Koziol-LEAF-L-pastelowy-roz-pastelowy-blekit-KZ-3692416-p4710\',', '\'148\',', '\'120.33\',', '\'120.33\',', '\'KUCHNIA &amp; JADALNIA/Do serwowania/Misy do serwowania\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-misa-i-sztucce-do-serwowania-salatek-Koziol-LEAF-L-pastelowy-roz-pastelowy-blekit-KZ-3692416_[12134]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\/Zestaw-misa-i-sztucce-do-serwowania-salatek-Koziol-LEAF-L-pastelowy-roz-pastelowy-blekit-KZ-3692416_[12135]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/12000-13000\\