	(1101, '\'Łopatka do mieszania 30,5 cm Koziol TURNER czarna KZ-3003526\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3003526\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Kuchenna łopatka niemieckiej marki Koziol wykonana z wysokiej jakości tworzywa sztucznego. Idealna do pieczenia m.in. omletów, placków, mięs, a nawet wygarniania masy z miski. Kształt łopatki pozwala na dokładne wygarnianie ciasta z zagłębień i dodatkowo nie rysuje powierzchni innych naczyń. W komplecie załączony języczek na przyssawce, który może służyć jako wieszaczek na łopatkę. Produkt ten, nie dość że jest bardzo praktyczny, może pełnić jednocześnie funckje dekoracyjną. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Turner</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 30,5 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czarny</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lopatka-do-mieszania-30-5-cm-Koziol-TURNER-czarna-KZ-3003526-p3193\',', '\'55\',', '\'44.72\',', '\'44.72\',', '\'KUCHNIA &amp; JADALNIA/Narzędzia kuchenne/Szpatułki i łyżki kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/6000-7000\\/Lopatka-do-mieszania-czarna-Turner-KZ-3003526_[6535]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/6000-7000\\/Lopatka-do-mieszania-czarna-Turner-KZ-3003526_[6536]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/18000-19000\\/Lopatka-do-mieszania-30-5-cm-Koziol-TURNER-czarna-KZ-3003526_[18260]_1200.jpg"}\''),
