	(1124, '\'Łyżka do karmy dla zwierząt Koziol MIAOU biala KZ-2921525\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-2921525\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Estetycznie wyglądająca łyżka z ozdobnym uchwytem z wizerunkiem kotka to prawdziwe udogodnienie dla sympatyków zwierząt. Łyżka posłuży do nakładania jedzonka do miseczki oraz do mieszania w misce. Choć jest z wizerunkiem kocura to nie tylko do nakładania jedzenia dla tego zwierzątka. Sprawdzi się także u właścicieli piesków, ptaszków czy rybek. Dzięki temu unikatowemu wyglądowi łyżki od razu widać do kogo należy. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Miaou</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 18,8 cm<br class="def">\ndługość - 4,1 cm<br class="def">\nszerokość - 1,1 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">biały</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lyzka-do-karmy-dla-zwierzat-Koziol-MIAOU-biala-KZ-2921525-p4332\',', '\'10\',', '\'8.13\',', '\'8.13\',', NULL, '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lyzka-do-karmy-dla-zwierzat-Koziol-MIAOU-biala-KZ-2921525_[10867]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lyzka-do-karmy-dla-zwierzat-Koziol-MIAOU-biala-KZ-2921525_[10868]_1200.jpg"}\''),
