	(1127, '\'Łyżka do lodów 20 cm Koziol DW I CREAM niebieska KZ-3038602\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3038602\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, '\'.\',', '\'Zabawna i pożyteczna łyzka do nakładanai lodów - Koziol Ice Scream. Wygodna w uzyciu, z łatwością można nią zaserwować spore porcje lodów które łużka uformuje w estetyczne gałki. Kolory oraz śmieszny design sprawią jeszcze więcej radości podczas serwowania lodowego deseru. \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">I Scream</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 20 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">Tworzywo sztuczne</strong>\n <br class="def">\n<br class="def">\n<span class="def">Dodatkowe informacje:</span>\n<p class="def">\n Możliwość mycia w zmywarce: tak\n </p>\n\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lyzka-do-lodow-20-cm-Koziol-DW-I-CREAM-niebieska-KZ-3038602-p2512\',', '\'34\',', '\'27.64\',', '\'27.64\',', '\'KUCHNIA &amp; JADALNIA/Narzędzia kuchenne/Inne narzędzie kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/5000-6000\\/Lyzka-do-lodow-niebieska-I-Scream-KZ-3038602_[5111]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/5000-6000\\/Lyzka-do-lodow-niebieska-I-Scream-KZ-3038602_[5112]_1200.jpg"}\''),
	(1128, '\'Łyżka do miodu Koziol HANNI malinowa KZ-3201536\',', 0, 0, 0, 0, NULL, NULL, 0, 0, '\'KZ-3201536\',', 0, '\'Koziol\',', NULL, 0, NULL, NULL, NULL, '\'Łyżka do miodu Hanni to pomysłowy sposób na to, by uniknąć ciężko wybawianych plam z miodu ze stołu, obrusu, blatu. Specyficzny kształt łyżki pozwala na to aby miód ściekał powoli pokonując długą drogę w dół spiralnego toru, dając sporo czasu na przeniesienie miodu na kanapkę, do szklanki z herbatą czy do miseczki z musli. Bez plam, bez zmarnowanego miodu, bez kłopotu.&nbsp; Łyżka wykonana jest z tworzywa sztucznego wykończona na uchwycie wizerunkiem pracowitej pszczółki.&nbsp; \n <br class="def">\n<br class="def">\n<span class="def">Kolekcja:</span>\n <strong class="def">Hanni</strong>\n <br class="def">\n<br class="def">\n<span class="def">Wymiary:</span>\n <strong class="def">wysokość - 20,5 cm<br class="def">\ndługość - 2,2 cm<br class="def">\nszerokość - 2,7 cm</strong>\n <br class="def">\n<br class="def">\n<span class="def">Kolor:</span>\n <strong class="def">czerwony</strong>\n <br class="def">\n<br class="def">\n<span class="def">Materiał:</span>\n <strong class="def">tworzywo sztuczne</strong>\',', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '\'http://wetro.pl/Lyzka-do-miodu-Koziol-HANNI-malinowa-KZ-3201536-p4334\',', '\'16\',', '\'13.01\',', '\'13.01\',', '\'KUCHNIA &amp; JADALNIA/Narzędzia kuchenne/Inne narzędzie kuchenne\',', '\'{"0":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lyzka-do-miodu-Koziol-HANNI-malinowa-KZ-3201536_[10871]_1200.jpg","1":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lyzka-do-miodu-Koziol-HANNI-malinowa-KZ-3201536_[10872]_1200.jpg","2":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lyzka-do-miodu-Koziol-HANNI-malinowa-KZ-3201536_[10873]_1200.jpg","3":"http:\\/\\/wetro.pl\\/images\\/wetrosklep\\/10000-11000\\/Lyzka-do-miodu-Koziol-HANNI-malinowa-KZ-3201536_[10874]_1200.jpg"}\''),
